<script>

/**
 * jQuery Plugin: Sticky Tabs
 *
 * @author Aidan Lister <aidan@php.net>
 * adapted by Ruben Arslan to activate parent tabs too
 * http://www.aidanlister.com/2014/03/persisting-the-tab-state-in-bootstrap/
 */
(function($) {
  "use strict";
  $.fn.rmarkdownStickyTabs = function() {
    var context = this;
    // Show the tab corresponding with the hash in the URL, or the first tab
    var showStuffFromHash = function() {
      var hash = window.location.hash;
      var selector = hash ? 'a[href="' + hash + '"]' : 'li.active > a';
      var $selector = $(selector, context);
      if($selector.data('toggle') === "tab") {
        $selector.tab('show');
        // walk up the ancestors of this element, show any hidden tabs
        $selector.parents('.section.tabset').each(function(i, elm) {
          var link = $('a[href="#' + $(elm).attr('id') + '"]');
          if(link.data('toggle') === "tab") {
            link.tab("show");
          }
        });
      }
    };


    // Set the correct tab when the page loads
    showStuffFromHash(context);

    // Set the correct tab when a user uses their back/forward button
    $(window).on('hashchange', function() {
      showStuffFromHash(context);
    });

    // Change the URL when tabs are clicked
    $('a', context).on('click', function(e) {
      history.pushState(null, null, this.href);
      showStuffFromHash(context);
    });

    return this;
  };
}(jQuery));

window.buildTabsets = function(tocID) {

  // build a tabset from a section div with the .tabset class
  function buildTabset(tabset) {

    // check for fade and pills options
    var fade = tabset.hasClass("tabset-fade");
    var pills = tabset.hasClass("tabset-pills");
    var navClass = pills ? "nav-pills" : "nav-tabs";

    // determine the heading level of the tabset and tabs
    var match = tabset.attr('class').match(/level(\d) /);
    if (match === null)
      return;
    var tabsetLevel = Number(match[1]);
    var tabLevel = tabsetLevel + 1;

    // find all subheadings immediately below
    var tabs = tabset.find("div.section.level" + tabLevel);
    if (!tabs.length)
      return;

    // create tablist and tab-content elements
    var tabList = $('<ul class="nav ' + navClass + '" role="tablist"></ul>');
    $(tabs[0]).before(tabList);
    var tabContent = $('<div class="tab-content"></div>');
    $(tabs[0]).before(tabContent);

    // build the tabset
    var activeTab = 0;
    tabs.each(function(i) {

      // get the tab div
      var tab = $(tabs[i]);

      // get the id then sanitize it for use with bootstrap tabs
      var id = tab.attr('id');

      // see if this is marked as the active tab
      if (tab.hasClass('active'))
        activeTab = i;

      // remove any table of contents entries associated with
      // this ID (since we'll be removing the heading element)
      $("div#" + tocID + " li a[href='#" + id + "']").parent().remove();

      // sanitize the id for use with bootstrap tabs
      id = id.replace(/[.\/?&!#<>]/g, '').replace(/\s/g, '_');
      tab.attr('id', id);

      // get the heading element within it, grab it's text, then remove it
      var heading = tab.find('h' + tabLevel + ':first');
      var headingText = heading.html();
      heading.remove();

      // build and append the tab list item
      var a = $('<a role="tab" data-toggle="tab">' + headingText + '</a>');
      a.attr('href', '#' + id);
      a.attr('aria-controls', id);
      var li = $('<li role="presentation"></li>');
      li.append(a);
      tabList.append(li);

      // set it's attributes
      tab.attr('role', 'tabpanel');
      tab.addClass('tab-pane');
      tab.addClass('tabbed-pane');
      if (fade)
        tab.addClass('fade');

      // move it into the tab content div
      tab.detach().appendTo(tabContent);
    });

    // set active tab
    $(tabList.children('li')[activeTab]).addClass('active');
    var active = $(tabContent.children('div.section')[activeTab]);
    active.addClass('active');
    if (fade)
      active.addClass('in');

    if (tabset.hasClass("tabset-sticky"))
      tabset.rmarkdownStickyTabs();
  }

  // convert section divs with the .tabset class to tabsets
  var tabsets = $("div.section.tabset");
  tabsets.each(function(i) {
    buildTabset($(tabsets[i]));
  });
};

</script>

<style type="text/css">
a.anchor-section {margin-left: 10px; visibility: hidden; color: inherit;}
a.anchor-section::before {content: '#';}
.hasAnchor:hover a.anchor-section {visibility: visible;}
</style>
<script>// Anchor sections v1.0 written by Atsushi Yasumoto on Oct 3rd, 2020.
document.addEventListener('DOMContentLoaded', function() {
  // Do nothing if AnchorJS is used
  if (typeof window.anchors === 'object' && anchors.hasOwnProperty('hasAnchorJSLink')) {
    return;
  }

  const h = document.querySelectorAll('h1, h2, h3, h4, h5, h6');

  // Do nothing if sections are already anchored
  if (Array.from(h).some(x => x.classList.contains('hasAnchor'))) {
    return null;
  }

  // Use section id when pandoc runs with --section-divs
  const section_id = function(x) {
    return ((x.classList.contains('section') || (x.tagName === 'SECTION'))
            ? x.id : '');
  };

  // Add anchors
  h.forEach(function(x) {
    const id = x.id || section_id(x.parentElement);
    if (id === '') {
      return null;
    }
    let anchor = document.createElement('a');
    anchor.href = '#' + id;
    anchor.classList = ['anchor-section'];
    x.classList.add('hasAnchor');
    x.appendChild(anchor);
  });
});
</script>

<style type="text/css">
.selectize-control.plugin-drag_drop.multi > .selectize-input > div.ui-sortable-placeholder {
visibility: visible !important;
background: #f2f2f2 !important;
background: rgba(0, 0, 0, 0.06) !important;
border: 0 none !important;
-webkit-box-shadow: inset 0 0 12px 4px #ffffff;
box-shadow: inset 0 0 12px 4px #ffffff;
}
.selectize-control.plugin-drag_drop .ui-sortable-placeholder::after {
content: '!';
visibility: hidden;
}
.selectize-control.plugin-drag_drop .ui-sortable-helper {
-webkit-box-shadow: 0 2px 5px rgba(0, 0, 0, 0.2);
box-shadow: 0 2px 5px rgba(0, 0, 0, 0.2);
}
.selectize-dropdown-header {
position: relative;
padding: 3px 12px;
border-bottom: 1px solid #d0d0d0;
background: #f8f8f8;
-webkit-border-radius: 4px 4px 0 0;
-moz-border-radius: 4px 4px 0 0;
border-radius: 4px 4px 0 0;
}
.selectize-dropdown-header-close {
position: absolute;
right: 12px;
top: 50%;
color: #333333;
opacity: 0.4;
margin-top: -12px;
line-height: 20px;
font-size: 20px !important;
}
.selectize-dropdown-header-close:hover {
color: #000000;
}
.selectize-dropdown.plugin-optgroup_columns .optgroup {
border-right: 1px solid #f2f2f2;
border-top: 0 none;
float: left;
-webkit-box-sizing: border-box;
-moz-box-sizing: border-box;
box-sizing: border-box;
}
.selectize-dropdown.plugin-optgroup_columns .optgroup:last-child {
border-right: 0 none;
}
.selectize-dropdown.plugin-optgroup_columns .optgroup:before {
display: none;
}
.selectize-dropdown.plugin-optgroup_columns .optgroup-header {
border-top: 0 none;
}
.selectize-control.plugin-remove_button [data-value] {
position: relative;
padding-right: 24px !important;
}
.selectize-control.plugin-remove_button [data-value] .remove {
z-index: 1;

position: absolute;
top: 0;
right: 0;
bottom: 0;
width: 17px;
text-align: center;
font-weight: bold;
font-size: 12px;
color: inherit;
text-decoration: none;
vertical-align: middle;
display: inline-block;
padding: 1px 0 0 0;
border-left: 1px solid rgba(0, 0, 0, 0);
-webkit-border-radius: 0 2px 2px 0;
-moz-border-radius: 0 2px 2px 0;
border-radius: 0 2px 2px 0;
-webkit-box-sizing: border-box;
-moz-box-sizing: border-box;
box-sizing: border-box;
}
.selectize-control.plugin-remove_button [data-value] .remove:hover {
background: rgba(0, 0, 0, 0.05);
}
.selectize-control.plugin-remove_button [data-value].active .remove {
border-left-color: rgba(0, 0, 0, 0);
}
.selectize-control.plugin-remove_button .disabled [data-value] .remove:hover {
background: none;
}
.selectize-control.plugin-remove_button .disabled [data-value] .remove {
border-left-color: rgba(77, 77, 77, 0);
}
.selectize-control {
position: relative;
}
.selectize-dropdown,
.selectize-input,
.selectize-input input {
color: #333333;
font-family: inherit;
font-size: inherit;
line-height: 20px;
-webkit-font-smoothing: inherit;

rkic *ïgač.\n","From Common Turkic *ālda (“to deceive, fool”), a derivation from Common Turkic *āl (“craftiness; lie; strategy; way of doing”) , whence also dialectal Azerbaijani al (“lie, untruth”).\n","From Proto-Turkic *ạl- (“to take”). Cognate with Old Turkic 𐰞‎ (al-) Turkish almak, Chuvash ил (il), etc.\n","From Proto-Turkic *ạt- (“to throw, shoot”). Cognate with Turkish atmak.\n","From Proto-Turkic *iak- (“to flow”). Cognate with Old Turkic [script needed] (ak-), Turkish akmak, Chuvash юх (juh).\n","From Proto-Turkic *āń(k). Cognate with Chuvash уйӑх (ujăh) See Turkish ay for more cognates.\n","From bağ +‎ -la. Cognate with Turkish bağlamak.\n","Equivalent to baş (“head”) +‎ -la. Cognate with Turkish başlamak. Probably from Proto-Turkic, compare Chuvash пуҫла (puśla, “to start”, transitive).\n","From bataq +‎ -lıq.\n","From Proto-Turkic *bat- (“to sink; to fit into, get into”). Cognate with Kazakh бату (batw).\n","From Proto-Turkic *bạk- (“to look, watch”). Cognate with Turkish bakmak, Crimean Tatar baqmaq, Turkmen bakmak.\n","From Proto-Turkic *bil- (“to know”)\nCognate with\nOld Turkic 𐰋𐰃𐰠‎ (bil-, “to know”),\nTurkish bilmek,\nCrimean Tatar bilmek,\nUzbek bilmoq (“to know”).\nCrimean Tatar bilmek,\nKazakh білу (bilw, “to know”),\nTatar белү (belü)","Morphologically bişmək (“become cooked”) +‎ -ir (“causative suffix”). Cognate with Turkish pişirmek (“to cook”), Kazakh пісіру (pisirw, “to cook”), Tatar пешерү (peşerü, “to cook, to boil”), Uyghur پىشىرماق‎ (pishirmaq, “to cook”).\n","From Proto-Turkic *büt-, whence also bütün (“all, whole”). Cognate with Turkish bitmek, Chuvash пӗт (pĕt) etc.\n",null,null,"Ultimately from Sinitic 茶.\n","From Proto-Turkic *čebir-. Cognate with Chuvash ҫаврӑн (śavrăn).\n","From Common Turkic *čeŋe. Cognate with Turkish çene, see there for more.\n","Borrowed from Persian چنگال‎ (čangâl).\n","From Proto-Turkic *čẹr (“rotten, foul; to rot; illness; dirt; to be sick, ill; rot; glue; anguish, sorrow”), whence possibly also Azerbaijani çirk (“dirt”). Cognate with Turkish çürümek.\n","From Old Anatolian Turkish [script needed] (danışmaq), ultimately a derivation of Proto-Turkic *tạnu- (“to know, get to know”) , whence also Azerbaijani tanımaq. Cognate with Karakhanid تَنُشْماقْ‎ (tanušmāq, “to talk to each other”), Ottoman Turkish طانشمق‎ (danışmak, “to advice, counsel”).\n","From Proto-Turkic *dẹri (“skin”). Cognate with Turkmen deri, Turkish deri,\nKazakh терi (teri),\nKarachay-Balkar тери (teri), Kumyk тери (teri), Kyrgyz тери (teri),\nUzbek teri,\nUyghur تېرە‎ (tëre),\nYakut тирии (tirii), Dolgan тирии, Tatar тире (tire) and\nBashkir тире (tire).\n","From Proto-Turkic *dil, *dɨl (“tongue; language”). Cognate with Turkish dil.\n","From Proto-Turkic *tog-. Cognate with Old Turkic [script needed] (tugur-, “to give birth to”), Uzbek tugʻmoq (“to give birth to”), Chuvash ту (tu).\n","From Proto-Turkic *duj- (“to perceive (by ears or nose), notice”). Cognate with Turkish duymak.\n","From Proto-Turkic *tüŕ (“even, level”).\n","From Proto-Turkic *ẹĺit-. Cognate with Turkish işitmek, Kazakh есту (estw), Uzbek eshitmoq.\n","From Proto-Turkic *ēt-. Cognate with Old Turkic 𐰃𐱅‎ (et-, “to make”), Turkish etmek.\n","From Proto-Turkic *eb (“dwelling place, house”). Cognate with Old Turkic 𐰋‎ (eb), Turkish ev.\n","From  Proto-Turkic *ẹri-. Cognate with Turkish erimek.\n",null,"Ultimately from Proto-Turkic *kē(y)t- (“to go (away), to get away”).\n","From Proto-Turkic *kīr- (“to enter”). Cognate with Old Turkic 𐰚𐰃𐰼‎ (kir- /kir²/), Turkish girmek, Chuvash кӗр (kĕr) etc.\n","From gizləmək +‎ -t.\n","From gör (“to see”) +‎ -ün (“[passive suffix]”). Compare Turkish görünmek.\n","From Proto-Turkic *kȫk (“blue, green”).\n","From Arabic هَوَاء‎ (hawāʾ).\n",null,"From Proto-Turkic *īĺč (“work, deed”).\n","From Persian کنار‎ (kenâr).\n",null,"From Arabic مَسَافَة‎ (masāfa).\n",null,"Cognate with Turkish ödemek, etc.\n","From Proto-Turkic *bōl- (“to become”). See there for cognates.\n","From Proto-Turkic *ört- (“to cover”), whence also Azerbaijani örpək (“headscarf”).\nCognate with Turkish örtmek (“to cover, shut”), Chuvash витме (vitme, “to cover, protect, close”), etc.\n","From Proto-Turkic *ol-tur- (“to sit”), causative of *ol-.\n","From Proto-Turkic *okï-.\n","Ultimately from Proto-Turkic *oj- (“to play, to jump”), whence also the derivation oyun (“play, game”). Cognate with\nTurkish oynamak,\nTurkmen oýnamak,\nCrimean Tatar oynamaq,\netc.\n","Ultimately from Proto-Turkic *ȫ- (“to think of, understand, realize”), and its derivations, such as Proto-Turkic *ȫg (“mind, thought, intelligence”), and Proto-Turkic *ȫgre-, its reflexive form. Cognate with Turkish öğretmek (“to teach”) and Turkish öğrenmek (“to learn”). See there for more.\n",null,"From Proto-Turkic *buŕ-, *boŕ- (“to damage, destroy”).\nCognate with Turkish bozmak, Chuvash пӑс (păs, “break, destroy”), etc.\n","From Proto-Turkic *kāpuk (“bark; skin; shell”).\n","From Common Turkic *kač- (“to run away, flee”). Cognate with Turkish kaçmak etc.\n","Morphologically from qalxmaq (“to rise”) +‎ -dır, with /x/ in qalxmaq being lost via syncope. Cognate with Turkish kaldırmak.\n","From Proto-Turkic *kaŕgan, compare Chuvash хуран (huran).\n","From Proto-Turkic *kïr- (“to break, demolish; small; to scrape, shave”). Compare Azerbaijani qırxmaq (“to shave”) which is probably a derivation from the same root. Cognate with Turkish kırmak etc.\n","From Proto-Turkic *kï̄ŕ (“girl, woman”). Cognate with Bashkir ҡыҙ (qïð), Crimean Tatar qız, Karakalpak qız, Kazakh қыз (qız), Kyrgyz кыз (kız), Old Turkic [script needed] (kïz), Ottoman Turkish قیز‎, Tatar кыз (qız), Turkish kız, Turkmen gyz, Tuvan кыс (kıs), Uyghur قىز‎ (qiz), Uzbek qiz.\n","From Proto-Turkic *kol (“upper arm”). Cognate with Turkish kol, Crimean Tatar qol etc.\n","From qop- (“to break off”) +‎ -ar","Form Common Turkic *kōrï-. Cognate with Old Turkic [script needed] (korï-, “to protect”), Uzbek qoʻrimoq (“to protect”).\n","Likely from Proto-Turkic. Cognates include Turkish korkmak, Kazakh қорқу (qorqw), Uzbek qoʻrqmoq, Chuvash хӑра (hăra).\n","From Proto-Turkic *ko-. Cognate with Old Turkic [script needed] (kōd-), [script needed] (kōt-, “to put, to set down, to lay, to place”), Turkish koymak, etc.\n","From Proto-Turkic *kūrt.\n","From Arabic صَبَاح‎ (ṣabāḥ).\n","From Old Anatolian Turkish [script needed] (sakla-, “to guard, protect”), ultimately from Proto-Turkic *sạk (“aware, alert”). Cognate with Turkish saklamak.\n","Ultimately from Arabic شَيْء‎ (šayʾ).\n","From Proto-Turkic *ses. Cognate with Turkish, Crimean Tatar, Gagauz, Turkish ses, Kazakh сес (ses), Chuvash сасӑ (sasă).\n","From sın- (“to break”) +‎ -dır (“causative”).\n","From Proto-Turkic *soŋ (“back, end”). Compare Turkish son below.\n","A derivation of Proto-Turkic *soŋ (“end”), whence also son. Cognate with Turkish sonra etc.\n","From Proto-Turkic *sok- (“to pierce, stick into”), which was homonyms to and possibly cognate with Proto-Turkic *sok- (“to hit, beat, crush”). Compare Karakhanid سُقْماق‎ (suqmāq), Turkish sokmak (“to insert”), etc.\n","From Proto-Turkic *sogï-k. Cognate with Turkish soğuk, Uzbek sovuq, Bashkir һыуыҡ (hïwïq), Chuvash сивӗ (sivĕ) etc.\n","From Proto-Turkic. Cognate with Turkish süpürmek, Chuvash шӑпӑр (šăpăr, “broom”).\n","Ultimately from Proto-Turkic *sǖr-, cognate with Turkish sürmek.\n","Cognate with Old Turkic [script needed] (sürüg).\n",null,null,null,"From Proto-Turkic *tepö.\n","From Proto-Turkic *dik- (“vertical; to to plant vertically”).\nCompare Turkish dikmek (“to sew”), Kumyk тикмек (tikmek, “to sew; to build”) Kazakh тігу (tigw).\n","From Proto-Turkic *tut- (“to grasp”).\nCognate with Old Turkic 𐱃𐰆𐱃‎ (tut-, “to keep, catch, own”), Turkish tutmak (“to catch, keep”), Bashkir тотоу (totou, “to keep, hold”), Chuvash тытма (tytma, “to keep, hold”), Khakas & Shor тударға (tudarğa, “to keep, hold, catch, seize, rule, hold back”), Kyrgyz тутуу (tutuu, “to catch”), Turkmen tutmak (“to hold, keep, catch, hire, fill”), Tuvan тудар (tudar, “to hold, catch, grab”), Uzbek tutmoq (“to take, hold, catch”), Yakut тут (tut, “to hold, seize, grab, catch”).\n","From Proto-Turkic *uŕɨ-n, *uŕa-k (“long, far, late”), whence also uzaq (“far, distant”).\n","Ultimately from Proto-Turkic *bēr- (“to give”). Cognate with Old Turkic [script needed] (ber-, “to give”), Turkish vermek, etc.\n","Ultimately from Arabic خَبَر‎ (ḵabar).\n","From Proto-Turkic *yāg.\n","Morphologically from yanmaq (“to burn”) +‎ -dır","Ultimately from Proto-Turkic *yāĺ (“young, fresh”).\n","From Common Turkic *yāša-, a derivation from Proto-Turkic *yāĺ.\n","From Proto-Turkic *yāy (“summer”).","From yellə- +‎ -n.\n","From Proto-Turkic *yē-. Cognate with Old Turkic [script needed] (ye-, “to eat”), Turkish yemek, etc.\n","Ultimately from Proto-Turkic *yẹr. Cognate with Old Turkic 𐰘𐰼‎ (yer), 𐰘𐰃𐰼‎ (yir).\n","From Proto-Turkic *uya. Cognate with Chuvash йӑва (jăva).\n","From Proto-Turkic *adak (“leg”); however, not a regular Kypchak development thereof (which is аяҡ (ayaq)), but apparently a (now extinct) collateral branch with a peculiar semantic shift.\n","From Proto-Turkic *āń(k) (“moon, month”).\nCognate with Azerbaijani ay, Turkish, Crimean Tatar ay, Tatar, Kazakh, Kyrgyzай (ay), Southern Altai ай (ay), Uzbek oy, etc.\n",null,"From Proto-Turkic *ạl- (“to take”).\nCognate with Old Turkic [script needed] (al-, “to take”); Turkish almak, Yakut ыл (ıl, “to take”), Chuvash ил (il, “to take”), etc.\n","From Proto-Turkic *āŋla- (“to understand”), from Proto-Turkic *āŋ (“intelligence, mind”).\nCognate with Old Uyghur [script needed] (aŋla-, “to understand”); Kyrgyz аңдоо (añdoo, “to understand”), Karachay-Balkar ангыларгъа (añılarğa, “to understand”), Uzbek anglamoq (“to understand”), Uyghur ئاڭلىماق‎ (anglimaq, “to listen; to understand”), Turkish anlamak (“to understand”), Azerbaijani anlamaq (“to understand”).\n",null,"From Proto-Turkic *agrɨ-g (“pain, illness”), an action noun of *agrɨ- (“to ache; be ill”).\nCognate with\nKarakhanid اَغْرِغْ‎ (aɣrïɣ, “pain”),\nOld Uyghur ՚՚q̈ryq (aɣrïɣ, “pain, illness”),\nKazakh ауру (awrw, “illness; ill; to be ill”), Kyrgyz оору (ooru), Southern Altai оору (ooru),\nUzbek ogʻriq (“pain, ilness”),\nUyghur ئاغرىق‎ (aghriq, “illness”),\nKhakas ағырығ (ağırığ, “illness; ill”),\nTuvan аарыг (aarıg, “illness, pain”),\nYakut ыарыы (ıarıı, “pain, disease”),\nTurkish ağrı (“pain, ache”).\n","From Proto-Turkic *(i)aĺ-a- (“to eat”), from Proto-Turkic *(i)aĺ (“food, meal”).\nCognate with\nOld Uyghur [script needed] (aša-, “to eat”);\nKumyk ашамакъ (aşamaq, “to eat”);\nKarachay-Balkar ашаргъа (aşarğa, “to eat”);\nYakut аһаа (ahaa, “to eat”), etc.\n",null,"From Common Kypchak *ayaq, from Proto-Turkic *adak (“foot, leg”).\nCompare Old Turkic 𐰑𐰴‎ (adaq, “leg, foot”).\nSee also аҙаҡ (aðaq).\n",null,"From *ayt- (“to say, utter”), from Proto-Turkic *ayɨt- (“to say; ask”), which (as seen in Old Uyghur, Yakut, Chuvash cognates) was originally a causative form of an earlier *ay- (“to say”).\nCompare to\nTatar әйтү (äytü, “to say”),\nKazakh айту (aytw, “to say”),\nKyrgyz айтуу (aytuu, “to say”),\nCrimean Tatar aytmaq (“to say”),\nUzbek aytmoq (“to say”),\nUyghur ئېيتماق‎ (ëytmaq, “to say”),\nKumyk айтмакъ (aytmaq, “to say”),\ndialectal Khakas айт- (ayt-, “to say”), айыт- (ayıt-, “to sing”),\nTurkish ayıtmak (“to say”);\nOld Uyghur [script needed] (ajït-, “to have/make/let sb. say”),\nYakut ыйыт- (ıyıt-, “to ask”),\nChuvash ыйт (yjt, “to ask”).\n","From Proto-Turkic *iāčɨg (“bitter, acid”).\nA palatal parallel development, compare Bashkir асы (asï, “bitter, sour”) from the same archetype.\n",null,"From Proto-Turkic *bat-gak (“sticky mud, bog”), from *bat- (“to sink, get bogged/stuck in mud”).\nCognate with\nKazakh батпақ (batpaq),\nKyrgyz баткак (batkak),\nShor патқақ (patqaq),\nKarachay-Balkar батхакъ (batxaq, “clay, mud”),\nUzbek botqoq,\nUyghur پاتقاق‎ (patqaq, “sticky mud, bog”),\nTurkmen batga (“swamp, bog”),\nTurkish batak (“swamp, bog”).\n","From Common Kypchak *baw, from Common Turkic *bāğ (“rope, binder”), from Proto-Turkic *b(i)ā- (“to bind, fasten”).\nCognate with\nOld Uyghur [script needed] (bağ, “band, binder; bond”);\nKazakh бау (baw, “cord, binder”),\nKyrgyz боо (boo, “cord, binder”),\nSouthern Altai буу (buu, “cord”),\nCrimean Tatar bav (“knot”),\nUzbek bogʻ (“cord; bundle”),\nTurkish bağ (“connection”),\nYakut быа (bıa, “cord, lace”), etc.\n",null,null,null,"From Proto-Turkic *bīr (“one”).\nCognate with\nOld Turkic 𐰋𐰃𐰼‎ (bir, “one”), Turkish bir (“one, once”).\n",null,null,"From Proto-Turkic *bēr- (“to give”).\nCognate with Old Turkic -𐰋𐰃𐰼 (bér-, “to give”);  Turkish vermek, Yakut биэр (bier), Chuvash пар (par, “to give”), etc.\n",null,"Cognate with\nKarakhanid [script needed] (butaq, “branch, twig”);\nKazakh бұтақ (butaq),\nKyrgyz бутак (butak),\nSouthern Altai будак (budak, “branch, twig”),\nUzbek butoq (“branch, twig”), etc.\n",null,"From Proto-Turkic *bōl- (“to become”).\n",null,null,"From Persian درست‎ (dorost, “correct”).\n",null,"From *yebiĺ(č) (“wet”), from Proto-Turkic *yebi- (“to soak, become wet”).\nCognate with Tatar юеш (yuyeş, “wet”), Karaim йувюш / йӱвӱш / йӱвӱс / йивис (“wet”).\n","From Common Kypchak *egin \"grain crop\", from *ekin \"cultivated land; crops grown on such land\"; from  Proto-Turkic *ek- (“to sow”).\nCognate with\nOld Uyghur [script needed] (ekin, “arable land, tilled land”);\nKazakh егін (egin, “grain crops”),\nKyrgyz эгин (egin, “grain crops”),\nUzbek ekin (“farm crop”),\nUyghur ئېكىن‎ (ëkin, “arable land; farm crop”),\nTurkish ekin (“farm crop”).\n","The only reliable cognate is Kazakh ену (enw, “to enter, go in”). Thus, this is a very peculiar regional feature shared by only these two languages.\nGenerally thought to derive from Proto-Turkic *ēn- (“to go down”),.\nHowever, no adequate explanation has been presented as to how this peculiar semantic transformation (\"go down\" > \"enter\") could have taken place, and why only in these two languages but not elsewhere.\n","From Proto-Turkic *ēr (“man”).\n",null,"From  Proto-Turkic *ẹĺit- (“to hear”).\nCognate with Old Turkic 𐱁𐱅‎ (eşit-, “to hear, listen”);  Kazakh есту (estw, “to hear”), Uzbek eshitmoq (“to hear”), Turkish işitmek (“to hear”), Khakas истерге (isterge, “to hear”),Yakut иһит (ihit, “to hear”), Chuvash илтме (iltme, “to hear”).\n","From Proto-Turkic *yāĺ (“young”).\n","From Common Turkic *yāša- (“to live”), a derivation of Proto-Turkic *yāĺ.\nCognate with\nOld Uyghur [script needed] (jaša-, “to live”);\nKazakh жасау (jasaw, “to live”), \nKumyk яшамакъ (yaşamaq, “to live”), \nUzbek yashamoq (“to find”), \nUyghur ياشىماق‎ (yashimaq, “to live”), \nSouthern Altai јажа- (ǰaža-, “to live (up to a certain age)”),\nKhakas чазирға (çazirğa, “to live (up to a certain age)”), \nTurkmen ýaşamak, Turkish yaşamak (“to live”).\n",null,"From *ūdïkla- (“to sleep”), from  *ūdïk \"sleepy\", derived from *ūdï- 'to sleep', which in turn derives from *ū \"sleep\".\nCognate with\nKazakh ұйықтау (uyıqtaw), Kumyk юхламакъ (yuxlamaq), Crimean Tatar yuqlamaq, Kyrgyz укта- (ukta-), Southern Altai уйуктаар (uyuktaar), Chulym уқла- (uqla, “to sleep”), Uzbek uxlamoq, Uyghur ئۇخلىماق‎ (uxlimaq),\nTurkmen uklamak (“to sleep”).\n",null,"From Proto-Turkic *yɨlān (“snake”).\nCognate with\nOld Turkic [script needed] (jïlan, “snake”);\nKazakh жылан (jılan), Kyrgyz жылан (cılan),\nUzbek ilon,\nUyghur يىلان‎ (yilan),\nTurkish yılan,\nKhakas, Tuvan чылан (çılan, “snake”), etc.\n",null,null,null,null,null,"From *kürek (“shovel, spade”), from Proto-Turkic *küre- (“to shovel, rake up”).\nCognate with\nKazakh күрек (kürek),\nKyrgyz күрөк (kürök),\nKarachay-Balkar кюрек (kürek),\nKumyk кюрек (kürek),\nUzbek kurak,\nSouthern Altai кӱрек (kürek), Shor кӱрек,\nTurkish kürek,\nCrimean Tatar kürek,\nAzerbaijani kürək (“shovel; spade”).\n","From Common Turkic *kǖč (“force”).\n","From *küčlüg \"strong\" (compare Old Turkic 𐰛𐰈𐰲𐰠𐰈𐰏‎ (küčlüg, “strong, mighty”)), from Common Turkic *kǖč (“force”) + +lüg \"affix of possession or quality\".\nSynchronously, equivalent to көс (kös) +‎ -лө (-lö).\nCognate with\nTatar көчле (köçle),\nCrimean Tatar küçlü,\nUzbek kuchli,\nUyghur كۈچلۈك‎ (küchlük),\nTurkmen güýçli,\nTurkish güçlü (“strong”), etc.\nSee more cognates at көстө (köstö).\n","From Proto-Turkic *gǖd- (“to wait; to attend; to respect; to herd”).\nCognate with\nOld Uyghur [script needed] (küt-, “to wait; to herd”);\nKazakh күту (kütw, “to wait”),\nKyrgyz күтүү (kütüü, “to wait; to tend to (cattle)”),\nUzbek kutmoq (“to wait; to tend to (guests)”),\nUyghur كۈتمەك‎ (kütmek, “to wait”),\nYakut күүт- (küüt-, “to wait”) / көһүт- (köhüt-, “to wait”),\nChuvash кӗт- (kĕt-, “to wait; to herd”).\n","From  Proto-Turkic *gör- (“to see”).\nCognate with Old Turkic 𐰚𐰇𐰼𐰇𐰼‎ (körür, “seeing”); Kazakh көру (körw, “to see”), Kyrgyz көрүү (körüü, “to see”), Southern Altai кӧрӧр (körör, “to see”), Uzbek koʻrmoq (“to see”), Khakas кӧрерге (kӧrerge, “to see”), Tuvan көөр (köör, “to see”), Azerbaijani görmək (“to see”), Turkish görmek (“to see”),   Yakut көр (kör, “to see”), Chuvash курма (kurma, “to see”).\n",null,null,"From Proto-Turkic *kāpuk (“bark; skin; shell”).\nCognate with\nKazakh қабық (qabıq),\nKyrgyz кабык (kabık), Southern Altai кабык (kabïk),\nUzbek qobiq (“skin, shell”),\nTurkish kabuk (“shell”),\nTuvan хавык (xavık, “husk”),\nChuvash хупӑ (hupă, “bark”),\netc.\n",null,null,"From *qayda \"where, at what place\", from Proto-Turkic *ka- (“interrogative particle”). -da is a locative case formant.\nCognate with\nOld Turkic [script needed] (qajda, “where?”),\nTatar кайда (qayda),\nOttoman Turkish قانده‎ (kanda),\nKazakh қайда (qayda),\nKyrgyz кайда (kayda),\nCrimean Tatar qayda,\nShor қайда,\nKhakas хайда (xayda),\nTuvan кайда (kayda),\netc.\n","From Proto-Turkic *kadıŕ (“rawhide; belt”).\nCognate with\nOld Turkic [script needed] (qaðïš, “belt”);\nKazakh қайыс (qayıs, “rawhide”);\nKyrgyz кайыш (kayış, “belt”),\nSouthern Altai кайыш (kayïš, “belt”)Uzbek qayish (“belt”),\nKhakas хаас (xaas, “belt”),\nYakut хатыс (xatıs, “leather strap/belt”),\netc.\n",null,null,"From *qara- (“to look”), probably borrowed from Middle Mongolian, from Proto-Mongolic *kara- (“to look”).\nCognate with Kazakh қарау (qaraw, “to look”), Kyrgyz кара- (kara-, “to look”), Southern Altai кара- (kara-, “to look”), Uzbek qaramoq (“to look”), \nUyghur قارىماق‎ (qarimaq, “to look”), Khakas хара- (xara-, “to look”).\n",null,"from Common Turkic *xātun (“queen”).\nCompare Old Turkic 𐰴𐱃𐰆𐰣‎ (qatun, “queen”), Karakhanid قاتُونْ‎ (qātūn, “noble woman”), Turkish kadın (“woman”).\n",null,null,"From Proto-Turkic *kol (“upper arm, hand”).\nCognates include\nOld Uyghur qwl (qol, “arm”);\nTatar кул (qul, “arm, hand”),\nKazakh қол (qol, “arm, hand”),\nUzbek qoʻl (“arm, hand”),\nTurkish kol (“upper arm”),\nYakut хол (xol, “upper arm”),\nChuvash хул (hul, “arm; shoulder”).\n",null,"From Proto-Turkic *kï̄ŕ (“girl”).\nCognate with\nOld Turkic 𐰶𐰃𐰕‎ (qïz, “girl”);\nKyrgyz кыз (kız),\nShor қыс,\nTurkish kız (“girl”), etc.\n",null,"Cognate with\nTatar май (may),\nKazakh май (may),\nKyrgyz май (may),\nUyghur ماي‎ (may, “oil, butter, fat, grease”).\n","Cognate with Tatar матур (matur, “beatiful”) and Chuvash маттур (mattur, “strong, stout; dextrous; brave; beatiful”).\nUltimately from Proto-Turkic *bagatur (“hero”).\nIrregular nasalization and preservation of a roundness-disharmonic high vowel are sporadically found in inherited vocabulary but could also indicate some sort of reloaning scenario.\nDoublet of батыр (batïr, “hero, brave”).\n",null,"From Proto-Turkic *büŋüĺ (“corner”).\nCognate with\nSiberian Tatar мөйәш (möyäš, “corner”),\nKarakalpak мүйеш (“corner”),\nKazakh мүйiс (müyis, “corner”),\nKarachay-Balkar мюйюш (müyüş, “corner”).\n","Cognate with\nKazakh мылтық (mıltıq),\nNogai мылтык (mıltık),\nUzbek miltiq,\nUyghur مىلتىق‎ (miltiq),\nKyrgyz мылтык (mıltık),\nSouthern Altai мылтык (mïltïk),\nKhakas мылтых (mıltıx, “rifle”), etc.\n",null,"From Persian اوستا‎ (ustâ) / استاد‎ (ostâd). Doublet of остаз (ostaz).\nNote that the first form in Persian may have been reborrowed from a Turkic source.\nCognate with\nTatar оста (osta, “master, craftsman”),\nKazakh ұста (usta, “master; blacksmith”),\nKyrgyz уста (usta, “master; blacksmith”),\nUzbek usta (“master, professional”),\nUyghur ئۇستا‎ (usta, “master, professional”),\nTurkish usta (“master”).\n",null,"From Common Kypchak üy (\"house, home\", see the Kypchak cognates below), from Proto-Turkic *eb (“house”).\nImmediately cognate with Tatar өй (öy), Kazakh үй (üy), Kyrgyz үй (üy), Karachay-Balkar юй (üy), Kumyk уьй (üy), Southern Altai ӱй (üy, “home, house”).\n",null,null,null,null,null,"From *čet (“edge, border; a location aside/away from sth.; foreign”).\nCognate with\nKazakh шет (şet, “edge”),\nKyrgyz чет (çet, “edge”),\nUzbek chet (“edge”),\nUyghur چەت‎ (chet, “edge”),\nShor чет (“border”), etc.\n",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)\nCognate with\nTatar тавыш (tawış),\nKazakh дауыс (dawıs),\nKarakalpak даўыс (dawıs),\nKarachay-Balkar таууш (tauuş),\nKyrgyz тоош (tooş),\nUzbek tovush,\nUyghur تاۋۇش‎ (tawush),\nCrimean Tatar davuş,\nKhakas табыс (tabıs, “voice, sound”).\n","From Proto-Turkic *dil (“tongue; language”).\nCognate with\nTatar тел (tel),\nKazakh тіл (til),\nKyrgyz тил (til),\nUzbek til,\nTurkish dil (“tongue, language”).\n",null,"From Proto-Turkic *deri (“skin”).\nCognate with\nKazakh терi (teri),\nKarachay-Balkar тери (teri),\nKumyk тери (teri),\nKyrgyz тери (teri),\nUzbek teri,\nUyghur تېرە‎ (tëre),\nYakut тирии (tirii),\nTurkmen deri,\nAzerbaijani dəri,\nTurkish deri (“skin”).\n",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)\nNo etymology is known. No cognates are known.\nSee also the diminutive тоҡсай (toqsay).\n",null,"From Proto-Turkic *tur- (“to stand”).\n",null,"From  Proto-Turkic *tut- (“to hold; keep; catch”).\nCognate with Old Turkic 𐱃𐰆𐱃‎ (tut-, “to keep, catch, own”);\nKyrgyz тутуу (tutuu, “to catch”),\nUzbek tutmoq (“to take, hold, catch”),\nUyghur تۇتماق‎ (tutmaq, “to hold, grab”),\nTurkish tutmaq (“to catch, keep”),\nAzerbaijani tutmaq (“to catch, keep”),\nTurkmen tutmak (“to hold, keep, catch, hire, fill”),\nKhakas & Shor тударға (tudarğa, “to keep, hold, catch, seize, rule, hold back”),\nTuvan тудар (tudar, “to hold, catch, grab”), Yakut тут (tut, “to hold, seize, grab, catch”),\nChuvash тытма (tytma, “to keep, hold”), etc.\n",null,"From Proto-Turkic *tǖĺ (“dream (seen while sleeping)”).\n",null,null,null,"From a Mongolic source, from Proto-Mongolic *töle- (“to pay”).\nCognate with\nOld Uyghur [script needed] (tölä-, “to pay”);\nKazakh төлеу (tölew), Kyrgyz төлөө (tölöö), Uzbek toʻlamoq, Uyghur تۆلىمەك‎‎ (tölimek‎),\nKhakas тӧле- (tӧle-), Tuvan төлээр (töleer, “to pay”).\n","From *tögerek \"round, circle\", from\nProto-Turkic *dög ~ *deg ~ *dog (“round, circle”).\nCompare with\nTatar түгәрәк (tügäräq),\nKazakh төңірек (töñirek),\nKyrgyz төгөрөк (tögörök),\nUzbek toʻgarak (“circle”),\nUyghur تۈگۈرەك‎ (tügürek, “circle”),\nYakut төгүрүк (tögürük, “round”).\nThe noun sense of \"hobby group\" is semantic loan from  Russian кружо́к (kružók).\n","From Proto-Turkic *dɨrŋa-k (“fingernail, claw”).\nCognate with\nOld Turkic 𐱃𐰃𐰺𐰭𐰴‎ (tïrŋaq, “fingernail, claw”);\nKazakh тырнақ (tırnaq),\nKyrgyz тырмак (tırmak),\nUzbek tirnoq,\nUyghur تىرناق‎ (tirnaq),\nCrimean Tatar tırnaq,\nTurkish tırnak,\nTurkmen dyrnak,\nTuvan дыргак (dırgak),\nYakut тыҥырах (tıŋırax, “fingernail, claw”).\n",null,"From Proto-Turkic *o-l (“that”). Compare Old Anatolian Turkish 𐰆𐰞‎ (ol) and Karakhanid اُلْ‎ (ol).\n","From Proto-Turkic *oltur- (“sit”).\n",null,null,null,null,"From Proto-Turkic *sā-n (“number”), from Proto-Turkic *sā- (“to count”).\nCognate with:\nOld Uyghur s՚n (san, “number”).\n",null,null,null,null,null,null,"From Proto-Turkic *sogɨ-k (“cold”).\nCognate with\nOld Turkic [script needed] (soγïq), Old Turkic [script needed] (soγuq, “cold”),\nKazakh суық (swıq), Kyrgyz суук (suuk), Uyghur سوغۇق‎ (soghuq)/Uyghur соғуқ (soghuq), Uzbek sovuq, Tuvan соок (sook), Turkmen sowuk, Turkish soğuk (“cold”), etc.\n",null,"From Persian چشمه‎ (češme, “spring, source”).\n",null,null,null,"From Proto-Turkic *īĺč (“work, deed”). Compare Turkish iş.\n","From the noun эш.\n",null,"Probably a derivation of Proto-Turkic *yara- (“be good enough, be sufficient, be successful”), appended with the causative suffix -t.\nCognate with \nTatar ярату (yaratu, “to love”),\nKazakh жарату (jaratw, “to like, approve of”),\nKyrgyz жаратуу (caratuu, “to like, approve of”),\nUyghur ياراتماق‎ (yaratmaq, “to love, sypathize”).\n",null,"From Proto-Slavic *(j)edinъ, ultimately from Proto-Indo-European *óynos (“one, single”).\n","From Proto-Slavic *bojàti.\n","From Proto-Slavic *ǫgъlъ. Cognate with Russian у́гол (úgol).\n","From Proto-Slavic *vęzati.\n",null,"From Proto-Slavic *grǫdь.\n","Unknown, cognate with Russian гуля́ть (guljátʹ), Ukrainian гуля́ти (huljáty).\n","From Proto-Slavic *dȍmъ (“house; home”).\n",null,"A borrowing from Old Church Slavonic дрѣво (drěvo); ultimately from Proto-Slavic *dervo, from Proto-Indo-European *dóru. Doublet of дзе́рава (dzjérava), the inherited East Slavic form.\n","From Proto-Slavic *žiti (compare Russian жить (žitʹ), Ukrainian жи́ти (žýty), Old Church Slavonic жити (žiti)), from Proto-Indo-European *gʷeih₃w- (“to live”). Cognate to Lithuanian gyventi, Sanskrit जीवति (jīvati), Latin vīvō.\n",null,"Cognates include Russian звони́ть (zvonítʹ), Ukrainian дзвони́ти (dzvonýty) and Polish dzwonić.\n","From Old East Slavic коньць (konĭcĭ, “end; edge, border”), from Proto-Slavic *konьcь (“end”).\n","From ко́лькі (kólʹki) +‎ -асць (-ascʹ).\n","From Proto-Slavic *listъ (“leaf”). Cognate with Russian лист (list).\n","From лік (lik).\n","From Old East Slavic мѣстьце (městĭce), мѣстце (městce), from Proto-Slavic *městьce, from *město (“place, town”) +‎ *-ьce. Equivalent to ме́ста (mjésta) +‎ -ца (-ca).\nCognate with Ukrainian мі́сце (mísce), Polish miejsce.\n","From Proto-Slavic *měsęcь, from Proto-Indo-European *mḗh₁n̥s.\n","From Proto-Slavic *noga, from Proto-Indo-European *h₃nogʰ-.\n",null,null,null,"Cognate with Russian подня́ть (podnjátʹ).\n","Cognate with Russian поки́нуть (pokínutʹ).\n","From Old East Slavic пальць (palĭcĭ), from Proto-Slavic *palьcь (“thumb, finger”).\n","па- (pa-) +‎ чуць (čucʹ)","Cognate with Russian по́лдень (póldenʹ).\n","From Polish skóra, from Proto-Slavic *skora. Cognate with Russian скора́ (skorá). Doublet of шку́ра (škúra) and скі́ра (skíra).\n","From Proto-Slavic *sъ̀nъ, from Proto-Indo-European *supnós.\n",null,"From Proto-Slavic *starъ.\n",null,null,null,"From Proto-Slavic *tьnъkъ. Cognate with Russian то́нкий (tónkij).\n","From у- (u-) +‎ стаць (stacʹ). Cognates include Ukrainian уста́ти (ustáty), Russian встать (vstatʹ) and Polish wstać.\n","From Proto-Slavic *tęgnǫti. Cognate with Ukrainian тягну́ти (tjahnúty).\n","From Proto-Slavic *čakati, *čekati.\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.). Cognate with Ukrainian шту́рхати (štúrxaty).\n","Borrowed from Sanskrit अग्नि (agni), from Proto-Indo-Aryan *agní, from Proto-Indo-Iranian *Hagnis, from Proto-Indo-European *h₁n̥gʷnis",null,null,null,null,null,null,null,"Locative of এখান (ekhan)","Locative of ওখান (okhan)",null,null,null,null,null,"Borrowed from Sanskrit खाद्य (khādya).\n","Akin to Hindi खेलना (khelnā)",null,null,null,"From Sanskrit গল (gala). Cognate to Hindi गला (galā).",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Compare to Hindustani देखना (dekhnā) / دیکھنا‎ (dekhnā)",null,null,null,null,null,null,null,"Compare to Hindustani पढ़ना (paṛhnā) / پڑھنا‎ (paṛhnā).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Compare to Assamese বোলা (büla), Hindi बोलना (bolnā), Marathi बोलणें (bolṇẽ) and Punjabi ਬੋਲਣਾ (bolṇā).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Assamese শুনা (xuna)",null,null,null,null,null,null,null,null,null,"From Proto-Celtic *amstera (“time, moment”). Cognate with Welsh amser, Irish aimsir.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Borrowed from Latin discō (“I learn”). Cognate with Welsh dysgu and Cornish dyski, from the same origin.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Infinitive from kavout (to find), all other forms from the verb bezañ (to be). Cognate with Cornish kavos and y'm beus.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Verbal noun from Old Breton oper, from Latin opera (cf. Cornish ober, Welsh gober). Inflected forms in gr- from an earlier gwr-, itself from Proto-Celtic *wregeti, cognate with Welsh gwneud (older forms with initial gwr-) and Cornish gwul (all forms in gwr-).\n",null,null,null,null,null,null,"Borrowed from Latin saccus. Cognate with Welsh sach.\n",null,null,null,null,null,null,null,"From Proto-Brythonic *ti, from Proto-Celtic *tū, from Proto-Indo-European *túh₂. Cognate to Welsh ti.\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Slavic *biti.\n","From Proto-Slavic *bordà, from Proto-Indo-European *bʰardʰéh₂.\n","From Proto-Slavic *bergъ.\n","From Proto-Slavic *běgati (“to flee, run”).\n","From Proto-Slavic *vorta n pl, reanalyzed as a feminine singular.\n","From Proto-Slavic *vermę.\n","Cognate with Slovene vrv, Serbo-Croatian врвца/vrvca and врпца/vrpca, Russian верёвка (verjóvka).\n","връ́з(вам) (vrǎ́z(vam)) +‎ -ка (-ka)","From Proto-Slavic *vьrxъ.\n","From Proto-Slavic *vьlna (“wool”), from Proto-Indo-European *h₂wĺ̥h₁neh₂ (“wool”).\n","From Proto-Slavic *govoriti, from Proto-Indo-European *gow(H)- (“to call, cry”).\n",null,"Diminutive of ду́па (dúpa, “gap, indention”) (mostly obsolete) +‎ -ка (-ka).\n","From Proto-Slavic *drъvo, from Proto-Indo-European *dóru.\n","From Proto-Slavic *(j)ęzykъ, from Proto-Indo-European *dn̥ǵʰwéh₂s.\n","Deverbial noun from жела́я (želája, “to wish, to desire”) +‎ -ние (-nie), from Proto-Slavic *želati.\n","From Proto-Slavic *živěti.\n",null,null,null,"From Proto-Slavic *zemľa, from Proto-Balto-Slavic *źemē, from Proto-Indo-European *dʰéǵʰōm.\n","From Proto-Slavic *jьti.\n",null,null,"From Proto-Slavic *kalъ.\n","From Proto-Slavic *klonъ.\n","From Proto-Slavic *koža.\n",null,"From Proto-Slavic *kora, from Proto-Indo-European *ker-.\n","From Proto-Slavic *krajь.\n","From Proto-Slavic *korkъ (“limb, span”).\n","From Proto-Slavic *kǫsъ. Cognate with Russian кус (kus) and кусок (kusok), Slovene kos, Serbo-Croatian кус, kus, Slovak kus. Non-Slavic cognates include Sanskrit खादति (khādati, “he chews”), Persian خاییدن‎ (xāyīdan, “to chew”).\n","From Proto-Slavic *lopata. Morphologically formed from лоп- (lop-, “sheet, spade”) +‎ -ата (-ata).\n","From Proto-Slavic *lošь.\n","From Proto-Slavic *měsęcь, from Proto-Indo-European *mḗh₁n̥s.\n","Inherited from Proto-Slavic *moťь.\n","From Proto-Slavic *město.\n","From Proto-Slavic *noga (originally: claw), from Proto-Indo-European *h₃nogʰ-.\n","From Proto-Slavic *nogъtь, ultimately from Proto-Indo-European *h₃nogʰ-.\n","Formed as об- (ob-) +‎ върна (vǎrna, “to return”).\n","о- (o-) +‎ пи́там (pítam)",null,null,"From Proto-Slavic *paziti.\n","From Proto-Slavic *podъ.\n",null,null,null,null,"From Proto-Slavic *prǫtъ.\n","From Proto-Slavic *orbota, from *orbъ (“slave”) + *-ota.\n","Deverbial noun from разстоя́ (razstojá, “to be at a distance”) +‎ -ние (-nie), from Proto-Slavic *orzstojati.\n",null,null,"From Proto-Slavic *rǫka, from Proto-Balto-Slavic *ránkāˀ.\n",null,"с- (s-) +‎ въ́рша (vǎ́rša)","From Proto-Slavic *sila.\n","From Proto-Slavic *silьnъ.\n","From Proto-Slavic *synъ, from Proto-Balto-Slavic *sū́ˀnus, from Proto-Indo-European *suHnús.\n","с- (s-) +‎ кри́я (kríja)","From Old Church Slavonic стати (stati), from Proto-Slavic *stati (“to stand, become”).\n","From Proto-Slavic *starъ.\n","From Proto-Slavic *stornà (“side, land”); morphologically from стор (stor, “spread, extension”) (obsolete, archaic) +‎ -на (-na).\n","From Proto-Slavic *sъ̀nъ, from Proto-Indo-European *supnós.\n","From Proto-Slavic *tvьrdъ.\n",null,"From Proto-Slavic *tъgъda (“then”) + -ва (-va).\n","From Proto-Slavic *tьnъkъ. Akin to English thin, tight.\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","Probably of Iranian origin (compare Persian خوب‎ (“good”)), formally from Proto-Slavic *xubъ + -ав (-av). Cognate with Macedonian убав (ubav).\n","From Proto-Slavic *čьrta.\n",null,"From Proto-Slavic *ǫgъlъ, from Proto-Indo-European *h₂engulos (“joint?”), from *h₂eng- (“corner”).\n",null,null,"Uncertain. Possibly of pre-Roman origin, or of Gothic origin. Compare Spanish amagar (“to threaten”) and  Portuguese esmagar.\n","Borrowed from French attraper.","From Old Occitan, from Medieval Latin, Late Latin bursa, from Ancient Greek βύρσα (búrsa). Doublet of borsa.\n",null,null,"From camí +‎ -ar.\n",null,"From Latin corrigia, attested from 1271.",null,"Possibly from Latin de ex pressum, or more likely from Old Catalan despuix, despuis, depuis (itself from Latin de post) + aprés.","From Old Occitan [Term?] (compare Occitan ensenhar), from Vulgar Latin insignāre, present active infinitive of insignō (compare French enseigner, Spanish enseñar), from Latin signō.\n",null,null,"From Old Occitan, from Medieval Latin friscus, frescus, of Germanic origin, from Proto-Germanic *friskaz. More at English fresh.\n",null,null,null,null,"From Italian pantano, attested from the 14th century.","From Old Occitan [Term?], from Vulgar Latin *passāre, from Latin passum, supine of pando (“I stretch, I spread out”). Compare Occitan passar, French passer, Spanish pasar, Italian passare.\n","From Old Occitan, from Vulgar Latin *pendicāre, from Latin pendēre, present active infinitive of pendeō, from Proto-Italic *pendēō, from Proto-Indo-European *(s)pend- (“to pull; to spin”)","From Old Occitan, from Vulgar Latin *pīccāre, itself a derivative of Latin pīcus or of onomatopoetic origin.\n",null,null,"From a variant of Old Occitan [Term?], from Late Latin pausāre, present active infinitive of pausō, influenced in meaning by Latin pōnō. Compare French poser, Occitan pausar, Spanish posar, Portuguese pousar, Italian posare.\n",null,"Borrowed from Latin praeparāre, present active infinitive of praeparō (“I prepare”).\n","From Old Occitan, from Latin *podiāre, from Latin podium. Compare Occitan pujar, Aragonese puyar, Portuguese pojar, Italian poggiare; cf. also French appuyer, Spanish apoyar, Italian appoggiare, from a Vulgar Latin *appodiāre.\n","From sacsar +‎ -ejar.\n","From Old Occitan (compare Occitan sortir), from Latin sortīrī (“to select”) (present active infinitive of sortior), probably influenced by surrectus (through a Vulgar Latin form *surctus and its derivatives, possibly through a verb *surrectīre, surctīre; cf. also Old Catalan surt, surta).\n","From Old Occitan, from Late Latin taleare or taliāre, present active infinitive of taliō, from Latin talea.\n",null,null,"From Medieval Latin, from Vulgar Latin *tirō, tirāre, from Proto-Germanic *teraną (“to tear, tear away, rip or snatch off, pull violently, tug”) (through Gothic *𐍄𐌹𐍂𐌰𐌽 (*tiran)), from Proto-Indo-European *der- (“to tear, tear apart”). Alternatively Late Latin *martyrāre, possibly with influence from Latin trahō. Compare French tirer, Italian tirare.\n",null,null,"From Old Occitan, from Vulgar Latin *ungla, syncopated form of Latin ungula, from unguis, ultimately from Proto-Indo-European *h₃negʰ-.\n",null,null,null,"From Old Czech chot, from Proto-Slavic *chotь. Related to chtít.\n",null,null,null,null,"jíst +‎ -dlo",null,null,null,null,null,null,null,"From o- +‎ hnout.\n",null,"při- +‎ vázat",null,null,null,"From s- +‎ chovat.\n",null,null,null,"From s- +‎ pojit",null,null,null,null,null,null,"Compare Slovak vetva and Russian ветвь (vetvʹ).\n",null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Nakh *butt.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Nakh *dāli.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Nakh *kōḳ.\n",null,null,"From Proto-Nakh *qēra.\n",null,null,null,null,null,null,null,null,null,"From Proto-Nakh *lātte.\n",null,null,null,null,null,"From Proto-Nakh *moṭṭ.\n",null,null,null,null,null,null,null,"From Proto-Nakh *pχā. Cognate with Ingush пхьан (pḥan, “hornbeam”). Associated with several weapon names, because they were made of hornbeam: Chechen пха (pχa, “arrow”), пха, пхьа (pχa, pḥa, “shield”), пхердукъ (pχerduq̇, “spear”).\n","From сан (san, “my, mine”); related to сирла (sirla, “light, bright, clear”) and серло (serlo, “light, brightness, illumination”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Ingush ха (χa). Related to Georgian ხანი (xani). This etymology is incomplete. You can help Wiktionary by elaborating on the origins of this term.",null,"From Proto-Nakh *xi.\n",null,null,null,null,null,null,null,null,null,null,null,"From Proto-Nakh *cħa.\n","From Proto-Nakh *c̣e (“name”).\n",null,null,null,null,null,null,"From Proto-Nakh *jobq̇.\n",null,null,null,"Borrowed from Russian обед (obed).\n","Related to Tatar апа (apa), from Old Turkic apa.\n",null,null,null,null,null,null,null,null,null,null,null,null,"Compare Tatar ут (ut).\n",null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *kȫk.\n",null,null,null,null,null,"From Proto-Turkic *gīr- (“to enter”). Cognate with Old Turkic 𐰚𐰃𐰼‎ (kir- /kir²/), Turkish girmek, Azerbaijani girmək etc.\n",null,null,null,"From Proto-Turkic *gül. Cognate with Turkish and Azerbaijani -gil (“someone's home or family”), Yakut күүлэ (küüle, “entrance hall”).\n",null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *buŕ- / *boŕ- (“to damage, destroy”). Cognate with Azerbaijani pozmaq, Bashkir боҙоу (boðou).\n",null,null,"Related to Turkish bulut and Yakut пылыт (pılıt), from Proto-Turkic *bulït, .\n",null,null,null,null,"From Proto-Turkic *biarŋak.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *yāŕ. Cognate with Turkish yaz (“summer”).\n",null,null,null,null,null,null,null,null,"Historically from тăв (tăv) (< тав (taw) < тау (tau)), from Proto-Turkic *tāg.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *kāŕ, compare Turkish kaz.\n",null,null,null,null,null,null,"From Proto-Turkic *dɨl.\n",null,null,null,"From Proto-Turkic *dik- (“vertical; to to plant vertically”).\nCompare Azerbaijani dikmək (“to bury”) dik (“upright, vertical”), tikmək (“to sew”); Turkish dikmek (“to sew”), Kumyk тикмек (tikmek, “to sew; to build”) Kazakh тігу (tigw).\n",null,"Related to Turkish diş.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Chukotko-Kamchatkan *ðəlɣə (“finger”). Compare also Koryak йәлгәлӈән, Alutor тылгылӈын and Itelmen луфԓич.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Japhug amdzɯ (Zhang, Jacques, and Lai, 2019).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Simplified from 點 (黑 → 灬). Note that 黑 changed from being on the left to being 灬, underneath. Compare 黙 (from 默), which retains the 里, and 黒, which is the simplification in isolation.\nCurrent form is graphically 占 + 灬.\n",null,null,null,null,null,null,"From Proto-Sino-Tibetan *m-kul (“twenty; all”); cognate with 昆 (OC *kuːn, “swarming”), Tibetan ཀུན (kun, “all”), Burmese အကုန် (a.kun, “all”) (Benedict, 1972; STEDT).\n",null,null,"From Proto-Sino-Tibetan *m/g-(r)wa-ŋ/k/t (“horn; angle; corner”) (STEDT). Cognate with Tibetan རྭ (rwa, “horn”), Garo grong (“horn”), Jingpho nrung (n̩³¹ ʒuŋ³³, “horn”), Chepang रोङः (roŋʔ, “horn”), 觡 (OC *kraːɡ, “antler”). The Tibeto-Burman *-ŋ final variant is reflected in 觥 (OC *kʷraːŋ, “drinking vessel made from animal horn”) (Schuessler, 2007). Possibly also related to 鹿 (OC *b·roːɡ, “deer”) (Sagart, 1999).\nA derivative is 餃 (“stuffed dumpling”), named for its horn-like shape (Norman, 1988).\nIt is probably unrelated with Proto-Indo-European *ḱr̥h₂nós (“horn”) ( < *ḱerh₂- (“horn”)) and Proto-Semitic *ḳarn- (“horn”) despite the phonological and semantic resemblance between the three.\n",null,null,null,null,null,null,null,null,"Proto-Celtic *bawā. Compare French boue (“mud”), from Gaulish *bauā.\n","From berw (“boiling”) +‎ -i.\n",null,null,"From Middle Welsh bwrt, from Old English bord (compare Irish bord); doublet of bord.\n",null,"From Proto-Brythonic *catarno, from Proto-Celtic *katus (“battle”). See cad.\n",null,"From cau +‎ -ad.\n","From cangau, plural of cainc (“branch”) (from Proto-Celtic *kankā),  +‎ -en (singulative suffix).",null,"From casgl (“collection”) +‎ -u.\n","Cognate with Cornish gwari and Breton c'hoari.\n",null,null,"Cognate with Cornish kelmi, Breton koulmañ.\n","From Proto-Brythonic *klüwid, from Proto-Celtic *klusīti, from Proto-Indo-European *ḱlew-.\n","Clipping of cyfodi, from cyf- +‎ odi.\n",null,"From Proto-Celtic *koudeti, from Proto-Indo-European *(s)kewdʰ- (“to cover, wrap, encase”),  +‎ -io (forming verbnouns). Cognate with Cornish cuthe, Breton cuzaff, English hide, Latin custōs, Ancient Greek κεύθω (keúthō, “to conceal”), Sanskrit कुहरम् (kuharam, “cave”).\n","From cwymp.\n","From cyf- +‎ rhif.\n",null,null,"From Proto-Brythonic *dalg-, from Proto-Indo-European *delgʰ-. Cognate with Latin indulgeo.","Contraction of older deau (“right; south”), from Proto-Celtic *dexsos (“right”). Cognate with Cornish dyhow, Breton dehou, Irish deas, Scottish Gaelic deas, Manx jiass.\nThe sense \"south\" comes from the fact that the south is on the right-hand side of a person facing east.",null,null,null,null,"Borrowed from Latin discō (“I learn”). Cognate to Breton deskiñ and Cornish dyski, from the same origin.\n",null,"Borrowed from Old English ford","Ultimately from Proto-Indo-European *ǵʰeh₁- (“to leave behind, abandon”).",null,"From gorchudd +‎ -io.\n","From Old Welsh guor (“over”) +‎ phenn (“head”) (see penn).\nCognate with Cornish gorfedna, Breton gourfennañ.\n","From Proto-Celtic *u̯o-stutā (see go-), from Proto-Indo-European *steh₂-.","From Proto-Celtic *grendsmu, from Proto-Indo-European *gʰredʰ-. Cognate with Latin gradus (“step”).\n",null,"The variant gwddwg is cognate with Old Breton guodoc (Middle Breton gouzouc, Breton gouzoug, goûg), but it is difficult to explain the alternation between -wg, -w, and -f. The oldest form of the word cited in Geiriadur Prifysgol Cymru is the Middle Welsh plural form gedueu (13th century; = modern gyddfau), while the soft mutation forms wðwc, wddf, and wddw are all attested in the 14th century, indicating that the alternation is very old.\n",null,"Back-formation from gwneuthur, from Middle Welsh gwneuthur, altered from *gwreithur with -n- from gwnïo (“to sew”), from Proto-Celtic *wregeti (compare Cornish gwra (“he does, makes”), Breton gra (“he does, makes”), Old Irish fairged (“they made”)), from Proto-Indo-European *werǵ- (compare English work). Middle Welsh preserved the -r- in the preterite: gwreith (“I did, made”), goruc (“he did, made”).\n",null,"gwth +‎ -io","From gyr (“drive, thrust; flock, drove”) +‎ -u.\n",null,null,null,null,"Cognate with Breton moan, Cornish moon.\n",null,"Ultimately from Proto-Indo-European *med- (“measure; advise”).This etymology is incomplete. You can help Wiktionary by elaborating on the origins of this term.",null,"Suppletive verb; verbal noun from Middle Welsh mynet, from Proto-Brythonic *moned (compare Cornish mones, Breton mont), verbal noun of Proto-Celtic *monītor (compare Middle Irish muinithir (“goes around”)), from Proto-Indo-European *menH- (compare Umbrian menes (“will come”), Lithuanian mìnti (“to trample, scutch”)). Indicative forms from Proto-Celtic *ageti (“to drive”) (compare Old Irish aigid), from Proto-Indo-European *h₂eǵ- (compare Latin agō). The forms in el- are from Proto-Celtic *ɸel- (“to approach, drive”), from Proto-Indo-European *pelh₂- (compare Latin pellō (“strike, drive”), Epic Greek πίλναμαι (pílnamai, “approach”).\n",null,null,"From pell (“far (away), distant, remote”) +‎ -ter.\n",null,null,"From Latin probō (“to test”).\n","pwdr +‎ -u. Cognate with Cornish pedri.\n",null,"From rhuthr (“rush”, noun) +‎ -o, ultimately from Proto-Indo-European *h₃rew- (“to hurry”). Cognate with Middle Irish rúatharaigid (“makes a rush or onset”), from rúathar, rúathur m (“onrush, onset, attack”).",null,"From sain +‎ -io.\n",null,"sych (“dry”) +‎ -u.\n","Ultimately from Proto-Indo-European *terh₁- (“to rub, turn; pierce”).",null,"According to Matasovic, from a non-Indo-European language, but Pokorny suggests Proto-Indo-European *terkʷ- (“to twist, spin”).  Cognate with Cornish terri, Breton torriñ.\n","From tro +‎ -i.\n","Perhaps ultimately from Proto-Indo-European *ten- (“stretch, extend”).","From ym- +‎ gadael (“leave”)","From ym- +‎ dangos.\n","See ym-. Cognate with Irish imeall.",null,"From ysgub +‎ -o.\n",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Old Norse annarr, from Proto-Germanic *anþeraz (“second, other”).\n",null,"From Old Danish athræ, Old Norse ædr, from Proto-Germanic *ēþrǭ (“vein”). Related to German Ader.\n","Equivalent to be- +‎ tale (“to speak”), from Middle Low German betalen, compare German bezahlen. A compound with the Germanic verb *talōną (“to tell; to count”).\n","Borrowed from Middle Low German bliven, from Old Saxon bilīƀan, from Proto-Germanic *bilībaną, cognate with German bleiben (“to remain”). In the sense “to become\", it has replaced older vorde.\n","Derived from the verb.\n",null,"From Old Danish fange, borrowed from Middle Low German vangen (“to catch”), from vān, from Proto-Germanic *fanganą. Doublet of få (“to get”).\n","Older Danish farge, from Middle Low German varwe, verwe, from *Old Saxon farwi, *farawi (“colour”), from Proto-Germanic *farwō, from Proto-Indo-European *per-, *perḱ- (“motley, coloured”). Cognate with Old High German farawa (“color”) (German Farbe), Old High German faro (“colored”), Latin pulcher (“beautiful, sheen”), Ancient Greek περκνός (perknós, “multicolored”), Old Irish earc (“spotted”).\n","From Old Danish feye, borrowed from Middle Low German vegen, from Proto-Germanic *fegōną, cognate with Old High German vegōn, German fegen. Usually associated with Old Norse fága (“to adorn, polish”), Middle Low German vāgen, from Proto-Germanic *fēgōną, but the details are unclear.\n","From Middle Low German vluchten, compare German flüchten. Derived from the noun Danish flugt, from Middle Low German vlucht, from Proto-Germanic *fluhtiz (“flight”), cognate with English flight and German Flucht.\n",null,null,null,"A merger of two related verbs: 1. Old Norse hengja (“to hang (transitive)”), from Proto-Germanic *hangijaną, cognate with German hängen; and 2. Old Norse hanga (“to hang (intransitive)”), from Proto-Germanic *hanhaną, cognate with English hang and German hangen. In the past tense, Danish still distinguishes transitive hængte from intransitive hang (though they are often mixed up).\n",null,"Likely related to næppe (“hardly at all”)",null,"From Middle Low German lēren, from Proto-Germanic *laizijaną, cognate with German lehren (“teach”), Dutch leren, and Gothic 𐌻𐌰𐌹𐍃𐌾𐌰𐌽 (laisjan). Late Old Norse læra, Norwegian lære, and Swedish lära are also borrowed form Low German.\n",null,null,"From Old Norse regna, from Proto-Germanic *regnōną, cognate with English rain and German regnen. Derived from the noun *regną, cf. Danish regn.\n",null,null,null,null,"Compare German schlimm.\n",null,null,null,"From stå (“stand”) and op (“up”). Compare opstå.\n","From Middle Low German stecken, from Old Saxon stekan.\n",null,null,"From Old Danish siunkæ, from Old Norse *sinkwa (east) / søkkva (west), from Proto-Germanic *sinkwaną, cognate with Swedish sjunka, English sink, German sinken, Dutch sinken, Gothic 𐍃𐌹𐌲𐌵𐌰𐌽 (sigqan).\n",null,"From Old Danish wogge, from Old Norse vagga (accusative, dative, genitive vǫggu), cognate with Swedish vagga. Derived form the verb vaga (see the following word).\n",null,null,null,"From Proto-Mongolic *arca, compare East Yugur hrca (“cypress”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finno-Ugric *käte.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Compound of an- (“on, at”) +‎ zünden (“to ignite, kindle”). Akin to Old English ontendan, Swedish antända, Norwegian antenne.\n",null,"From a Baltic language. Compare Old Prussian ansis (“hook, latch”) and Latvian osa. Cognate to Finnish ansa and Votic aasa.\n","From abi +‎ kaasa.\n","From Proto-Finnic *alla.\n",null,"From erk (“alert”, noun), see there for further etymology. Compare Finnish herätä.\n",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)\nRelated to Finnish enne.\n","Allegedly coined ex nihilo by Johannes Aavik in the 20th century, but compare Finnish esine.\n","Cognate to Votic ääli and Livonian ēļ. Possibly a cognate to Finnish ääni, in which case the sound change n -> l would have happened in Estonian, Votic and Livonian.\n","Possibly from Proto-Germanic *hakkōną. Alternatively of Baltic origin; compare Latvian sākt (“to start”) and Lithuanian šokti.\n","Onomatopoeic, from heli. Cognate with Finnish helistä, Veps heläitä and Votic elisä.\n",null,null,null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"Possibly from Proto-Finnic *koneh (“magic”) (whence Karelian koneh (“magic”), Finnish kone (“machine, trick”)).\n",null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)\nRelated to Finnish langeta.\n",null,null,null,"From Proto-Finnic *maa, from Proto-Uralic *mëxe. Cognates include Finnish maa and Karelian mua.\n",null,null,null,null,null,null,"Cognate with Finnish ohut.\n",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium. Particularly: “Derived how?”)\nFrom õppima.\n",null,null,null,"From paras +‎ -ndama.\n",null,null,null,null,null,null,null,null,null,null,null,"From rappuma +‎ -tama.\n",null,"Of Finno-Samic origin. Cognate with Finnish rinta. Alternatively of Germanic origin, from Proto-Norse *strinða-. Compare Old Norse strind (“border, side, land”) and Norwegian strind (“slice, line, row”). This is unlikely due to the difference in meaning.\n",null,null,"From Proto-Finnic *se, ultimately from Proto-Uralic *śe. cognate to Finnish se, Votic se, Erzya се (se, “this, that”), Khanty си (si, “that over yonder; now, then”), and Nganasan [script needed] (sete, “he, she”).\n","Of Finnic origin. Cognate to Finnish sekoittaa and Livonian sie’ggõ.\n",null,null,null,null,null,null,null,null,null,null,"From üks +‎ -ndama. Compare Finnish yhdentää.\n",null,"Onomatopoetic. A similar root is seen in Livonian ūška (“worm”). Possibly from Old East Slavic ужь (užĭ).\n","Derived from valvama (“to guard”), contracted from original *valvatama.\n",null,null,null,null,null,"From Ancient Greek ἄκρα (ákra)",null,null,"Inherited from Ancient Greek ἀπόστασις (apóstasis).\n","From αρχή (archí, “the beginning”) +‎ -ίζω (-ízo).\n","From Ancient Greek βαδίζω (badízō).\n",null,null,"From Koine Greek βράζω (brázō) from Ancient Greek βράσσω (brássō, “shake violently”).\n",null,"From Ancient Greek γίγνομαι (gígnomai)","From Ancient Greek γράμμα (grámma). Morphologically γράφω (gráfo) +‎ -μα (-ma, result noun suffix).\n","From the Ancient Greek γρᾰμμή (grammḗ).\n","From Byzantine Greek ἐγύρισα (egúrisa), aorist of Byzantine Greek γυρνῶ (gurnô).\n",null,"The earlier form is δίδω (dído), from Byzantine Greek δίδω (dídō), from Ancient Greek δίδωμι (dídōmi), from Proto-Indo-European *dédeh₃ti, reduplicated present of *deh₃- (“to give”).\n","Inherited from Ancient Greek δρόμος (drómos).\n","From Ancient Greek δύναμις (dúnamis).\n","From Ancient Greek ἐγκαταλείπω. Morphologically, (εν-) εγ- (“in”) +‎ κατα- (“totally”) +‎ λείπω (“leave”).\n","From Byzantine Greek ἐδῶ (edô), from a metathetic variant of Ancient Greek ὧδε (hôde).\n","From Ancient Greek ἦχος (êkhos)",null,"From Medieval Byzantine Greek κάθομαι (“I stay, reside”) from Ancient Greek κάθημαι (káthēmai, “to sit, to sit down, to be idle”).\nThe perfective stem καθισ- as in simple past κάθισα (káthisa), from aorist Ancient Greek ἐκάθισᾰ/κάθισᾰ of verb καθίζω (kathízō).\nThe second perfective stem κατσ- e.g. έκατσα (ékatsa), from εκάθισα (ekáthisa) (with omission of /i/ & [θs] > [ts]) of verb καθίζω (kathízō).\n","From Ancient Greek καίω (kaíō) and Mediaeval καίγω (kaígō), from Proto-Hellenic *kayyō. Also see καύση (káfsi, “burning”).\n","From Ancient Greek κᾰκός (kakós).\n","From Ancient Greek κάμνω (kámnō), from Proto-Indo-European *kem(H)- (“to be tired”).\n",null,"Sense pole: from Ancient Greek κοντός (“pole”) (noun).\nSense short: from the Hellenistic Koine Greek κοντός (kontós, “short”) (adjective) from the ancient sense Ancient Greek κοντός (“pole”) which referred to shorter kinds of poles, hence the sense shortness. \n","From Ancient Greek κόσμος (kósmos).\n",null,null,null,null,"From Hellenistic Koine Greek κρύβω, from the ancient κρύπτω (“hide”) from the perfective stem κρυψ- in the pattern of -ψ- > -β- as in κλέπτω (klépto), κλεψ- > κλέβω (klévo, “steal”).","See Etymology at λιώνω.\n","From Ancient Greek λόγος (lógos).\n","From Medieval Byzantine Greek μαθαίνω from the aorist stem μαθ‑ (ἔμαθον) of ancient Ancient Greek verb μανθάνω (manthánō, “know, understand”) and metaplasm ‑αίνω.",null,null,null,"From Byzantine Greek μύτη (mútē), from Ancient Greek μύτις (mútis, “snout”). Displaced earlier Ancient Greek ῥίς (rhís).\n","From Byzantine Greek νύχιν (núkhin), inherited from Ancient Greek ὀνύχιον (onúkhion), diminutive of ὄνυξ (ónux), ultimately from Proto-Indo-European *h₃negʰ-.\n","From Ancient Greek ἐξεῦρον (exeûron), aorist of ἐξευρίσκω (exeurískō, “to find out”), from εὑρίσκω (heurískō, “to find”) (whence Modern βρίσκω (vrísko)).\n","From Ancient Greek ξύλον (xúlon).\n",null,"From Ancient Greek ὁδηγῶ (hodēgô), contracted form of ὁδηγέω (hodēgéō).\n","From Mediaeval Byzantine Greek ὄμορφος (ómorphos) < ἔμορφος (émorphos), from the Ancient Greek εὔμορφος (eúmorphos), from εὖ (eû) + μορφή (morphḗ).\n","From Medieval Byzantine παλιός from Ancient Greek παλαιός (palaiós).\n","From the Ancient Greek πᾰχῠ́ς (pakhús).\n","Backformation from Ancient Greek ἀπέθανε (apéthane) the third person singular aorist of ἀποθνῄσκω (apothnḗiskō, “die”).\n","From Ancient Greek περιμένω (periménō, “-”).\n",null,"From Ancient Greek ὑπάγω (hupágō, “bring under”) in its Hellenistic sense \"go\", through its imperfect tense ὑπῆγον (hupêgon) > mediaeval ὑπῆγα (hupêga) which was wrongly analysed as ὑ- + πῆγα (instead of ὑπ- +) and a formation of a new mediaeval present tense + -αίνω (-aínō), πηγαίνω (pēgaínō), in the familiar pattern of aorist - present like ἔμαθα (ἔmatha) - μαθαίνω (mathaíno, “learn”). The form πάω (páo), with silenced [ɣ] for <γ> of mediaeval ὑπάγω.Also see the imperative άμε! (áme!), parallel form of πήγαινε! (pígaine!) and the mediaeval types ὑπαγαίνω (hupagaínō), ἀπηγαίνω (apēgaínō).\n",null,"From Byzantine Greek [Term?], from an aphetic form of Ancient Greek ὀπίσω (opísō).\n","From Ancient Greek πληρόω (plēróō, “to complete”). For semantic development, compare Hebrew שילם \\ שִׁלֵּם‎ (shilém, “to pay”, literally “to complete”).\n","From Ancient Greek ποτέ (poté).\n","From Ancient Greek ποῦ (poû), from Proto-Indo-European *kʷos.\n","From Byzantine Greek ῥαβδίν (rhabdín), inherited from Ancient Greek ῥαβδίον (rhabdíon), a diminutive of ῥάβδος (rhábdos).\n","From Ancient Greek ῥέω.\n",null,"From Ancient Greek σείω.\n",null,"From Ancient Greek σκέπω (sképō)",null,"From Ancient Greek σπῶ (spô)/σπάω (spáō) + -άζω (-ázo). Also see σπάω (spáo).\n","From Byzantine Greek ὁσπίτιον (hospítion), from Latin hospitium (“lodgings”). Compare Albanian shtëpi. Displaced earlier Ancient Greek οἶκος (oîkos).\n","From Medieval Byzantine Greek σπρώχνω (sprṓkhnō), from Ancient Greek προωθῶ (proōthô) / προωθέω (proōthéō, “push forward, propel”) by liaison with pronouns, or from an unattested ancient *εἰσπροωθῶ.","From Ancient Greek στῆθος (stêthos).\n","Inherited from Ancient Greek σύζυγος (súzugos, “mate, yoked together”), from συ(ν) (su(n), “together”) +‎ ζυγός (zugós, “yoke, pair”), from Proto-Indo-European *yewg- (“to join, tie together”).\n","Learnedly from Ancient Greek σχίζω (skhízō). See σκίζω (skízo).\n",null,"From Byzantine Greek τελειώνω (teleiṓnō), from Ancient Greek τελειῶ (teleiô), contracted form of τελειόω (teleióō, “complete, make perfect”) + -ώνω (-óno, suffix for verbs).",null,"Inherited from Ancient Greek τρέχω (trékhō), from Proto-Indo-European *dʰregʰ- (“to run”).\n",null,null,"Derived from forms of Ancient Greek ἔφαγον (éphagon, “I ate”).\n",null,"From Ancient Greek φέρω (phérō) with addition of a nasal infix, from Proto-Hellenic *pʰérō, from Proto-Indo-European *bʰéreti.\n","From Ancient Greek φεύγω (pheúgō, “flee”) (the sense \"leave\" since mediaeval times. From Proto-Hellenic *pʰéugō, from Proto-Indo-European *bʰewg-. Has been displaced by δραπετεύω (drapetévo) in the Ancient Greek sense of \"to flee\".\n","From Ancient Greek φίλος (phílos), probably from a Proto-Hellenic *pʰílos, from Proto-Indo-European *bʰil-o-s, from *bʰil- (“decent, good, harmonious, friendly”).\n",null,"From Ancient Greek πτυάριον (ptuárion).\n","Inherited from Ancient Greek φυσῶ (phusô), contracted form of φυσάω (phusáō). Also see the modern φυσάω (fysáo)",null,"Inherited from Ancient Greek χεῖλος (kheîlos).\n","From Ancient Greek χρόνος (khrónos).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Persian پری‎ (peri).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Middle English comb, from Old English camb (“comb”), from Proto-Germanic *kambaz (“comb”) (compare Saterland Frisian Koum, Swedish/Dutch kam, Norwegian kam, German Kamm), from Proto-Indo-European *ǵómbʰos (“tooth”), from Proto-Indo-European *ǵómbʰ- (“to pierce, gnaw through”) (compare Tocharian B keme, Lithuanian žam̃bas (“sharp edge”), Old Church Slavonic зѫбъ (zǫbŭ), Albanian dhëmb, Ancient Greek γομφίος (gomphíos, “backtooth, molar”), Sanskrit जम्भ (jambha)).\n","From Middle English fat, from Old English fǣtt (“fatted, fat”), from Proto-West Germanic *faitid (“fatted”), originally the past participle of the verb *faitijan (“to make fat”), from *fait (“fat”).\n","From Middle English hond, hand, from Old English hand (“hand, side (in defining position), power, control, possession, charge, agency, person regarded as holder or receiver of something”), from Proto-West Germanic *handu (“hand”), from Proto-Germanic *handuz (“hand”) (compare Dutch, Norwegian Nynorsk, Swedish hand, German Hand, West Frisian hân), of uncertain origin. Perhaps compare Old Swedish hinna (“to gain”), Gothic 𐍆𐍂𐌰-𐌷𐌹𐌽𐌸𐌰𐌽 (fra-hinþan, “to take captive, capture”); and Latvian sīts (“hunting spear”), Ancient Greek κεντέω (kentéō, “prick”), Albanian çandër (“pitchfork, prop”).\n","From Middle English, borrowed from Old French peintier, paincter, itself from paint, the past participle of paindre, from Latin pingō (“to paint”) (perfect passive participle pictus).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Unknown. Often explained as a Celtic borrowing. Compare Old Irish adarc (“horn”); see there for more.\n","Eventually from Latin audio. \n",null,null,"Unknown. Some have linked this word to the Proto-Indo-European root *h₂erǵ-, though this is highly unlikely, as no suitable source for this word is attested in any IE language known to have been in contact with Basque.\n",null,null,null,null,null,null,null,null,null,null,"From begi (“eye”) and more precisely begira (“allative case of begi”) +‎ -tu. Compare with French jeter un œil.\n",null,null,null,null,null,null,null,null,null,null,"Unknown.",null,"From Proto-Basque *e(H)uń, itself perhaps from Gothic 𐌰𐌹𐌽 𐌷𐌿𐌽𐌳 (ain hund).\n",null,"Unknown. Often compared with Iberian erder (“half”). For the meaning “to give birth”, compare the semantic field of Latin pars (“part”) and the correspondent verb parere (“to give birth”).\n",null,null,null,null,null,null,"Originally attested as etse, itself of unknown origin.",null,null,null,null,null,"Of native origin, probably a reduplicated form of an ancient root. \n",null,null,null,null,null,null,null,"Perhaps from Occitan eigau (“south wind bringing rain”), from Latin aquālem (“watery”), from aqua, from Proto-Italic *akʷā, from Proto-Indo-European *h₂ékʷeh₂. \n",null,"From Proto-Basque *heŕi (“town, inhabited place, people, nation”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Basque *luŕ. \n",null,null,null,null,null,null,"From Proto-Basque *su. \n","Unclear. Apparently from ur (“water”) +‎ -din (“resembling”), although the normal morphophonological rules would yield *udin.",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Tungusic *gara, cognate with Even гар (gar), Nanai гара and Manchu ᡤᠠᡵᡤᠠᠨ (gargan) etc.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Tungusic *ńaŋńa (“clear sky”). Cognate with Even няни̇н (ņaņi̇n), Manchu ᠨᡳᠶᠠᠩᠨᡳᠶᠠ (niyangniya, “clear sky”), etc.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finnic *ääni, from Proto-Finno-Ugric *äne; cognate with Hungarian ének. The meaning \"vote\" is a semantic loan from  Swedish röst.\n","From Proto-Finnic *ajadak, from Proto-Finno-Ugric *aja-. Cognates include Estonian ajama and Northern Sami vuodjit. Likely an old loan from Indo-Iranian: compare Sanskrit अजति (ájati), further also Latin agō and Ancient Greek ἄγω (ágō) (likewise from Proto-Indo-European *h₂eǵ-).\n",null,null,null,null,null,null,"From Proto-Finnic *jalka, from Proto-Finno-Ugric *jalka.\n","From Proto-Finnic *jättädäk. Equivalent to jä +‎ ttää.\n","Originally a passive verb, derived from joutaa +‎ -ua.\n",null,null,null,null,"From Proto-Finnic *kaccodak. Cognate to Estonian katsuma.\nUncertain etymologies from Proto-Germanic *ganhatjaną (compare Icelandic gæta (“watch over, look after”)) and Proto-Finno-Permic *kaće- (compare Komi-Zyrian казявны (kazjavny)).\n","From Proto-Finnic *käveldäk. Equivalent to käydä +‎ -ella.\n","From Proto-Finnic *keeli, from Proto-Uralic *käle. Cognates include Estonian keel and Northern Sami giella.\n","kiire +‎ -htiä","koh- +‎ -ista; of onomatopoeic origin.\n",null,"\nFrom Proto-Finnic *koori (compare Estonian koor, Livonian kūoŕ, Veps kor'), from Proto-Uralic *kare (compare Moksha карь (karʹ, “bast shoe”)). Possibly related to Proto-Indo-European *(s)ker-.\n\n",null,null,"\nFrom Proto-Finnic *kuuci, from Proto-Finno-Ugric *kutte. Cognates include Estonian kuus, Khanty хәт (xət), Mansi хо̄т (hōt), Hungarian hat.\n\n","kuva +‎ -io. Coined by Finnish physician and translator Wolmar Schildt.\n","From Proto-Finnic *künci, from Proto-Uralic *künče. Cognates include Estonian küüs, Ter Sami kannc.\n",null,null,null,null,null,null,null,"From Proto-Finnic *maa, from Proto-Uralic *mëxe. Cognates include Estonian maa and Karelian mua, Erzya мастор (mastor) (initial component), Komi-Zyrian му (mu), Udmurt му (mu), Mansi ма̄ (mā).\n",null,"mätä +‎ -tä",null,null,null,null,"nos- +‎ -taa. Irregular; *noustaa would be expected.\n",null,"From Proto-Finnic [Term?], from Proto-Finno-Permic *oća-. Akin to Estonian ootama, Karelian vuottua, Livonian vȯ’dlõ, Ludian vuotada, Votic oottaa, Erzya утшомс (utšoms) and Eastern Mari вучаш (vučaš).\n",null,"From ope- +‎ -ttaa, from the same root as oppia.\n","From Proto-Finnic *pää, from Proto-Finno-Ugric *päŋe. Cognates include Estonian pea, Veps pä and Hungarian fej, fő.\n",null,null,null,null,null,null,null,null,null,null,"Momentary aspect of puhua, from puh +‎ -altaa, or earlier. Compare puhkua.\n",null,null,null,null,"säilyä +‎ -ttää",null,null,"syttyä +‎ -ttää",null,"A causative verb, derived from the verb taipua; taipua +‎ -ttaa. First adopted to mean \"to inflect, declinate, conjugate\" by Finnish clergyman and teacher H. K. Corander, in which sense a semantic loan from  Latin īnflectō.\n",null,"From Proto-Finnic *tektäk, from Proto-Finno-Ugric *teke-. Cognates include Estonian tegema, Northern Sami dahkat, and Hungarian tesz.\n","From Proto-Finnic *teräbä. Equivalent to terä +‎ -vä (adjective-forming suffix).\n","From Proto-Finnic *toinen. Equivalent to tuo (“that”) +‎ -inen.\n",null,"From Proto-Finnic *tuldak, from Proto-Uralic *tole-. Cognate with Hungarian talál.\n",null,"From Proto-Finnic *uni, from Proto-Finno-Permic *une.\n",null,null,null,"valmis +‎ -taa",null,null,null,"From Proto-Finnic *vilja, borrowed from Proto-Indo-European [Term?] (cognate with Russian обилие (obilije, “abundance”)) and Czech obilí (“grain, cereals”), if not directly from Slavic or Balto-Slavic. Other cognates include Estonian vili, Veps vil'l' and Proto-Samic *vëljē.\n","yhd- +‎ -istää",null,"From the conjugated forms of Old French amer, from Latin amāre, present active infinitive of amō (“I love”).\n","A suppletive verb; Latin vādō (“I go”) supplies the present tense and īre, present active infinitive of the synonymous eō, supplies the future and conditional.\nThe all- forms derive from Middle French aller, from Old French aler (with subjunctive aill- and other forms with all-), from Vulgar Latin *alō (attested in the 7th century Reichenau Glosses). \nMany explanations have been proposed for the etymology of this all- stem but none has met with a unanimous agreement among philologists. The all- stem has traditionaly been explained as deriving from Latin ambulāre via or together
