 with ambler (compare Old Occitan amblar, Italian ambiare, Romanian umbla), but this explanation is phonologically problematic; ambler is additionally more likely a borrowing from Old Occitan. Several theories have been put forth since the 17th century to explain how ambulare could have become aller.\nSince at least the 18th century, some have suggested that aller derives not from Latin but from Celtic, Gaulish *aliu, from Proto-Celtic zero grade *ɸal-. Compare Welsh elwyf (“I may go”), Cornish ellev (“I may go”), from full grade *ɸel- (see mynd for more). This theory is however phonetically problematic.\nAnother theory was proposed in 1934 by E.F. Parker, suggesting that aller derives from a Late Latin stem *allare which would have been formed out of allatum, past participle of adfero (\"to bring\"). The idiomatic phrase allatum esse (\"to be brought\") is recorded in Classical Latin and would have become very common in Northern France with a meaning derivation from being brought to to have been to, in which the past participle *allatus would have been taken as meaning to go and would have then inspired a new infinitive allare (allatus wouldn't have been felt any more as being the same verb as adferre due to particular dissemblance between its stems). This new stem allare would have then been used in suppletion for the Gallo-Roman verb to go as it's infinitive ire had already been forgotten (though it had already formed the future and conditional stem of this verb) and the monosyllabic forms of the present indicative conjugation had already been replaced with those of vadere.\nFranco-Provençal allar and Friulan lâ (“to go”) (compare lin (“we go”), lât (“gone”)) are from the same source, whatever it may be.\n",null,null,null,null,"From Old French bord, from Frankish *bord.\n",null,"From Middle French brusler “to burn” from Old French brusler, bruller (“to burn”), a conflation of bruir (“to burn”) (from Frankish *brōjan (“to burn, scald”), from Proto-Germanic *brōaną “to scald”, from Proto-Indo-European *bʰerw-, *bʰrew- “to boil, seethe”), and usler (“to scorch”), from Latin ustulāre (“to scorch”). \nCompare also Italian bruciare, from a Vulgar Latin form *brusiō, which is probably related, as well as brustolare. The initial br- has had other origins proposed, such as from a Gaulish source, or from a corruption of a form *combustulāre, from a change of prefix of ambustulāre, influenced by combustus. Akin to German brühen (“to scald”), Dutch broeien (“to heat”). More at broil, brew.\n",null,null,"From Old French coper, colper (“to cut off”), probably, derived from cop (“blow”), colp (modern coup), with its meaning coming from the idea of cutting off with a blow. It may correspond to a Vulgar Latin verb *colpāre, syncopated form of *colaphāre, from Latin colaphus (compare Old Spanish golpar, colpar, Old Portuguese golpar, golbar). Alternatively, possibly from Vulgar Latin *cuppāre (“to behead”), from Latin caput (“head”), although this is unlikely.\n",null,null,"en- +‎ suite.\n","From Middle French entendre and Old French entendre, from Latin intendere, present active infinitive of intendō (“to turn one's attention, to strain”).\n","(daughter): From Middle French fille, from Old French fille, from Latin fīlia.\n(slang, prostitute): By ellipsis of the euphemisms fille des rues (“girl of the streets”), fille de joie (“girl of joy”), fille publique (“public girl”), and others like them that signify \"prostitute\".\n","From Middle French, Old French guarder, from Frankish *wardon, from Proto-Germanic *ward-, corresponding to garde +‎ -er. Compare Italian guardare, Spanish guardar, English guard, ward.\n","From Middle French genner, from Old French gehisner, derivative of gehine (“torture resulting from confession, embarrassment”), of Frankish origin. Synchronically analysable as gêne +‎ -er.\n",null,"From Middle French mettre, from Old French metre, from Latin mittere, present active infinitive of mittō, probably from Proto-Indo-European *meyth₂-, *mith₂- (“to exchange, remove”).\n","From Old French, from Vulgar Latin *ungla, syncopated form of Latin ungula, from unguis, ultimately from Proto-Indo-European *h₃negʰ-.\n",null,null,null,null,"From Middle French, from Old French reguarder, corresponding to French re- +‎ garder.\n",null,"From Middle French lever, from Old French lever, from Latin levāre, present active infinitive of levō (“to elevate”), from levis (“light, not heavy”)",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Oroqen dərə.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Evenki ме̄ван (mēwan) and Oroqen mɛɣan.\n",null,null,"Borrowed from Mongolian мэдээ (medee), ultimately from Proto-Mongolic *mede-, compare Manchu ᠮᡝᡩᡝᡤᡝ (medege).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Old Irish barr (“top, tip, end; crop, produce”), from Proto-Celtic *barros (compare Middle Welsh barr), ultimately from Proto-Indo-European *bʰers-.\n",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"From Old Irish caithid; compare Gaulish cateia (“projectile”).\n",null,null,null,"From Old Irish cene; cognate with Welsh gynneu.\n",null,null,null,null,null,null,null,"From Old Irish cruinnigid (“to collect, gather, assemble”, verb); surface analysis cruinn (“gathered”, adjective) +‎ -igh (verbal suffix).\n",null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,"Possibly a borrowing from Middle English male or Anglo-Norman male, both meaning bag, from which the English mail and French malle are derived.\n","From Old Irish méit, mét (“greatness, magnitude, of size, quantity, number, extent, degree”).\n",null,"Borrowed from Middle English picken, from Proto-Germanic *pikōną.\n",null,null,"From Old Irish reithid (verb) and riuth (noun), from Proto-Celtic *reteti (verb) and *retus (noun) (compare Middle Welsh redec), from Proto-Indo-European *Hret-.\n","From Middle Irish sáithid, sáidid, from Old Irish sáidid (“thrust, fix”).\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)\nCompare salach (“dirty”).\n",null,null,"From earlier seasamh, seasaigh, seasmhaigh, denominative from the verbal noun seasamh, from Old Irish sessam, verbal noun of sissidir, from Proto-Celtic *sista-, from Proto-Indo-European *stísteh₂ti, reduplicated present of *steh₂-.\n",null,null,null,"From Middle Irish suidid, from Old Irish saidid, from Proto-Celtic *sedeti, from Proto-Indo-European *sed-",null,"From Old Irish do·icc. The imperative is from a related verb, do·airicc.\n",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"Back-formation from tógáil, from Middle Irish tócbáil, verbal noun of do·fócaib (“lifts up, raises”).\n",null,null,null,"Comparable to Phoenician 𐤀𐤃𐤌‎ (ʾdm, “man, earthling”), Ugaritic 𐎀𐎄𐎎 (ảdm, “man; red earth, red ochre”), Old South Arabian 𐩱𐩵𐩣‎ (“vassals, subjects”), Ge'ez ዶም (dom, “slave”), Akkadian 𒀀𒁕𒄠𒈬 (a-da-am-mu /adamu/, “blood”), Akkadian 𒀀𒁕𒈠𒌈 (a-da-ma-tum /adamātu/, “dark red earth or dye”), Akkadian 𒀀𒁕𒈬 (a-da-mu /adamu/, “a red garment”), Akkadian 𒀀𒁕𒈬 (a-da-mu /adamu/, “an important or noble person”). The meaning range points to these words being extensions from Proto-Semitic *dam- (“blood”), compare the Palestinian Aramaic forms of it אדם‎ / אידם‎ / ܐܕܡ‎ (ʾəḏem, “blood”). The meaning development could be any of\n“blood” → “red earth”, “red ochre” → “earthling” or\n“blood” → “man”, as blood is a main ingredient of humans or\n“blood” → “red earth”, “red ochre” → “the dye to paint idols” → hence “an idol” → “an effigy, a likeness” → “a man” or\n“blood” → “blood sacrifice to appease an idol” → hence “an idol” → “an effigy, a likeness” → “a man”,\ncompare Arabic دُمْيَة‎ (dumya, “statue, idol; effigy, likeness; doll, puppet”), دَمَّ‎ (damma, “to bedaub”).\n","Compare Ugaritic 𐎀𐎅𐎁 (ảhb).\n","From Proto-Semitic *ʾaḥad-. Compare  Arabic أحد‎ (ʾaḥad).\n","From the root א־ח־ז‎ ('-kh-z) in the pa'ál conjugation. From Proto-Semitic *ʾaḫað-. Cognate with Arabic أَخَذَ‎ (ʾaḵaḏa), Aramaic אחד‎, Maltese ħa.\n","From אחר‎ (akhár, “after”) + כך‎ (kakh, “such, thus”).\n","From Proto-Semitic *ʾš (“man, person”). Compare cognates in other Semitic languages (e.g. Moabite, Aramaic, etc.) ('šm in some).\n","From Proto-Semitic *ʾakal-. Compare Aramaic אֲכַל‎ (ʾăḵal), Arabic أَكَلَ‎ (ʾakala).\n",null,null,null,"From Proto-Semitic *ʾiṣbaʿ-. Compare Arabic إِصْبَع‎ (ʾiṣbaʿ), Aramaic אֶצְבְּעָא‎ (ʾeṣbəʿā), Classical Syriac ܨܒܥܐ‎ (ṣeḇʿā), Tigrinya ኣጻብዕ (ʾaṣabʿ), Coptic ⲧⲏⲃ (tēb), Ugaritic 𐎜𐎕𐎁𐎓 (ủṣbʿ), Egyptian ḏbꜥ.\n",null,null,"From Proto-Semitic *ʾanθ-at-. Cognate with Ugaritic 𐎀𐎘𐎚 (ảṯt), Aramaic אִנְתְּתָא‎ (ʾintəṯā), אִיתְּתָא‎ (ʾittəṯā), Arabic أُنْثَى‎ (ʾunṯā).\n","Related to Phoenician 𐤀𐤉𐤕‎ (ʾyt), Punic 𐤀𐤕‎ (ʾt), and Aramaic ית‎.\n",null,null,"Compare Arabic بقرة‎ (baqara, “cow”)","From בְּ־‎ (b'-, “in”) + שֶׁל‎ (shel, “of”).\n","From Proto-Semitic *gabr-, compare Aramaic גַּבְרָא‎ (gaḇrā, “man”), Ge'ez ገብር (gäbr, “servant”).\n",null,null,"Related to Ugaritic 𐎄𐎂 (dg), of unknown ultimate origin.\n","Compare Aramaic דְּרַךְ‎ (dəraḵ, “to tread”), Arabic أَدْرَكَ‎ (ʾadraka, “to reach, to overtake”).\n","From the root ב־ו־א‎ (b-v-').\n",null,null,null,null,null,null,"Related to Aramaic דִּי‎ (dī) and Arabic ذُو‎ (ḏū). Compare also the definite form הזה‎ (haze) and Arabic هٰذَا‎ (hāḏā).\n",null,null,"From Aramaic חד‎ above, which is cognate with Hebrew אֶחָד‎ (eẖád, “one”).\n","Related to Arabic حَدِيث‎ (ḥadīṯ) and Amharic አዲስ (ʾäddis).\n",null,"From Proto-Semitic *ḥalīb-.\n",null,"Compare Arabic حَمِيم‎ (ḥamīm, “hot”), Eblaite 𒉿𒈬𒌈 (à-mu-tum /ḥammū/, “hot”).\n","From the root ח־ש־ב‎ (ḥ-sh-b). Compare Arabic حَسَبَ‎ (ḥasaba, “to reckon, compute”), Egyptian ḥsb (“to calculate, to count”).\n",null,"Compare Arabic وَلَد‎ (walad, “child”), وَلَدَ‎ (walada, “to give birth”), Ge'ez ወልድ (wäld, “child”). \nAlso compare Proto-Indo-European *ǵelt- (“womb”) and its derivatives.\n","From Proto-Semitic *waqar- (“to be heavy or weighty; a tree laden with fruits; to be honorable or to hold weight in value”), from Proto-Afroasiatic *waqar-; compare Egyptian jqr (“excellent, worthy”) and Arabic وَقارْ‎ (waqār, “dignity, sobriety”).\n",null,"Compare Aramaic כֵּאבָא/כֵּיבָא‎ (kēḇā), Arabic كَئِبَ‎ (kaʾiba, “to be depressed, to be sad”).\n",null,null,"From the root כ־ס־ה‎ (k-s-h).\n","Compare Akkadian 𒆬𒌓 (kaspum).\n","From the root ל־מ־ד‎ (l-m-d), in the pa`ál conjugation.\n",null,null,"From Proto-Semitic *lišān-.\n",null,"From Aramaic מוּט‎ (mut, “to totter, stagger”)",null,"Compare Ge'ez መልአ (mälʾä, “to fill, to be full”).\n","Compare Arabic مَنَعَ‎ (manaʿa).\n",null,null,null,null,null,"Compare Classical Syriac ܢܬܢ‎ (nəṯan, “to give”). Possibly cognate with Arabic نَتَنَ‎ (natana, “to give off a foul smell, to stink”), which may have undergone semantic narrowing.\n",null,"Compare Aramaic סִפְרָא‎ (sip̄rā, “book”).\n",null,null,"From Proto-Semitic *ʿazab-. Cognate with Arabic عَزَبَ‎ (ʿazaba, “to be remote or absent”), Akkadian 𒋺 (TAG4 /ezēbu/, “to leave”)","From Proto-Semitic *ʿall-, *ʿaly- (“high; height, elevation”), from Proto-Afroasiatic *ʿal-, *ʿVl(ay)- (“to be high, tall; to rise; mountain”).\nRelated to Arabic عَلِيّ‎ (ʿaliyy, “to be high, exalted”) and Arabic عُلًى‎ (ʿulan, “to climb”).\n",null,"From Proto-Semitic *ʿṯn (“smoke”)","Compare with Egyptian pj (“this”).\n","Compare Aramaic פָּנָא‎ (pānā, “to face”).\n","Compare Arabic صَبَغَ‎ (ṣabaḡa, “to dye”), Aramaic צְבַע‎ (ṣəbaʿ, “to dip, to dye”), Akkadian 𒍝𒁍𒌑 (/ṣabû/, “to soak, to bathe”), Ge'ez ጸብኀ (ṣäbḫä, “to dip”).\n",null,null,null,null,null,null,"From the root ק־ר־ע‎ (q-r-ʿ), forming words relating to the concept of tearing apart.\n","From the root ק־שׁ־ר‎.\n",null,"From Proto-Semitic *raʾš-. Cognate with Arabic رَأْس‎ (raʾs).\n","From Proto-Semitic *rigl-. Compare Aramaic רִגְלָא‎ (riḡlā), Arabic رِجْل‎ (rijl, “foot, leg”).\n","From Proto-Semitic *rūḥ- (“to blow, breathe; spirit”). Cognate with Aramaic ܪܘܼܚܵܐ‎/רוּחָא‎ (rūḥā), Arabic رُوح‎ (rūḥ).\n",null,"Related to Arabic رَغِبَ‎ (raḡiba, “to desire”).\n",null,null,null,"From the root שׂ־ח־ה‎ (ś-ḥ-_).\n","From Proto-Semitic *šalām-.\n","From Proto-Semitic *šim-, from Proto-Afroasiatic *sim- (“name”). Cognate with Arabic اسم‎ (ism, “name”).\n","From Proto-Semitic *šamn-.\n",null,"From Proto-Semitic *šan-. Cognate with Arabic سَنَة‎ (sana).\n",null,null,"From the root ת־פ־ס‎ (t-p-s).\n",null,null,null,null,null,"Inherited from Sanskrit कल्य (kalya).\n",null,null,null,null,null,"गरम (garam) +‎ -ई (-ī).\n",null,null,"Inherited from Sauraseni Prakrit 𑀖𑀭 (ghara), from a metathesized form of Sanskrit गृह (gṛhá). Doublet of गृह (gŕh).\n",null,"Cognate with Nepali चढ्नु (caḍhnu).\n",null,null,null,"From छोड़ना (choṛnā, “to leave”) or छोरना (chornā, “to free”).\n",null,null,null,null,"From Proto-Indo-Aryan [Term?].\n","Compare Punjabi ਢੱਕਣਾ (ḍhakkaṇā), Assamese ঢকা (dhoka). Related to ढक्कन (ḍhakkan, “cap, cover, lid”).\n","Borrowed from Persian تخته‎ (taxte).\n",null,null,null,null,null,null,null,"Borrowed from Persian ناخن‎ (nâxon). Compare with Sanskrit नख (nakhá).\n",null,null,"Borrowed from Persian پنجه‎ (panje).\n",null,"From the oblique masculine form of पहला (pahlā, “first”).\n",null,null,null,null,"From पेट (peṭ, “stomach”). Mumbai sense borrowed from Marathi पेटी (peṭī, “chest, box”).\n",null,null,"From earlier बाजना (bājnā), from Sanskrit वाद्यते (vādyate). Compare Nepali बज्नु (bajnu), Gujarati વાગવું (vāgvũ), Marathi वाजणे (vāj̈ṇe), Assamese বজা (boza).\n",null,"From बात (bāt, “talking, discussion”).\n","बदल (badal) +‎ -ना (-nā). The first element in the word is from Arabic.\n",null,"Regular causative form of बनना (bannā). Compare Marathi बनवणे (banavṇe).\n",null,null,"Inherited from Ashokan Prakrit *𑀩𑁄𑀮𑁆𑀮𑁆 (*boll, “to speak, utter”); related to बोलना (bolnā, “to speak”).\n",null,"Inherited from Sauraseni Prakrit 𑀩𑁄𑀮𑁆𑀮𑀤𑀺 (bolladi), from Ashokan Prakrit *𑀩𑁄𑀮𑁆𑀮𑁆 (*boll, “to speak, utter”). Compare Bengali বলা (bôla), Assamese বোলা (büla), Marathi बोलणे (bolṇe), Punjabi ਬੋਲਣਾ (bolṇā). Also compare बुलाना (bulānā, “to call”).\nPerhaps further from Sanskrit *बूर्यते (būryate), a metathesized form of ब्रूयते (brūyate), from the root ब्रू (brū, “speak, say”).","From Ashokan Prakrit *𑀪𑀕𑁆𑀕𑀢𑀺 (*bhaggati), a verbal derivation from Sanskrit भग्न (bhagna, “broken, defeated, lost”), from the root भञ्ज् (bhañj). Cognate with Nepali भाग्नु (bhāgnu), Gujarati ભાગવું (bhāgvũ), as well as Punjabi ਭੱਜਣਾ (bhajjaṇā) from a different derivation.\n",null,null,"Inherited from Sauraseni Prakrit 𑀫𑀺𑀮𑀤𑀺 (miladi), from Sanskrit मिलति (milati). Cognate to Punjabi ਮਿਲਣਾ (milṇā), Nepali मिल्नु (milnu), Gujarati મળવું (maḷvũ), Assamese মিলা (mila),\nSylheti ꠝꠤꠟꠣ (mila), Bengali মিশা (miśa), and Marathi मिळणे (miḷṇe).\n",null,null,null,null,null,"Cognate with Nepali रोक्नु (roknu).\n","Inherited from Sanskrit शटति (śaṭati). Cognate with Punjabi ਸੜਨਾ (saṛnā) / سَڑنا‎ (saṛnā), Gujarati સડવું (saḍvũ), Marathi सडणे (saḍṇe), Sindhi سَڙَڻُ‎ / सड़णु, Assamese সৰা (xora).\n","Learned borrowing from Sanskrit समाचार (samācāra, “proceeding, conduct, news, information”).\n","Borrowed from Sanskrit सुन्दर (sundara).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"az (“that”) +‎ -kor (“time, at the time of”)","From Proto-Finno-Ugric *oŋlɜ (“chin, jaw-bone”).",null,null,null,"Of unknown origin.","Borrowed from a Slavic language, from Proto-Slavic *činiti.","Of uncertain origin, perhaps from Proto-Finno-Ugric *ćuća (“point, peak”).","Borrowing from an Oghur language, before the times of the Hungarian conquest of the Carpathian Basin (at the turn of the 9th and 10th centuries), from Proto-Turkic *düĺ (“noon”). Compare Tuvan дүш (düş, “noon”), dialectal Turkish düş (“noon”).\n","Borrowed from a Slavic language, perhaps from Serbo-Croatian. Compare Serbo-Croatian dug (“debt”), Slovak dlh (“debt”).","Borrowed from a South Slavic or a West Slavic language. Compare Serbo-Croatian, Slovene drag; Czech, Slovak drahý; Polish drogi (“expensive, dear”), from Proto-Slavic *dorgъ. Hungarian most likely borrowed the feminine form of the Slavic adjective.","Probably from Proto-Finno-Ugric *säŋe (“air”). Possible cognates are limited to Baltic-Finnic (e.g. Finnish sää (“weather”)) and Komi-Permyak сынӧд (synöd, “warm air”).","egyszer +‎ -re",null,"el- +‎ rejt","el- +‎ tör","From a Turkic language before the times of the Hungarian conquest of the Carpathian Basin at the turn of the 9th and 10th centuries.","From Proto-Uralic *ećɜ- (“to fall”) + -ik.",null,null,null,null,null,"[after 1372] Of uncertain origin. Perhaps from Proto-Finno-Ugric *pëčɜ- (“color; to color, paint”) + -t (causative suffix).","From the original stem fi akin to Proto-Uralic *pojka (“son, boy”) + -ú (“archaic diminutive suffix”). Cognates include Mansi пыг (pyg, “son, boy”), Udmurt пи (pi, “son, boy”), Komi-Zyrian пи (pi, “son, boy”) and Finnish poika. See also faj. Unrelated to Romanian fiu.\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"Of uncertain origin, perhaps a derivation. One explanation is that it is from föl (“the upper part of something”) +‎ -d (nominal suffix, originally diminutive suffix). For similar derivation, compare gyenge (“weak”) > gyengéd (“gentle”).","[after 1372] Of uncertain origin. Perhaps from Proto-Uralic *pürke- (*pᴕrγɜ-) (“to turn, revolve, spin”) + -dít (causative suffix).","From a stem of unknown origin + -jt (causative suffix).","From Proto-Ugric *kajɜ- (“to bend, stoop”) + -t (causative suffix).","From Proto-Uralic *kala. Cognates include Khanty and Mansi хул (hul), Finnish and Estonian kala.","From the coincidence of the Proto-Uralic *kontale- (compare Old Hungarian hadl (“hear”), Mansi хӯнтли (hūntli), Finnish kuunnella) and Proto-Uralic *kule- (compare Mansi хӯлуӈкве (hūluňkve) and Finnish kuulla).\n","From an unattested stem with the suffix -g.\n","Of unknown origin.","From Proto-Ugric *säptɜ (“seven”), borrowed from an Indo-European language (Proto-Indo-European *septḿ̥); compare Sanskrit सप्तन् (saptán), Ancient Greek ἑπτά (heptá). Initial h- is by analogy with hat (“six”). Compare Mansi са̄т (sāt, “seven”).\n","Native development. Probably from a stem of unknown origin + -d (frequentative suffix) + -eg (nominal-forming suffix). For the ending, compare beteg (“ill”), meleg (“warm”).","Of uncertain origin. Perhaps from Proto-Uralic *kaŋe- (“to call”).",null,"Probably borrowed from a Chuvash-type Turkic language before the times of the Hungarian conquest of the Carpathian Basin (at the turn of the 9th and 10th centuries), ultimately from Proto-Turkic *öd (“time”) and cognates with Karakhanid اُذْ‎ (öδ, “time”), Southern Altai ӧй (öy, “time”), Turkish öğle (“noon”).\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Proto-Finno-Ugric *jorɜ (“roll”).\n","Probably an onomatopoeia.","From Proto-Uralic *künče (“fingernail, toenail”) + -m (nominal suffix).",null,"From a stem of unknown origin + -ik.","Possibly from Proto-Uralic *luwe (“bone”) + the suffix -b, used in an unusual diminutive function. Compare Northern Mansi лу (lu) and Finnish luu.\nAlternately, from Proto-Uralic *lümpe (“blade, flat part, width (of hand or foot)”), akin to Selkup [script needed] (laamp).\n","A variant form of leány.",null,"Of uncertain origin. Either derived from the same supposed stem as lebeg (“to float”); or from Proto-Ugric or perhaps Proto-Finno-Ugric *lᴕ̈pɜ, *lepɜ (“leaf”). The meaning “letter” is attested from the 14th century onwards.",null,"meg- +‎ gyújt","meg- +‎ javít","meg- +‎ kap","meg- +‎ néz",null,null,"From Proto-Uralic *me.\n","Of unknown origin.",null,"From Proto-Uralic *niŋä (“woman”). Cognates include Mansi нэ̄ (nè̄, “woman”).","From the növ- stem of nő (“to grow”) +‎ -ekszik.\n","From Proto-Finno-Ugric *ńälmä (“tongue”). Cognates include Mansi не̄лум (nēlum, “tongue”) and Northern Sami njálbmi.\n",null,"From Proto-Finno-Ugric *sula (“to molten, melted; melt, dissolve”) + -ad (“frequentative-instantaneous suffix”). Cognates include Mansi толуӈкве (toluňkve) and Finnish sulaa.","Of uncertain origin. Either from a Chuvash-type Turkic language or derived from őr.",null,null,"An onomatopoeia.",null,"From the old onomatopoeic verbal stem sar- + -ok (noun-forming suffix).","Perhaps from Proto-Finno-Ugric *čijɜ- (“to run”) + -t (instantaneous verb-forming suffix).","Probably from Proto-Finno-Ugric *čiγɜ-rɜ (“grave”).",null,"From a stem of unknown origin + -ed (frequentative verb-forming suffix).","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","Of uncertain origin. Perhaps from Proto-Finno-Ugric *śentä- (“to tear down, rip, break off”).",null,"From Proto-Uralic *śilmä, then from szimi, via szüm in one dialect (such as the one used in the Old Hungarian Lamentations of Mary), resulting in dialectal szöm, as well as via szëm and the current, standard szem from another dialect.","From the same stem as the noun szerelem (“romantic love”) +‎ -et (momentane verb-forming suffix). The stem szer comes from the verbal application of Proto-Uralic *śerɜ (“row, order”) nounverb with the meaning ‘to join; to be linked / related to each other’.","From Proto-Uralic *tole- + -ál (frequentative suffix). Cognates include Finnish tulla.","From Proto-Uralic *tuna- (“to get used to, to learn”) + -ít (causative suffix).","From Proto-Finno-Ugric *teke-. Cognates include Finnish tehdä and Estonian tegema.","From the same Proto-Uralic root *tumte- (“to know”) as Finnish tuntea and Estonian tundma.\n","From Proto-Uralic *suwďa (“finger”). Cognates include Mansi туля (tulâ).\n","Of unknown origin.","From East Proto-Uralic *uktï (“trace”) or *uxtï (“trace”), Proto-Uralic *utka. Cognate with Tundra Nenets ӈуˮ (ŋù') or ӈут (“trace, way”).","From Proto-Ugric *waŋke- (“to strike, cut”) or perhaps from Proto-Finno-Ugric *waŋɜ (“to strike, cut”).",null,"From Proto-Finno-Ugric *wäntɜ- (“to see, look at, watch”).","Of uncertain origin, possibly from Proto-Finno-Ugric *wiŋi (“end”). Cognate to Finnish viime and Estonian viimane.","From Proto-Finno-Ugric *wekkɜ (“thin”) + -ny.","From earlier *vewə- (compare vevő ‘buying’, vett ‘he bought’), from Proto-Uralic *wexe- (“to take”). Often considered a doublet of visz (“to carry”), but this may not be correct.\n","From Proto-Finno-Ugric *wetä- (“to lead, to guide, to draw, to pull”) + -t (causative suffix). Cognates include Finnish vetää. The Finno-Ugric root may be related to Proto-Indo-European *wedʰ-, either as loan or through genetic relationship.",null,"From the same onomatopoeic (sound-imitative) root as zúdít (“to pour”) and zúdul (“to come pouring, rushing”) + -g (“frequentative suffix”).","From Old Armenian անկիւն (ankiwn).\n","From Old Armenian աշխատանք (ašxatankʿ); see below.\n","From Old Armenian ապա (apa).\n","From Old Armenian առաջ (aṙaǰ).\n",null,"From Old Armenian ափն (apʿn).\n","From Old Armenian բան (ban); see it for more. The main meaning of բան (ban) in Old Armenian was \"word, speech, saying\". The sense \"thing\", which is the only one surviving in modern Armenian, developed from the notion of speech → the subject of speech → the subject itself. Typologically compare Hebrew דבר‎ (davar, “word, speech; thing”).\n","From Old Armenian բարձրանամ (barjranam).\n","From Old Armenian բարձրացուցանեմ (barjracʿucʿanem).\n","From Old Armenian բռնեմ (bṙnem).\n","From Old Armenian գիծ (gic).\n","From Old Armenian գործ (gorc).\n","From Old Armenian դնեմ (dnem).\n","From Old Armenian երեւել (erewel), infinitive of երեւիմ (erewim); see it for more.\n",null,"From Old Armenian ընթանալ (əntʿanal), infinitive of ընթանամ (əntʿanam); see it for more.\n","From Old Armenian անկանիմ (ankanim).\n","From Old Armenian թեւ (tʿew).\n","From Old Armenian լեզու (lezu).\n","From Old Armenian խաբեմ (xabem).\n","From Old Armenian խելք (xelkʿ); see below.\n","From Old Armenian խոտ (xot).\n","From Old Armenian ծածկեմ (cackem).\n","ծով (cov) +‎ ափ (apʿ)","From Old Armenian կանգնեմ (kangnem).\n","From Old Armenian կեղեւ (kełew).\n","From Old Armenian կենդանի (kendani).\n","From Old Armenian կերակուր (kerakur); see it for more.\n","From Middle Armenian կտոր (ktor), from Old Armenian կոտոր (kotor). Doublet of կոտոր (kotor).\n","From Old Armenian յետոյ (yetoy)","Learned borrowing from Old Armenian հոսիմ (hosim).\n","From Old Armenian ղեկավարեմ (łekavarem).\n","Learned borrowing from Old Armenian ճահիճ (čahič).\n","From Old Armenian ճիւղ (čiwł).\n",null,"From Old Armenian մարդ (mard).\n","From Old Armenian մարտ (mart).\n","From Old Armenian մտանեմ (mtanem).\n","From Old Armenian նստել (nstel), infinitive of նստիմ (nstim); see it for more.\n","From Old Armenian շաբաթ (šabatʿ).\n","From Old Armenian պաշտպանեմ (paštpanem).\n","From Old Armenian պատկեր (patker).\n",null,"From Old Armenian սպասեմ (spasem), from սպաս (spas).\n","From Old Armenian վառեմ (vaṙem).\n",null,"From Old Armenian վճարեմ (včarem).\n","From Middle Armenian տոպրակ (toprak), a Turkic borrowing. Compare Tatar тубра (tubra), Turkish torba. Russian то́рба (tórba) is from the same source.\n","From Old Armenian տուն (tun).\n","From Old Armenian ցամաք (cʿamakʿ).\n","From Old Armenian փայտ (pʿayt); see it for more.\n","From Old Armenian փոկ (pʿok); see it for more.\n","From Old Armenian քանակ (kʿanak); see it for more.\n","From Old Armenian քաշել (kʿašel).\n",null,null,null,null,null,null,null,null,null,null,"From Old Norse hóll.\n","From Old Norse horn, from Proto-Norse ᚺᛟᚱᚾᚨ (horna), from Proto-Germanic *hurną, from Proto-Indo-European *ḱer-.\n","From Old Norse hreinsa, from Proto-Germanic *hrainisōną.\n",null,null,"From Old Norse láta",null,null,null,null,"From ótti (“fear”).\n",null,"From Old Norse rœða","From Old Norse rotna, from Proto-Germanic *rutāną.\n",null,null,null,null,null,null,null,null,null,"From Old Norse vinna.\n",null,null,"From chiappare, from Vulgar Latin *clapāre, from Late Latin capulāre.\n","From a (“to”) +‎ fare (“do”), probably based on the model of French affaire.\n","From Vulgar Latin *adferrāre, from ferrum (“iron, sword”).\n","From suppletion of Latin vādere (forms beginning with 'v') and either Vulgar Latin *and(i)tāre, from *ambitāre, frequentative of Latin ambīre or aditāre, frequentative of adīre, or alternatively possibly from *amnāre, alteration of earlier *amlāre, a proto-Romance or Vulgar Latin variant of ambulāre, or from Vulgar Latin adnāre (in view of Occitan anar, never *andar). Compare Spanish andar, Sicilian annari, Venetian ndar; cf. also French aller, Catalan anar, Friulian lâ","Replaced s- of staccare by a-.\n",null,"From a Vulgar Latin *brusiāre, itself of uncertain origin; possibly from a form *p'rustiare < *per-ust(u)lāre, from Latin per + ustulāre (compare perurere), or alternatively from a corruption of *combustulāre, from a change of prefix of ambustulāre, influenced by combustus; see ambūrēre. However, an Italian word brustolare (cf. abbrustolire), from a related root *brustulāre, from ustulāre, also exists. The initial br- may also be of Germanic origin. Compare French brûler (Old French brusler), Dalmatian brusur, Occitan bruslar, buizar, Romansch brischar.\n",null,"From Vulgar Latin or Late Latin cambiāre, from change in conjugation of cambīre, present active infinitive of cambiō, from Gaulish cambion (“change”), from Proto-Celtic *kambos (“twisted, crooked”), from Proto-Indo-European *kh₂em- (“to bend, curve”).  Cognate to Greek κάμπτω (kámpto), Portuguese cambiar,  Spanish cambiar, Occitan cambiar, Catalan canviar, Norman changier, Sicilian cangiari, French changer, and English change. Doublet of cangiare via Old French cangier.\n",null,"From Latin ecce + hoc.",null,null,null,null,null,"From Latin distantia.\n",null,null,null,null,null,null,null,"From Vulgar Latin *īnsemel, which is a combination of Latin īnsimul and semel. See also French ensemble and Neapolitan nzieme.\n",null,null,"Evolution of Latin ōscillāri, ōscillātus, ōscillātiōnem.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Chukotko-Kamchatkan *kukæ. Compare also Chukchi кукэӈы, Koryak кукэӈэ and Alutor кукаӈа.\n",null,null,null,null,null,null,"From Proto-Chukotko-Kamchatkan *ðəlɣə (“finger”). Compare Chukchi рылгылгын (rəlɣəlɣən).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"⟨ipe1⟩ → */ipʲe/ → /iɸe/ → /iwe/ → /ie/From Old Japanese.\nPossibly related to 廬 (iho → io, “temporary hut”).\n",null,null,"From classical 悪ろし (waroshi).\n",null,null,null,null,null,null,"From Middle Chinese 棒 (MC bˠʌŋX). The goon pronunciation, so likely an earlier borrowing.\n",null,null,null,null,null,null,"From Old Japanese.  Appears in the Kojiki of 712 CE, and in the Man'yōshū completed some time after 759 CE.",null,"From Old Japanese, in turn from Proto-Japonic *tumay.  The standalone form of tsuma below.  Likely derived as a fusion of tsuma + emphatic nominalizing particle い (i), similar to the phonetic development of 目 (me, from ma + i) or 神 (kami, from kamu + i).\n",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,"From Old Japanese, from Proto-Japonic *eku. Cognate with Okinawan 行ちゅん (いちゅん, ichun), Miyako 行きぃ (いきぃ, iksï).\n",null,"Compound of 裏 (ura, “back side, inside, far side”) +‎ 返す (kaesu, “to flip over, to turn over”). The kaesu changes to gaesu as an instance of rendaku (連濁).\n","/opu pu/ → /opopu/ → /ofofu/ → */owou/ → /oːu/From the Old Japanese verb 覆ふ (opu, “cover from above”) + ふ (-fu, auxillary verb modifier).","From Proto-Japonic *miru. Cognate with 目 (me, “eye”).\n",null,null,null,null,null,null,null,null,null,"*/ʔiəm/ → /əmʉ/ → /omʉ/ → /oɴ/From Middle Chinese 音 (MC ʔˠiɪm).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,"From Proto-Inuit *qiʁnǝ-ʁ- (“black, dark”), from Proto-Eskimo *qiʁnǝ-ʁ- (“black, dark”).\n",null,null,null,null,null,null,null,null,null,null,"From Proto-Inuit *tǝɣu- (“to take”), from Proto-Eskimo *tǝɣu- (“to take”). Compare Inupiaq tigusi-.\n",null,"From Proto-Inuit *tǝŋǝ- (“fly up, be flying”), from Proto-Eskimo *tǝŋǝ- (“to fly up”).\n",null,"From Proto-Inuit *ǝvvaʁ- (“take a bath, wash”).\n",null,null,null,null,null,null,null,"From Proto-Dravidian *amma",null,null,null,null,null,null,null,null,null,null,"From Proto-Dravidian *ēr̤u. Cognates include Tamil ஏழு (ēḻu).\n",null,null,null,null,null,"From Old Kannada ಕರೆ (kare).\n",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,"Borrowed from Sanskrit दीर्घ (dīrgha, “long”).\n",null,null,null,null,null,null,null,null,null,"Borrowed from Sanskrit बल (bala).\n",null,null,null,"Borrowed from Sanskrit भूमि (bhūmi).\n",null,null,"Cognate with Tamil மாட்டு (māṭṭu), Telugu మాట (māṭa).\n",null,null,null,null,null,null,null,null,null,"Borrowed from Sanskrit हिम (hima).\n",null,null,null,null,null,null,null,null,null,null,null,null,"From Old Georgian დაჲ (day), from Proto-Kartvelian *da-. Cognate with Mingrelian და (da), Laz და (da) and Svan დაჲ (day), დაჩუირ (dačuir), უდილ (udil). Svan დაჲ (day) might be borrowed from Georgian rather than inherited from Proto-Kartvelian.\n",null,null,null,null,null,"From Old Georgian ენაჲ (enay), from Proto-Kartvelian *nen-. Cognate with Svan ნინ (nin), Mingrelian ნინა (nina) and Laz ნენა (nena).\n",null,null,null,"From Old Georgian კჳრაჲ (ḳwiray), კჳრიაკჱ (ḳwiriaḳē), from Koine Greek Κυριακή (Kuriakḗ, “Sunday”).\n",null,null,null,null,null,null,null,null,"From Old Georgian საქმჱ (sakmē), საქმეჲ (sakmey), most probably from იქმს (ikms).\n","From Old Georgian სიტყუაჲ (siṭq̇uay), from Proto-Georgian-Zan *ṭq̇w-. Cognate with Mingrelian ზიტყვა (ziṭq̇va).\n",null,"From Hittite [script needed] (šuppi, “clean”). Most likely a Proto-Kartvelian borrowing during the late, Proto-Karto-Zan stage of development (XIX-VIII centuries BC).(Can this(+) etymology be sourced?)On the other hand, according to Ačaṙean, borrowed from Iranian from a word in the family of Persian سفید‎ (safid, “white”).\n",null,"Related to Old Armenian տաղախ (tałax, “mortar”), Laz ტოლოფი (ṭolopi, “mud”).\n","From Old Georgian ტანი (ṭani), probably borrowed from Persian تن‎ (tan, “body”). Compare Old Georgian ვახტანგ (vaxṭang).\n","From Old Georgian ტყავი (ṭq̇avi), from Proto-Georgian-Zan *ṭq̇aw-. Cognate with Mingrelian ტყები (ṭq̇ebi), Laz ტკები (ṭḳebi), ტები (ṭebi).\n",null,null,"From Old Georgian [Term?], from Proto-Kartvelian *prcx- (“fingernail; to scratch”).\n",null,"From Old Georgian ყელი (q̇eli), from Proto-Kartvelian *q̇el-. Cognate with Mingrelian ყალი (q̇ali), ჸალი (ʾali) and Laz ყალი (q̇ali), ალი (ali). The word is also preserved in Svan mə-q̇l-a (mə-q̇l-a).",null,null,null,null,null,null,null,null,null,"From Old Georgian ხე (xe); see below for more.\n","From Old Georgian ჴმაჲ (qmay), from Proto-Georgian-Zan *qam-, *qm-. Cognate with Mingrelian ხუმა (xuma). For the political sense, compare Russian голос (golos).\n",null,"From Proto-Turkic *ïgač.\n","From Proto-Turkic *āń(k) (“moon, month”). Cognate with Azerbaijani ay, Turkish, Crimean Tatar ay, Tatar, Bashkir, Kyrgyz ай (ay), Southern Altai ай (ay), Uzbek oy, etc.\n",null,"Cognate to Azerbaijani alov and Turkish alev.\n",null,null,null,null,null,null,null,"From Proto-Turkic *agrɨ-g (“pain, illness”), an action noun of *agrɨ- (“to ache; be ill”).\nCognate with\nKarakhanid اَغْرِغْ‎ (aɣrïɣ, “pain”),\nOld Uyghur ՚՚q̈ryq (aɣrïɣ, “pain, illness”), Kyrgyz оору (ooru), Southern Altai оору (ooru),\nUzbek ogʻriq (“pain, ilness”),\nUyghur ئاغرىق‎ (aghriq, “illness”),\nKhakas ағырығ (ağırığ, “illness; ill”),\nTuvan аарыг (aarıg, “illness, pain”),\nYakut ыарыы (ıarıı, “pain, disease”),\nTurkish ağrı (“pain, ache”), etc.\n","From Proto-Turkic *adak (“foot, end”).\n","Borrowed from Persian هنگامه‎ (hangâme). Cognate with Bashkir әңгәмә (äñgämä), Kyrgyz аңгеме (añgeme), Uzbek hangama (“id.”), etc.\n",null,null,null,null,"From Proto-Turkic *bar- (“to walk, go; to come, reach”). Cognate with Turkish varmak.\n","From Common Kypchak bawïr, from Proto-Turkic *biagɨr (“liver”). Cognate with Old Uyghur baγarsuq (“intestines, viscera”), Turkish bağırsak (“intestine”), etc.\n",null,null,null,null,"Cognate with Tatar тавыш (tawış),\nBashkir тауыш (tawïš),\nKarakalpak даўыс (dawıs),\nKarachay-Balkar таууш (tauuş),\nKyrgyz тоош (tooş),\nUzbek tovush,\nUyghur تاۋۇش‎ (tawush),\nCrimean Tatar davuş,\nKhakas табыс (tabıs, “voice, sound”).\n","From Proto-Turkic *de- (“to say”). Cognate with Azerbaijani demək, Turkish demek.\n","Cognate with Azerbaijani eşitmək, Uzbek eshitmoq.\n",null,"Ultimately from Proto-Turkic *yạŕ- (“to write”). Cognate with Azerbaijani yazmaq, Uzbek yozmoq, etc.\n",null,null,"From Proto-Turkic *yaŋï, *yeŋi (“new”).\n",null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Azerbaijani gülmək, Uzbek kulmoq.\n","From Proto-Turkic *gün (“sun, day”).\n",null,null,null,"From Common Turkic *kač- (“to run away, flee”).\n",null,"From Proto-Turkic *Kol.\n",null,null,"From Proto-Turkic *okï-.\n",null,null,"From Proto-Turkic *ol-tur- (“to sit”).\n","Cognate with Azerbaijani oyanmaq, Uzbek uygʻonmoq.\n","Cognate with Azerbaijani ölmək, Uzbek oʻlmoq.\n",null,"From Proto-Turkic *siaŕ (“swamp, marsh”).\nCognate with\nBashkir һаҙ (hað), Kyrgyz, Tatar саз (saz),\nUzbek soz,\nSouthern Altai, Khakas сас (sas, “swamp, marsh”);\nChuvash шур (šur, “swamp, marsh”),\netc.\n","From Proto-Turkic *sạk (“aware, alert”).\n",null,null,"From Proto-Turkic *sōl (“left”).\n",null,"From Proto-Turkic *söŕ.\n",null,"From Common Kipchak *süy-, from Proto-Turkic *seb- (“to love”). Cognate with Turkish sev-, etc.\n",null,null,null,null,"Ultimately from Proto-Turkic *dart- (“to pull; to hang”). Cognate with Azerbaijani dartmaq.\n",null,null,"From Proto-Turkic *dil (“tongue; language”).\nCognate with\nTatar тел (tel),\nBashkir тел (tel),\nKyrgyz тил (til),\nUzbek til,\nTurkish dil (“tongue, language”).\n",null,null,"From a Mongolic source, from Proto-Mongolic *töle- (“to pay”).\nCognate with\nOld Uyghur [script needed] (tölä-, “to pay”);\nBashkir түләү (tüläw), Kyrgyz төлөө (tölöö), Uzbek toʻlamoq, Uyghur تۆلىمەك‎‎ (tölimek‎),\nKhakas тӧле- (tӧle-), Tuvan төлээр (töleer, “to pay”).\n",null,"From Proto-Turkic *dur- (“to stand”). Cognate with Turkish durmak, Turkmen durmak, Crimean Tatar turmak, Uzbek turmoq, Uyghur تۇرماق‎ (turmaq), Azerbaijani durmaq, Tatar turu, Chuvash тӑр (tăr), etc.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *iak- (“to flow”). Related to Turkish akmak.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *küje.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Permic *śoj (compare Komi-Permyak and Komi-Zyrian сёй (sjoj)), from Proto-Uralic *śajwa.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Mongolic *ayu-, with assimilation found in most modern languages.\nCompare Dongxiang ayi, (perhaps somehow related) Old Turkic [script needed] (ayïn-, “to fear”).\n",null,null,null,null,"From Proto-Mongolic *arasun, with unexplained palatalization. Compare Dongxiang arasun (“skin, husk”).\n",null,"From Proto-Mongolic *barï-, compare Dongxiang barei.\n",null,"From Classical Mongolian ᠪᠠᠶ᠋ᠠᠯᠢᠭ (bay᠋alig), from Middle Mongolian [Term?]; equivalent to бая- (baja-) +‎ -лаг (-lag). Cognate with Buryat баялиг (bajalig), Kalmyk байлг (baylg), etc.\n","From Classical Mongolian ᠪᠡᠶ᠌᠎ᠡ᠋ (bey᠌-e᠋), from Middle Mongolian [Term?], from Proto-Mongolic *beje. Cognate with Buryat бэе (beje), Kalmyk бий (biy), etc. Compare also Yakut бэйэ (beye, “body; self”), Manchu ᠪᡝᠶᡝ (beye, “body”), Evenki бэе (bəje, “body; person”), etc.\n","From Proto-Mongolic *bol- (“to become”). Akin to Proto-Turkic *bōl- (“to become”), compare Turkmen bōlmak (“to become”), Turkish olmak (“to become, happen”).\n","From Proto-Mongolic *boxa-, from Proto-Turkic *bog-.\nCompare East Yugur puu, Turkish boğmak.\n","From Proto-Mongolic *bos-, compare Dongxiang bosi.\n","From Proto-Mongolic *budaxan, perhaps related to Proto-Turkic *botka (“gruel”).\nCompare Dongxiang budan, Bashkir бутҡа (butqa), Chuvash пӑтӑ (pătă).\n",null,null,null,"From Proto-Mongolic *gar, commonly connected with Proto-Turkic *kar, *karɨ (“forearm”) or Proto-Tungusic *gara (“branch, bough”).\nCompare Dongxiang kha, Daur gary, Kazakh қар (qar), Tuvan кыры (kırı, “ulna”), Evenki гара (gara), Manchu ᡤᠠᡵᡤᠠᠨ (gargan).\n",null,"Compare Buryat гэр (ger), Kalmyk гер (ger).\n",null,null,null,null,"From Proto-Mongolic *daxula-, compare Dongxiang daola.\nEquivalent to дуу (duu, “song, voice”) +‎ -лах (-lah).\n",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","See Chinese 站 (zhàn, “(post) station”).\n","From Proto-Mongolic *jasa-, compare Mongghul sza (“make, repair”).\nTurkic forms of the word (see Turkish yasamak) are considered Mongolisms, relation with Manchu ᡩᠠᠰᠠᠮᠪᡳ (dasambi, “to govern”), if any, is unclear.\n",null,"Attested once in a 1338 Middle Mongolian document as ᠵᠣᠭᠰᠤᠭᠤᠯᠪᠠᠰᠤ (ǰoɣsuɣulbasu, “(if he) let (them) stop”), but otherwise restricted to modern Central Mongolic.\nCognate with Buryat зогсохо (zogsoxo), Kalmyk зогсх (zogsx).\nReplaced Proto-Mongolic *baï- in the sense 'to stand', see байх (bajh, “to be”).\n","Proto-Mongolic *jaxu-, compare Dongxiang zhao.\n",null,null,"From Classical Mongolian ᠮᠣᠳᠤ (modu), from Middle Mongolian [Term?], Proto-Mongolic *modu. Cognate with Buryat модо- (modo-), Kalmyk мод- (mod-), Dongxiang mutun, etc.\n","From Proto-Mongolic *meŋgün, compare Dongxiang miengu.\nPerhaps related to Western Yugur menek (“money”), Arghu بَنَكْ‎ (benek, “small copper coin”) identified by Clauson with Common Turkic *benek (“spot, speck, freckle”) from Persian بنک‎ (banak, “seed, pimple”)  (perhaps influenced by *beŋ (“birthmark”)). See Turkish benek.\n","From Proto-Mongolic *möre (“shoulder”), perhaps related further with Proto-Tungusic *muire.\nCompare Daur mur, Evenki мирэ (mirə), Nanai нгуйрэ.\n",null,"Inherited from Proto-Mongolic *narïn, compare Dongxiang narun, Daur naring.\n",null,"From Proto-Mongolic *nökör, compare Dongxiang nokie.\n",null,null,"From Proto-Mongolic *nigen, *niken.\n",null,null,null,"From Proto-Mongolic *ökin (“daughter”). Compare Buryat үхин (üxin) and Dongxiang ojin.\n","From Proto-Mongolic *ebed-, compare Mogholi ebetku.\n","From Proto-Mongolic *ebesün, compare Dongxiang osun.\n","From Proto-Mongolic *ög-. Cognate to Dongxiang ogi and perhaps Khitan [Khitan Small needed] (û).\n",null,null,null,null,null,"From Proto-Mongolic *sabar, compare Mongghul sawar.\n",null,"From Proto-Mongolic *sara more distantly related to Khitan 賽咿児 (sair)",null,"From Proto-Mongolic *saxu-, compare Dongxiang sao, Daur saugw.\n","Ultimately from Proto-Turkic *sürüg (“flock, herd”), equivalent to *sür- (“to drive”) +‎ *-g. Compare Turkish sürü.\n","From Proto-Mongolic *talbï- (“to free”), compare Daur taly-.\nThe evolution of senses from “to release” > “to place” is shared with Chinese 放 (fàng).\n",null,"From Proto-Mongolic *toguxan, compare Dongxiang tughon.\n",null,null,"From Proto-Mongolic *töle-, compare East Yugur tölö.\n","From Proto-Mongolic *texü-, compare Dongxiang qiao.\n",null,"From Proto-Mongolic *teŋgeri, from Proto-Turkic *teŋri, compare Old Turkic 𐱅𐰭𐰼𐰃‎ (teŋri, “sky”).\n","From Classical Mongolian ᠲᠡᠷ᠎ᠡ᠋ (ter-e᠋, “that”), from Middle Mongolian ᠲᠡᠷᠡ (tere) and ᠲᠡᠷ᠎ᠡ᠋ (ter-e᠋, “that”), from Proto-Mongolic *tere (“that”). Cognate with Buryat тэрэ (tere, “that”), Kalmyk тер (ter, “that; he, she, it”), Dongxiang tere, etc.\nReplaced original ᠢ (i, compare Daur ing) for sense ‘he, she, it’ as the third-person singular pronoun.\n","From Classical Mongolian ᠤᠯᠤᠰ᠋ (ulus᠋), from Middle Mongolian ᠤᠯᠤᠰ᠋ (ulus᠋), from Common Turkic *uluš (“country; city”). Compare Buryat улас (ulas), Kalmyk улс (uls); Old Uyghur 'wlwš (uluš, “country”); etc.\n",null,"From Proto-Mongolic *urtu, compare East Yugur hurtu, Daur ort.\n","From Proto-Mongolic *hüjüxür, compare Dongxiang uzhu, Daur xujuur.\n","From Proto-Mongolic *ünen, compare Daur unung.\n",null,"хаах (haah, “to close, to block”) +‎ -лга (-lga)",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"Cognate with Buryat хаяха (xajaxa) and Kalmyk хайх (xayx). Not found outside Central Mongolic.\n",null,null,"From Proto-Mongolic *koxalaï (“throat”).\n","From Proto-Mongolic *ködel-, compare Mongghul ghudili, Dongxiang gojielu.\n","From Proto-Mongolic *köl, perhaps related with Proto-Turkic *kol (“arm”).\nCompare Dongxiang kon, Turkish kol.\n","from Proto-Mongolic, borrowed or cognate with Proto-Turkic *kȫk, compare with Turkish gök and Evenki куку (kuku, “sea-coloured”).\n","From Proto-Mongolic *kïmusun, compare Dongxiang ghimusun (“nail, hoof”).\n","From Proto-Mongolic *kuruxun, compare Dongxiang ghurun.\n","From Proto-Mongolic *küjüxün, compare Dongxiang ghuzhun, Daur xujuu.\n",null,null,"Cognate with Buryat хүлеэхэ (xüljeexe), Kalmyk күләх (küläx).\n","From Proto-Mongolic *kürje(g), from Proto-Turkic *küre-ček.\nCompare Mangghuer kuerji, Turkish kürek.\n","From Proto-Mongolic *köw.\n","From Proto-Mongolic *kelen, compare Dongxiang kielien.\n",null,"From *kele-, a haplological variant of Proto-Mongolic *kelele-, equivalent to хэл (hel, “tongue, language”) +‎ -лэх (-leh).\nCompare Dongxiang kielie.\n","From Proto-Turkic *käräk (“necessity”), from earlier *kärgäk. \nSome senses might be from *хэрэх (*hereh) +‎ -г (-g), with unattested *хэрэх (*hereh) being also the root of хэрүүл (herüül, “quarrel”) and хэрэлдэх (hereldeh, “to quarrel”).\n",null,"From Proto-Mongolic *cagaxan, compare Dongxiang chighan.\n","From Proto-Mongolic *cokï- (“to peck”), from Proto-Turkic *čok- (“to swoop down on, to peck”). Evolution of sense to more general to hit is shared with other Central Mongolic languages and Daur.\nCompare Dongxiang chughu, Kazakh шоқу (şoqw).\n","From Proto-Mongolic *cexeji, compare Mogholi caiji.\n","From Tibetan ཤེལ (shel).\n",null,null,null,"эргэх (ergeh, “to turn”) +‎ -уулах (-uulah)","From Proto-Mongolic *erexün, compare Daur eruu.\n",null,"эх (eh, “beginning, origin”) +‎ -лах (-lah)","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Proto-Iranian *ātr-, from Proto-Indo-Iranian *ātar-, from Proto-Indo-European *h₂eh₁ter- (“fire”). Compare Persian آذر‎ (âzar), Avestan 𐬁𐬙𐬀𐬭𐬱‎ (ātarš, “fire”), Ossetian арт (art), Pashto اور‎ (or); compare also Old Armenian այրեմ (ayrem), Serbo-Croatian vatra, Irish áith (“kiln”), Welsh odyn, Umbrian 𐌀𐌈𐌓𐌖 (atru), and Latin āter, which may be derived from the same ultimate root.\n",null,"From Proto-Iranian [Term?] (compare Avestan 𐬬𐬁𐬙𐬋‎ (vātō), Pashto and Persian باد‎ (bâd)), from Proto-Indo-Iranian [Term?] (compare Sanskrit वात (vā́ta)), from Proto-Indo-European *h₂wéh₁n̥ts (“blowing”), present participle of *h₂weh₁- (“to blow”).\n",null,null,"Borrowed from Arabic مِسْمَار‎ (mismār).\n",null,"Related to Persian بودن‎ (bûdan).\n",null,null,"From Persian چند‎ (čand).\n","Related to Persian چرم‎ (čarm).\n",null,null,"From Proto-Indo-European *kyew- (“to move, go”). Cognates include Persian شدن‎ (šodan, “to become”), Ossetian цӕуын (cæwyn), Pashto شول‎ (šwəl), Sanskrit च्य्अवते (cyávate, “move to and fro, stir”), Old Armenian չու (čʿu) and Ancient Greek σεύω (seúō, “put in quick motion, drive”).\n",null,null,null,null,null,null,"From Proto-Iranian *dr̥Hgáh, from Proto-Indo-Iranian *dr̥Hgʰás, from Proto-Indo-European *dl̥h₁gʰós. Compare Persian دراز‎ (dirāz), Sanskrit दीर्घ (dīrgha).\n",null,null,null,null,null,null,null,"Related to Persian گفتن‎ (goftan).\n",null,null,null,null,"From hev +‎ -al. Cognate with Persian همحال‎.\n",null,null,"From Proto-Iranian *Hŕ̥šah, from Proto-Indo-Iranian *Hŕ̥ćšas.\n",null,null,null,"Cognate with Persian کنیز‎ (kanīz)",null,"From Proto-Iranian *kar-, from Proto-Indo-European *kʷer-. Cognates include Bactrian κιρ- (kir-), Persian ـگر‎ (-gar).",null,null,null,null,null,null,null,null,null,"From *mêrd, from Proto-Iranian *mr̥táh, from Proto-Indo-Iranian *mr̥tás, from Proto-Indo-European *mr̥tós. Compare Persian مرد‎ (mard).\n","Related to Persian مگس‎ (magas).\n","From Proto-Iranian [Term?], from Proto-Indo-Iranian [Term?], from Proto-Indo-European *mer-.\n","From an earlier *nam, related to Persian نام‎ (nâm).\n",null,null,null,null,null,null,null,null,null,"From Turkish kayış.\n",null,null,"ra- +‎ bûn",null,null,null,null,"From Proto-Iranian [Term?], from Proto-Indo-Iranian [Term?], from Proto-Indo-European *wréh₂ds (“root”). Cognate with English root, Latin radix, Greek ρίζα (ríza).\n","From Proto-Iranian *ráwčah, from Proto-Indo-Iranian *ráwčas, from Proto-Indo-European *léwk-os ~ *léwk-es-os, from *lewk- (“white, light, bright”). Compare Persian روز‎ (ruz), Avestan 𐬭𐬀𐬊𐬗𐬀𐬥𐬙‎ (raocant, “shining”), 𐬭𐬀𐬊𐬗𐬀𐬵‎ (raocah, “light”), Sanskrit रोचते (rocate, “to shine”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"ve- +‎ gotin","xap +‎ -andin",null,null,null,null,null,null,null,null,null,"From Proto-Iranian *hižwáH (compare Persian زوان‎ (zavân)/زبان‎ (zabân), Pashto ژبه‎ (žəba), Avestan 𐬵𐬌𐬰𐬎𐬎𐬁‎ (hizuuā)), from Proto-Indo-Iranian *ȷ́iȷ́ʰwáH (compare Sanskrit जिह्वा (jihvā), Hindi जीभ (jībh)), from Proto-Indo-European *dn̥ǵʰwéh₂s (compare Old Prussian insuwis, Russian язы́к (jazýk), French langue, English tongue).\n",null,null,null,null,null,null,"A Permic word. Maybe related to the Finnic and Samic words meaning sun, compare Estonian päev, Finnish päivä and Northern Sami beaivi.\n","From Proto-Finno-Ugric *perä. Cognates include Estonian pära, Udmurt бэр (ber) and Hungarian far.\n",null,"From Proto-Permic *vå, from Proto-Uralic *wete.\n",null,"A Permic word (*wiša) like Udmurt вож (vož). The Permic word, which is akin to Finnish vihreä, seems to be from or akin to an Indo-Iranian word meaning poison.\n",null,"From Proto-Permic (compare Udmurt вордыны (vordyny)), from Proto-Indo-Iranian *Hwardʰ-.\n",null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *künče.\n",null,null,null,"From Proto-Uralic *äjmä.\n",null,null,null,null,"An old compound. The second element is a Permic *kad, from Proto-Finno-Ugric *kota.\n","A Permic word, related to Udmurt карыны (karyny). Seems to be a borrowing from an Indo-Iranian language.\n",null,null,"From Proto-Finno-Ugric *kerä-. Cognates include Hungarian kér.\n",null,null,"From Proto-Uralic *käle. Cognates include Udmurt кыл (kyl), Finnish kieli, Estonian keel and Northern Sami giella.\n","From Proto-Uralic *kule-.\n",null,null,null,null,null,"From Proto-Finno-Permic *lowna. Cognates include Udmurt нунал (nunal) and Finnish lounas.\n",null,null,null,null,null,"From Proto-Uralic *mëxe.\n","From Proto-Uralic *mene-.\n",null,null,null,"From Proto-Uralic *elä-.\n",null,null,null,null,null,null,"From Proto-Permic [Term?], cognate to Udmurt потыны (potyny).\n","From Proto-Uralic *pele-.\n",null,null,null,"From Proto-Uralic *puwe.\n",null,"From Proto-Permic [Term?], cognate to Udmurt пырыны (pyryny).\n",null,null,null,"From Proto-Permic [Term?], cognate to Udmurt сётыны (sjotyny).\n",null,"From Proto-Finno-Ugric *sula.\n",null,"From Proto-Permic [Term?], from Proto-Uralic *tuxli.\n",null,null,"From Proto-Finno-Permic *teje, compare Estonian tee and Finnish tie.\n","From Proto-Permic *turn, from Proto-Finno-Permic *tarna, borrowed from Indo-European, from Proto-Indo-European *tr̥nós. Cognate with Udmurt турын (turyn), Finnish taarna.\n",null,null,null,"From Proto-Uralic *ëla.\n",null,"A Permic word like Udmurt уж (už).\n",null,null,null,null,null,null,"First attested in the Yongbi eocheonga (龍飛御天歌 / 용비어천가), 1447, as Middle Korean 가다 (Yale: kata).\n","First attested in the Sinjeonjachwi yeomchobang eonhae (新傳煮取焰硝方諺解 / 신전자취염초방언해), 1635, as Early Modern Korean ᄀᆞ라앉다 (Yale: kolaancta). From the now-lost root *kol- (\"to flow\"), whence also the obsolete words 가람 (garam, “river”) and 걸 (geol, “ditch”), and the verb 앉다 (anda, “to sit”).\n","First attested in the Seokbo sangjeol (釋譜詳節 / 석보상절), 1447, as Middle Korean 가지 (Yale: kaci). From Old Korean 種叱 (*KAc).\n","First attested in the Seokbo sangjeol (釋譜詳節 / 석보상절), 1447, as Middle Korean 거리 (Yale: keli).\nPerhaps related to Old Chinese 街 (OC *kreː, *kreː, “street”).\n","First attested in the Neung-eomgyeong eonhae (楞嚴經諺解 / 능엄경언해), 1461, as Middle Korean 골회〮 (Yale: kwòlhwóy).\nCompare Japanese 凝る, 梱る (koru, “to bind together with rope or twine”); 梱, 行李 (kori, “a bale; something bound together with rope or twine”); 繰り (kuri, “winding, reeling, rolling up, as onto a spool”).\n",null,null,null,"First attested in the Worin seokbo (月印釋譜 / 월인석보), 1459, as Middle Korean 녹다 (Yale: nwokta). Derived from a root meaning \"soft, tender, relaxed, slow\". Compare 느긋하다 (neugeuthada), 나른하다 (nareunhada), 느슨하다 (neuseunhada).\n","First attested in the Jīlín lèishì (鷄林類事 / 계림유사), 1103, as 嫩 (MC nuənH) equivalent to modern hanja reading 눈 (nun).\nIn the Hangul script, first attested in the Seokbo sangjeol (釋譜詳節 / 석보상절), 1447, as Middle Korean 눈〮 (Yale: nwún).\n",null,null,"First attested in the Yongbi eocheonga (龍飛御天歌 / 용비어천가), 1447, as Middle Korean 듣다〮 (Yale: tùttá).\n",null,null,null,"First attested in the Yongbi eocheonga (龍飛御天歌 / 용비어천가), 1447, as Middle Korean 말〯ᄒᆞ다〮 (Yale: mǎl-hòtá), equivalent to modern 말 (mal, “word”) +‎ 하다 (hada, “to do”, light verb).\n","From 목 (mok, “neck”) + 소리 (sori, “sound”).\n","First attested in the Seokbo sangjeol (釋譜詳節 / 석보상절), 1447, as Middle Korean ᄇᆞ라다 (Yale: polata).\n","First attested in the Beonyeok sohak (飜譯小學 / 번역소학), 1517, as Middle Korean ᄇᆞ라보다 (Yale: polapwota).\n","First attested in the Yongbi eocheonga (龍飛御天歌 / 용비어천가), 1447, as Middle Korean 블 (Yale: pul).\nPossibly cognate with Old Japanese 火 (pi2) (< Proto-Japonic *poy).\n",null,null,"First attested in the Yongbi eocheonga (龍飛御天歌 / 용비어천가), 1447, as Middle Korean 셔다 (Yale: syeta).\n","Causative form of 속다 (sokda, “to be deceived”).\n",null,"First attested in the Worin seokbo (月印釋譜 / 월인석보), 1459, as Middle Korean 숨기다 (Yale: swumkita). From 숨— (sum-, “to hide”, intransitive) + —기— (gi-, causative suffix) + —다 (da, verb ending).\n","Of native Korean origin. From Middle Korean 싯다 (Yale: sis.ta), ᄡᅵᆺ다 (Yale: psis.ta).\n","First attested in the Hunmong jahoe (訓蒙字會 / 훈몽자회), 1527, as Middle Korean 언덕 (Yale: entek).\n","First attested in the Yongbi eocheonga (龍飛御天歌 / 용비어천가), 1447, as Middle Korean 엻 (Yale: yelh).\n","First attested in the Seokbo sangjeol (釋譜詳節 / 석보상절), 1447, as Middle Korean 움즉다 (Yale: wumcukta).\n",null,"From 이야기 (iyagi, “story”) and the Korean verb 하다 (hada, “to do”).\n","First attested in the Yongbi eocheonga (龍飛御天歌 / 용비어천가), 1447, as Middle Korean 잡다 (Yale: capta).\n","Sino-Korean word from 場所, from 場 (“place”) + 所 (“place”)",null,"First attested in the Yongbi eocheonga (龍飛御天歌 / 용비어천가), 1447, as Middle Korean 주다 (Yale: cwuta).\n",null,"First attested in the Worin seokbo (月印釋譜 / 월인석보), 1459, as Middle Korean ᄣᅵ르다 (Yale: pstiluta).. In the same work, also attested in the form of 디ᄅᆞ다 (tilota).\n",null,"From 청소 (淸掃, cheongso) + —하다 (hada).\n","First attested in the Yongbi eocheonga (龍飛御天歌 / 용비어천가), 1447, as Middle Korean 티〮다〮 (Yale: thítá).\nThe Yanbian meaning “to call (on the phone)” is a semantic loan from  Chinese 打 (dǎ, “to hit; to call”).\n","Of native Korean origin, from Middle Korean ᄒᆞ다〮 (hò-tá), from Old Korean 爲 (*HO(Y)-).\n",null,null,"First attested in the Seokbo sangjeol (釋譜詳節 / 석보상절), 1447, as Middle Korean 흐르다 (Yale: huluta).\n","Of native Korean origin.\n",null,null,null,null,null,"From Proto-Permic *vå, from Proto-Uralic *wete. Cognates include Hungarian víz and Finnish vesi.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Akin to Udmurt вуыны (vuyny).\n","From Proto-Finno-Ugric *waje.\n","From Proto-Finno-Ugric *wuďe. Cognates include Eastern Mari у (u), Finnish uusi and Hungarian új.\n",null,null,"From Proto-Permic [Term?], from Proto-Uralic *künče. Cognates include Finnish kynsi and Hungarian köröm.\n",null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"From a Permic *kid, from Proto-Uralic *käte.\n",null,"From Proto-Uralic *käćetä, like Udmurt кезьыт (kezʹyt).\n","From Proto-Permic [Term?]. Cognates include Komi-Permyak кок (kok).\n",null,"From Proto-Permic [Term?]. Cognates include Komi-Permyak кор (kor) and Udmurt куар (kuar).\n","From Proto-Finno-Ugric *kerä-. Cognates include Hungarian kér.\n",null,"From Proto-Permic [Term?] (“hare”). Cognates include Udmurt кеч (keć). The name of the month was given due to September being the hunting season on the hares.\n",null,"From Proto-Uralic *kale-. Cognates include Udmurt кулыны (kulyny).\n",null,null,"From Proto-Turkic *kuĺ (“bird”).\n","From Proto-Permic [Term?], from Proto-Uralic *käle. Cognates include Finnish kieli and Northern Sami giella.\n","From Proto-Uralic *kule-.\n",null,null,null,null,null,"From Proto-Permic [Term?], from Proto-Uralic *lewle. Cognates include Finnish löyly (“steam”) and Northern Sami lievla (“steam”).\n",null,null,null,null,"From Proto-Permic [Term?], from Proto-Finno-Permic *lowna (“day, midday”). Cognates include Finnish lounas and Udmurt нунал (nunal). The sense for the compass point emerged from the position of the Sun on the given time of day.\n",null,null,null,null,null,null,null,null,"From Proto-Permic *mu, from Proto-Uralic *mëxe. Cognates include Finnish maa and Mansi ма̄ (mā).\n",null,null,null,null,null,"From Proto-Permic [Term?], from Proto-Uralic *nejde. Cognates include Finnish neiti and Northern Sami nieida.\n",null,"From Proto-Permic [Term?], borrowed from an Iranian language, ultimately from Proto-Iranian *nagna- (compare Persian نان‎ (nān)). Cognates include Komi-Permyak нянь (njanʹ) and Udmurt нянь (njanʹ).\n",null,null,null,null,null,"From Proto-Permic [Term?], from Proto-Uralic *pojka. Cognates include Finnish poika and Hungarian fiú.\n","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Proto-Uralic *pele-.\n",null,"From Proto-Uralic *päŋe.\n",null,null,"From Proto-Permic *po, from Proto-Uralic *puwe. Cognates include Finnish puu and Hungarian fa.\n",null,null,"From Proto-Permic [Term?], cognate to Udmurt пырыны (pyryny).\n",null,null,null,null,null,null,"From Proto-Permic [Term?], cognate to Udmurt сётыны (sjotyny).\n",null,null,null,null,"From Proto-Finno-Ugric *sula.\n",null,"From Proto-Permic [Term?], from Proto-Uralic *tuxli. Cognates include Finnish tuuli and Udmurt тӧл (töl).\n","From Proto-Permic [Term?], from Proto-Uralic [Term?]. Cognates include Eastern Mari тылзе (tylze) and Udmurt толэзь (tolezʹ).\n","From Proto-Finno-Permic *teje, compare Estonian tee and Finnish tie.\n","From Proto-Permic *turn, from Proto-Finno-Permic *tarna, borrowed from Indo-European, from Proto-Indo-European *tr̥nós. Cognate with Udmurt турын (turyn), Finnish taarna.\n",null,null,null,null,"From Proto-Permic [Term?]. Cognates include Komi-Permyak удж (udž) and Udmurt уж (už).\n",null,null,null,null,"From Proto-Permic [Term?], cognate to Udmurt ческыт (ćeskyt).\n",null,null,null,"From Proto-Permic [Term?], cognate to Udmurt шуыны (šuyny).\n",null,null,null,null,null,"Akin to Finnish heinä.\n",null,null,"From Proto-Finnic *ääni, from Proto-Finno-Ugric *äne. Cognates include Finnish ääni and Veps än'.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finnic *mendäk, from Proto-Uralic *mene-. Cognates include Finnish mennä and Estonian minema.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finnic *poika, from Proto-Uralic *pojka. Cognates include Finnish poika and Estonian poeg.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finnic *toinen. Cognates include Finnish toinen and Estonian teine.\n",null,null,"From Proto-Finnic *töö. Cognates include dialectal Finnish työ and Ingrian töö.\n",null,"From Proto-Finnic *uni, from Proto-Finno-Permic *une. Cognates with Finnish uni and Estonian uni.\n",null,null,null,null,null,null,null,"Akin to Finnish varoa and Veps varaita.\n",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,"From Proto-Indo-European *h₂erkʷo- (“bow, arrow”). Cognate to Old English earh, whence English arrow.\n",null,null,null,null,null,"Uncertain origin, proposed connection to Ancient Greek κιβωτός (kibōtós).\n",null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Italic *frustom, from Proto-Indo-European *bʰrus-tós, from *bʰrews- (“to break up, cut”).\n",null,null,null,null,null,"From a dissimilation of earlier *medīdiēs, derived from medius (“middle”) + diēs (“day”).\n",null,null,null,"From Proto-Italic *ōs, from Proto-Indo-European *h₃éh₁os. Cognates include Hittite 𒀀𒄿𒅖 (aiš), Sanskrit आस् (ās), Old Irish á.\n","From Proto-Indo-European *pak-slo-, from root *peh₂ǵ-. See pangō, pāgus, pacīscor, pāx, pāgina.\n",null,null,null,"From post + ea (“these things”).\n","From Proto-Indo-European *ph₂weros, from *peh₂w-. Cognate with Oscan 𐌐𐌖𐌂𐌋𐌖𐌌 (puglum), Ancient Greek παῖς (paîs, “child”).\n","Unknown. Possibly from earlier polcher, which according to Walde-Hoffman and Pokorny reflects Proto-Indo-European *perḱ- (“motley, variegated”), with dissimilation *perḱ-ro-s > *pelḱ-ro-s, which would make it cognate to Sanskrit पृश्नि (pṛ́śni). De Vaan rejects that connection as both irregular and semantically incompatible/tenuous, and assigns no known etymology.\n",null,null,null,"From Proto-Indo-European *wréh₂ds (“root”) and cognate with rādīx.\n",null,null,"From re- + *-trō, probably taken from intrō and other similar adverbs.\n",null,null,"From saccus (“a sack, bag, purse”) +‎ -ulus (diminutive suffix).\n",null,null,"The origin is uncertain. Perhaps from Proto-Indo-European *th₂-dʰlom, from *teh₂- (“to stand”) (a variety of *steh₂- without s-mobile, whence also Latin stō, stāre (“to stand”)) + *-dʰlom (“instrumental suffix”) whence Latin -bula. The original meaning would then be “that which stands”, for which see also Latin stabulum.\n",null,"From Proto-Italic *terzā, from Proto-Indo-European *ters-eh₂, from *ters- (“dry”). Cognate with torreō, Ancient Greek τέρσομαι (térsomai), Old Irish tír, Sanskrit तृष्यति (tṛ́ṣyati), Old English þurst (English thirst).\n",null,"From Proto-Italic *ungus, from Proto-Indo-European *h₃negʰ-. Cognates include Ancient Greek ὄνυξ (ónux), Old Irish inga, Sanskrit नख (nakhá, “claw, nail”), Old Armenian եղունգն (ełungn), Old Church Slavonic ногъть (nogŭtĭ), Lithuanian nagas, Persian ناخن‎ (nâxon), Albanian nyell, and Old English næġl (English nail).\n",null,"Most likely related to vārus (“bandy”).\n",null,"(Can this(+) etymology be sourced?)\nFrom Proto-Baltic *ād-, from Proto-Indo-European *h₂edʰ-, a parallel form of *h₂eǵ- (“goat”) (whence Latvian āzis (“billy-goat”), q.v.). The term may originally have been adjectival (cf. Lithuanian ódinis (“skin, of skin”)). A relationship between terms for “goat” and “skin” is not infrequent in Indo-European; cf. Russian коза́ (kozá, “goat”), ко́жа (kóža, “skin”), or Sanskrit अजा (ajā, “she-goat”), अजिनम् (ajínam, “skin”). In Latvian, the term expanded its meaning to cover both human and animal skin (or fur), as well as animal skin as material for making objects, ideas often distinguished in other languages (e.g., German Haut, Fell, and Leder). The original meaning is perhaps preserved in the Finnish borrowing vuota (“(raw) hide, pelt”). Cognates include Lithuanian óda, Sanskrit अत्क (átka, “armor, outfit”) (< *h₂eǵ-ko-), Ancient Greek ἀσκός (askós, “leather wine-skin”), Albanian dhi (“goat”) (< *h₂edʰ-i).",null,null,"The usual theory considers ala to be borrowed from Middle Low German hol (“depth, hole, cave”), or maybe from the same form in Middle Dutch or German Low German (East Frisian); cf. German Höhle (“cave”).\nA different view suggests that ala could also reflex of an old Proto-Indo-European stem *h₁el-, *ol-, *al- (“to flow, to drain”) with various Baltic reflexes: dialectal alots, alogs, standard avots (“(water) source”), alksna, aluksna (“miry, swampy place”) (cf. place names like Alūksne, Alūkstes), Lithuanian alė́ti (“to flow, to drip”). The original meaning of ala would thus have been “(water) source”, from which “place (e.g., cave, rift, pit) from which water springs” and finally simply “cave,” possibly under the influence of the aforementioned Germanic words.",null,"From at- +‎ stāt",null,"Traditionally derived from Proto-Baltic *pek- (metathesized to *kep-), from Proto-Indo-European *pekʷ- (“to roast, to cook”), from earlier *h₃-ép-kʷ-, *h₃p-ékʷ-. Karulis would rather see *pekʷ- as a metathesis of PIE date of a root *kep-, *kʷep- (“to smoke, to cook”), formed analogically from *tep- (“to be hot, to heat up”) on the model of *kel-, *tel- (“to build”). Cognates include Lithuanian kèpti, Old Church Slavonic пещи (pešti), пекѫ (pekǫ, 1 sg. pres.), Russian печь (pečʹ), пеку́ (pekú), Belarusian пекці́ (pjekcí), Ukrainian печи́ (pečý), пекти́ (pektý), Bulgarian пека́ (peká, 1st sg. pres.), Czech péci, Polish piec, Sanskrit पचति (pácati, “to roast, to bake, to cook, to boil”), Ancient Greek πέσσω (péssō, “to bake, to cook, to boil”) (from *pekʷye-), Latin coquō (“to cook, to roast, to dry”), Tocharian A, Tocharian B pāk- (“to cook, to boil”).","Originally the iterative counterpart of an earlier verb *dert (“to tear, to split”), from Proto-Baltic *der-, from Proto-Indo-European *der- (“to split, to tear, to peel”). The meaning evolved as follows: “to tear, to split” > “to cut, to chop (wood)” (cf. the derived form darināt kokus “to pear, to cut (branches) off (a tree)”) > “to make by cutting (e.g., like a carpenter)” > “to make, to do.” Cognates include Lithuanian darýti (“to do, to make”).","From daudz (“much, many, a lot”) +‎ -ums.\n",null,"From the same stem as dzīvs (q.v.), made into a regular second conjugation verb (ending -ot). It replaced an earlier dzīt (“to live”) (q.v.), of which it may have originally been the iterative form (in case it was not directly derived from dzīvs). Its original meaning, “to be alive, to exist,” was later extended to include also “to reside” (like English to live); cf. the derived term dzīvoklis (“apartment, flat”).","From the same stem as the adjective gatavs (“ready”) (q.v.), made into a regular 2nd-conjugation verb.","From earlier *grenz-, from Proto-Baltic *grenž-, from Proto-Indo-European *grenǵ-, from the zero grade of Proto-Indo-European *ger- (“to turn; to wind; to wreathe”) with an extra ǵ and an infix -n-. A minority opinion considers griezt (“to turn”) to have the same origin as griezt (“to cut”) (see below), with the circular motion meaning coming from certain ways of cutting. Cognates include Lithuanian grę̃žti (“to drill, to turn, to change, to mend”), Old Prussian granstis (“one who drills, who drilled”), greanste ([grēnste], “rope made of woven, wound branches”), Old Norse kringr (“ring”), kringla (“ring, circle”), kranga (“to crawl, to creep, to drag oneself”), German Kringel (“pretzel”), Dutch krinkel (“loop; twist”).","From the same stem as the verb gult (“to lie down”) (q.v.), of which it was originally the iterative (and possibly causative) form. Originally it was an i-stem, as can be seen in dialectal forms like gulim, gulit instad of guļam, guļat. Cognates include Lithuanian gulė́ti, Sudovian guld (< *gult).","The infinitive and present tense forms come from Proto-Baltic *eitei, from Proto-Indo-European *h₁ey- (the old athematic present tense forms *eimu, *iemu, etc. were lost and replaced with new forms derived directly from *h₁ey-). The past tense forms come from Proto-Baltic *gā-, from Proto-Indo-European *gʷeh₂- (“to come”), from which also Lithuanian góti (“to go quickly”), English come).\n","From Proto-Balto-Slavic *jauˀnás, from Proto-Indo-European *h₂yéwHō. In Latvian, this word broadened its meaning to include also “new,” replacing a previous *naujs (“new”) (compare Lithuanian naũjas (“new”)). Cognates include Lithuanian jáunas (“young”), Old Prussian *jaun- in names of people (Jawne, Javne, etc.), Sudovian iaunis, Old Church Slavonic юнъ (junŭ), Russian ю́ный (júnyj), Ukrainian юний (junyj), Czech jinoch (“young man”), Gothic 𐌾𐌿𐌲𐌲𐍃 (juggs), German jung, English young, Sanskrit युवन (yúvana), Latin iuvenis.\n","From Proto-Baltic *kāy-a, from Proto-Indo-European *kāi-, a stem of unclear origin. It is possible that the initial *k is an irregular reflex of an earlier *gʷ, in which case Latvian kāja and its cognates might be derived from Proto-Indo-European *gʷā- (“to come, to go”); compare Latvian kāja : gāja (“he went”) with Sanskrit कायः (kā́yaḥ, “body, flesh”) : गयः (gājaḥ, “gait, motion”). Another hypothesis suggests a connection between Latvian kāja and Ancient Greek κίω (kíō, “to go”), κινέω (kinéō, “to move, too put in motion”), Latin cieō (“to move”). Cognate include Lithuanian koja, Sudovian kaj ([kāj(a)]), Sanskrit कायः (kā́yaḥ, “body, flesh”).",null,"From Proto-Balto-Slavic *kas","From Proto-Baltic *kuok-, from Proto-Indo-European *kewk-, from the stem *kew- (“to bend, to be bent”). \nMeaning at first “bent wood, branch, stick,” it soon became “wood, tree.” It competed with mežs (< *medis), the original term for “wood, tree,” which soon acquired the meaning of “forest.” The original “branch, stick” meaning of koks can still be occasionally found (see below). \nCognates include Lithuanian kúoka (“stick with thick end, pounder, pestle”), kúokas (“stick with thick end; thick end of a stick; tuber; mace, club”), kukà (“stick”), Bulgarian кука (kuka, “spike, peg, wedge, hook, handle”).",null,null,null,null,"Cognate with Lithuanian laikas.\n",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Proto-Baltic *šlep-, *šlēp- (whence both slēpt and its dialectal variant slept), from Proto-Indo-European *ḱlep-, *ḱlēp-, a variant of *klep- (related to the stem *gleb(ʰ)- (“to cover, to squeeze”), whence Latvian glābt, q.v.).The original meaning was “to cover (with one's hands),” from which “to not let others see (by covering with one's hands)” > “to hide.” Cognates include Lithuanian slė̃pti; from the parallel stem *klep-, also Old Prussian auklipts (“hidden”), Gothic 𐌷𐌻𐌹𐍆𐌰𐌽 (hlifan, “to steal”), Ancient Greek κλέπτω (kléptō, “to steal”) (< *klépyō-), Latin clepō (“to steal, to listen secretly”).",null,"See varš.\n","From Proto-Baltic *wardas, a masculine parallel form to neuter *wardan, from Proto-Indo-European *werdʰh₁om (“word”), from the stem *werh₁- (“to speak, say, talk”) with an extra element -dʰo. Note the typical Baltic polysemy between “name” and “word”, since the Proto-Indo-European term for “name”, still conserved in Old Prussian emnes, emmens (< Proto-Indo-European *h₁nómn̥), was lost and replaced by *werdʰo-. Cognates include Lithuanian var̃das, Old Prussian wīrds, wirds, Sudovian ward, Russian врать (vratʹ, “to lie”), Belarusian вярзці́ (vjarzcí, “s/he lies”), Ukrainian верзти́ (verztý, “to lie”), Proto-Germanic *wurdą (Gothic 𐍅𐌰𐌿𐍂𐌳 (waurd), German Wort, English word, Icelandic orð), Hittite ḫurt- (“to load, to charge”) (: weriya- “to say”), Sanskrit व्रत (vrata, “vow, command”), Ancient Greek εἴρω (eírō, “to say”) (< *weryō), Latin verbum.",null,"From Proto-Balto-Slavic *źemē, compare zem, ultimately from Proto-Indo-European *dʰéǵʰōm. Compare Lithuanian žẽmė, Polish ziemia, Russian земля́ (zemljá), Persian زمین‎ (zamin) Latin humus, Ancient Greek χθών (khthṓn).\n",null,null,null,null,null,null,"Compare with Avar хӏарщ (ḥarš̄).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Northeast Caucasian *hwĕʔnV (“blood”); compare Akhvakh гьини, гьиᴴ (hini, hĩ, “blood”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *bẹ̄ĺ(k) (“five”). Cognate with Kazakh бес (bes), Krymchak беш, Kyrgyz беш (beş), Turkish beş, Karakhanid بٖيشْ‎ (bḗš, “five”), Old Turkic 𐰋𐰃𐱁‎ (béš, “five”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Balto-Slavic *beˀg-; cognate with Latvian bêgt, Proto-Slavic *běťi (“to flee, run”). From Proto-Indo-European *bʰégʷeti, from Proto-Indo-European *bʰegʷ- (“run, flee”), with long vowel due to Winter's Law. Cognate with Ancient Greek φέβομαι (phébomai, “flee, take flight”). Possibly also Tocharian A pukäl, Tocharian B pikul (“year”).\n",null,null,null,null,"Compare Polish verb dzierżyć (“to hold”).\n",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","From Proto-Indo-European *gʷew(H)- (“to gain”), see also Latvian gaut (“to catch, gain”), gūvejs (“winner”).","Compare Old Prussian geguse (“cuckoo”) attested in Elbing Vocabulary.\n","From Proto-Balto-Slavic, from Proto-Indo-European *gʷʰen-. Cognate with Latvian dzīt, Old Prussian guntwei, Polish gnać (“to rush”), Ancient Greek θείνω (theínō, “to kill”) and Sanskrit हन्ति (hánti, “to slay”). See also ganýti (“to graze”).\n",null,null,null,"From Proto-Baltic *jḗˀgāˀ, from *yēgʷeh₂ (“power, youthful strength”). Cognates include Latvian jēga (“meaning, sense, point”), Ancient Greek ἥβη (hḗbē, “power, youthful strength”).\n","From Proto-Indo-European *kelh₁- (“to shout”), which is imitative. Related to Old English hlowan (“to low, make a noise like a cow”), Old High German halan (“to call”), Ancient Greek κλεδον (kledon, “report, fame”), κλήση (klḗsē, “to call”), κέλαδος (kélados, “noise”), Middle Irish cailech (“cock”), Latin calō (“to call out, announce solemnly”), Sanskrit उषःकल (uṣaḥkala, “cock”, literally “dawn-calling”).\n","Per Derksen 2008, from Proto-Balto-Slavic *kampta.  Also compare Proto-Celtic *kantos (“corner”).\n",null,null,"From Proto-Balto-Slavic *kas, from Proto-Indo-European *kʷos.\n","From Proto-Indo-European *pekʷ-. The current Lithuanian form has experienced metathesis. Cognate with Russian печь (pečʹ).\n",null,"Compare Latvian ciets.\n",null,null,null,null,"Cognate with Old Prussian quoi (“I/you want”), Old East Slavic свѣтъ (světŭ, “world; society”), Latin quaero (“I look for”).\n",null,null,null,null,null,"From Proto-Balto-Slavic *minˀk-. Cognate with Latvian mīksts, Polish miękki.\n","Within Balto-Slavic a connection can be drawn with Latvian mustavas (“warping beam”) (compare muštùvas); Slovene mašiti (“fill, clog up”) and perhaps Bulgarian му́ша (múša, “stab, poke”) < *moux-. These forms point to Proto-Indo-European -s- and a root of *mews- (“poke, beat”); compare Sanskrit मुष्णाति (muṣṇāti, “steal, break”).\nAccording to Beekes, the root is *h₂muḱ-; compare Ancient Greek ἀμύσσω (amússō, “scratch, tear”), Latin mūcrō (“sharp point”). However, neither the semantic nor formal arguments make a convincing case for the Lithuanian term to belong here.\n","From Proto-Balto-Slavic *nogaʔ, from Proto-Indo-European *h₃nogʷʰ-eh₂.\n",null,"Compare Latvian āda.\n","Probably related to Proto-Germanic *hulaz (“hole”), from Proto-Indo-European *ḱel- (“to cover”).","From Proto-Indo-European *h₄orh₂-on- (“shore, bank, border”).\n",null,null,null,null,null,null,"From Proto-Balto-Slavic *pírštan. Cognate with Latvian pirksts, Old Prussian pirsten and Proto-Slavic *pь̃rstъ. Compare also Sanskrit पृष्ठ (pṛṣṭhá, “back”).\n",null,null,null,null,null,null,null,null,"Probably cognate with Latvian pūst.\n",null,null,null,null,null,"Cognate with Latvian slēpt.\n",null,null,"Cognate with Latvian sâkt (“start, begin”). Frequently connected with Old Church Slavonic скакати, скачѫ (skakati, skačǫ, “hop, jump”), скочити (skočiti, “jump, leap”), Proto-Germanic *skehaną (“spring up, emerge”). If so, we could be looking at a Proto-Indo-European s-mobile *(s)ḱeh₂k-, *(s)ḱoh₂k-, with the palatovelar present in the Baltic forms (< *śoˀk-) being neutralised after s in Slavic (< *skoˀk-).\n",null,"Compare Latvian stiprs.\n",null,"From Proto-Balto-Slavic *suk- (“turn, spin”); compare Latvian sukt, Proto-Slavic *sъkati (Russian скать (skatʹ, “twist, turn”), Czech skati). Also related are Latvian sàucêt, Proto-Slavic *sučiti. Beyond Balto-Slavic, hesitant connections have been made with Tocharian A ṣkārā, Tocharian B aṣkār (“at the back”), Ossetian хуы́рх (x°ýrx, “whey”), Latin sucula (“winch”).",null,null,"From Proto-Balto-Slavic *tek-, from Proto-Indo-European *tekʷ-. Cognates include Latvian tecēt, Serbo-Croatian тећи/teći (“to flow”), Sanskrit तक्ति (tákti, “to rush”) and Old Irish techid (“to flee”).\n",null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,"From Proto-Indo-European *ǵʰelh₃-. Cognate with Latvian zaļš (“green”) and akin to Proto-Slavic *zelenъ (“green”), *zelьje (“young vegetation”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From
