Sanskrit आग्रह (āgraha, “inclination towards, whim”).\n",null,null,null,null,null,null,null,null,null,"Cognates with Tamil காற்று (kāṟṟu), Kannada ಗಾಳಿ (gāḷi), Telugu గాలి (gāli).\n",null,null,null,null,null,null,null,null,null,null,"Cognate with Kannada ತೀ (tī), Tamil தீ (tī).\n",null,"From Sanskrit नख (nakha).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Dravidian *vīṭu. Cognate with Kannada ಬೀಡು (bīḍu, “house”), Tamil வீடு (vīṭu)",null,null,null,null,null,null,null,"According to Feoktistov, from a Turkic language. Veršinin considers suggestions of borrowing completely baseless, he is convinced that the term is of child language origin (its original meaning being \"mother\"), according to him, the following are of a similar origin: Eastern Mari ава (ava), Western Mari ӓвӓ (ävä), cf. dialectal Eastern Mari аппа! (appa!, “[an exclamation for a baby to smile]”), Tundra Nenets [script needed] (āppa, “mother [child language]”). Parallel developments in unrelated languages: Selkup ама (“mother”), Basque ama (“id.”), Nivkh ымык (əmək, “id.”), Koryak [script needed] (-aw'-) in [script needed] (ŋaw'gyjnik, “female [animal]”).",null,null,null,"Ultimately from Proto-Uralic *ëla. Perhaps by error EES lists Moksha ал (al, “egg”) as a cognate of Estonian ala. Compare, however, Estonian alus (“foundation”), Livonian alā (“down; under”), alli (“foundation; underside”), among others. Veršinin, however, lists “the lower part of something” as an alternative sense for the word ал (al) in both Mordvinic languages. He speculates that the “egg” sense is secondary to the “underside” sense (as eggs are found under birds), a possible taboo replacement, as collecting eggs in the spring was very important in historic times.",null,null,null,null,null,null,null,null,"According to SSA, relationship with Finnish vaania is uncertain. According to others, the two terms are unrelated.(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"Cognate with Erzya вельтямс (velʹtjams).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,"From Proto-Mordvinic *viŕ. Cognates include Erzya вирь (virʹ).\n",null,null,null,null,null,null,null,"From Proto-Uralic *kanta-. Cognates include Erzya кандомс (kandoms), Northern Sami guoddit, Finnish kantaa, Eastern Mari кондаш (kondaš).",null,null,null,null,null,null,null,null,"Cognate with Erzya ки (ki). This term is to be linked with Eastern Mari кыша (kyša, “footprint”), Finnish keino (“way (of doing something)”). Veršinin thinks that the origin could be the old pronoun *ki (“this”), a correspondence k-/t- then would explain Estonian tee (“road”), Finnish tie (“id.”), Komi туй (tuj, “road; footprints; direction”).",null,null,null,null,"From корхтамс (korxtams, “to speak”) +‎ -ма (-ma).\n",null,null,"From Proto-Uralic *kota. Some speculate borrowing from Proto-Indo-European *koth₁o-, whence Persian کد‎ (kad). Phonologically and semantically similar terms can be found in other language families: Tungusic Evenki котон (koton), Dravidian Tamil குடி (kuṭi), Ainu コッ (kot, “building site; place”).",null,null,null,null,"From Proto-Uralic *käle. Cognates include Finnish kieli, Estonian keel and Northern Sami giella.",null,null,null,null,"Veršinin considers this term evidently connected with иля (ilja, “other, different”), the latter being the original form, the root и- (i-) is of the same origin as исень (isenʹ, “of yesterday [adjective]”) and ичкозе (ičkoze, “far”), э- (e-) in Erzya эзк (ezk, “close, next to”), эське (esʹke, “last time”), he compares -э- in Tundra Nenets [script needed] (ŋeli, “other, different”), [script needed] (ŋelimź, “to become different”), Udmurt иськан (isʹkan, “close female friend, close relative”) and Eastern Mari (в)е- ((v)je-) in вес(е) (ves(je), “other”) (where в- (v-) might be a secondary development.) In relation to the last ones, he also compares Proto-Turkic [Term?] (eš, “friend”).\nIn the Erzya word иля (ilja, “don't [imperative of negation verb]”) Veršinin sees shifting of meaning from \"that (one)\" → \"not (that one),\" where the и- (i-) originally has been a demonstrative component, the same as in the Moksha term.",null,null,"From Proto-Uralic *luke-.",null,"Cognate with Erzya марямс (marjams).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,"From Proto-Uralic *muďa (“earth, land”), whence also Finnish muta (“mire, mud”). According to Veršinin, other cognates may include Eastern Mari модо, муды, муто (modo, mudy, muto, “blueberry”), perhaps the element бота- in Erzya ботавомс (botavoms, “to become turbid, muddy [of water]”), the element бут- in бутра, путра (butra, putra, “turbid, muddy”).\n","From Proto-Finno-Ugric *mule-. Cognates include Erzya молемс (molems), Northern Sami mollat, Hungarian múlik.",null,null,null,null,null,null,"From Proto-Uralic *pala-.\n",null,"From Proto-Uralic *päŋe.","Ultimately from Proto-Uralic *pele-. Cognates include Finnish pelätä, Northern Sami ballat, Hungarian fél.Veršinin is unsure whether development from пяль (pjalʹ, “half; side”) is possible, he wonders if the meaning could have changed from \"side\" to \"step aside; avoid; fear.\"",null,null,null,null,"From Proto-Finno-Ugric *perä. Cognates include Erzya пря (prja), Finnish perä, Komi-Zyrian бӧр (bör), Udmurt бер (ber), Khanty пәртӓг (pərtäg), Mansi па̄р (pār).",null,null,null,"From Proto-Uralic *pälä (“half; side”). The sense of the postposition apparently evolved from \"side\" to \"by the side of.\"\n",null,null,"Cognate with Erzya самс (sams).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,"Cognate with Erzya сергедемс (sergedems).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,null,"Cognate with Erzya сэредемс (seredems).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","Cognate with Erzya туемс (tujems).\n(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *keččä.",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *ojwa.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finno-Ugric *käte.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Western Mari тӓнг (täng).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Borrowed from English beer.\n",null,null,null,"A Berber borrowing, originally spread in African Latin and then gradually replacing the native ulva, compare Kabyle tabuda (“Typha angustifolia”) etc., also Arabic بُرْدِيّ‎ (burdiyy), بُوط‎ (būṭ, “cattail”) from which some forms have later been reborrowed into Romance, listed there. There is an interpolation in the Dioscurides locus about θαψία (thapsía) after φέρουλα σιλβέστρις saying that the Africans call it βοιδίν (boidín) (Ἅφροι βοιδίν, left out in Dioscórides interactivo), which mirrors a Berber collective morpheme -īn (as explained by Bertoldi 1947 p. 195 seq.).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Borrowed from Italian or Spanish gala",null,null,null,null,null,null,null,null,null,null,null,null,null,null,"guru +‎ -n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From -fa (“die”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *witte (“five”). Cognates include Khanty вет (wet), Hungarian öt, Finnish viisi, Estonian viis, and Nganasan бииʔ (bīʔ, “ten”).\n",null,null,null,null,null,null,"From Proto-Finno-Ugric *waje (“fat”). Cognates include Hungarian vaj.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *mëxe. Cognates include Finnish maa, Komi-Zyrian му (mu), Udmurt му (mu), possibly also Khanty мўв (mŭw).\n","From  Proto-Ob-Ugric *meägl, from Proto-Finno-Ugric *mälke (“breast”). Cognates include Hungarian mell.\n",null,null,"From Proto-Uralic *mene- (“to go”).  Cognates include Hungarian megy.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *wole- (“be, will be”).  Cognates include Hungarian van, Finnish olla, Estonian olema.\n",null,null,null,null,"From Proto-Uralic *pele- (“to fear”). Cognates include Hungarian fél, Finnish pelätä.\n",null,null,null,null,null,"From Proto-Uralic *puŋɜ- (“to grasp, catch”). Cognates include Hungarian fog.\n",null,"From Proto-Uralic *päŋe. Cognates include Hungarian fej",null,null,null,null,"From Proto-Uralic *śilmä (“eye”). Cognates include Khanty сем (sem), Hungarian szem, Finnish silmä and Estonian silm.\n",null,"From Proto-Mansi *sǟtə (*sǟtə), from Proto-Ugric *säptɜ, from Proto-Indo-European *septḿ̥, either through Indo-Iranian or Tocharian. Compare Hungarian hét.\n",null,"From Turkic (compare Turkish sav), possibly through Proto-Ugric *sawɜ, compare Hungarian szó.\n",null,"From Proto-Uralic *śoje. Cognates include Hungarian zaj.\n",null,null,"From Proto-Mansi *šim, from Proto-Uralic *śüdäme (“heart”). Cognate with Hungarian szív,\nFinnish sydän.\nSouthern Mansi; šäm (Janyčkova Village), šåm, šøm \nEastern Mansi; šim (Lower Konda), sem (Kondinsky)\nWestern Mansi; šim (Lozva Middle, Lozva Lower), ši̮m (Pelym)\nNorthern Mansi; sim (Sosva)\n",null,null,null,null,"From the same Proto-Finno-Ugric root as *tälwä as Hungarian tél, Finnish talvi, and Estonian talv.\n",null,"From Proto-Uralic *sëne (“sinew”). Cognates include Hungarian ín,  Finnish suoni and Estonian soon.\n",null,null,null,null,"From Proto-Uralic *sula (“to molten, melted; melt, dissolve”).Cognates include Hungarian olvad.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Ugric *warɜ- (“to guard, wait”).Cognates include Hungarian vár.\n",null,null,null,null,null,null,null,"From Proto-Uralic *kule- (“hear (intr); ?ear”).  Cognates include Hungarian hall and Finnish kuulla.\n",null,null,null,null,null,null,"From Proto-Finno-Ugric *jäŋe. Cognates include Khanty йӛӈк (jə̂ňk), Hungarian jég, and Estonian and Finnish jää.\n",null,null,null,null,null,"Cognate with Eastern Mari виян (viân).\n",null,null,null,"From Proto-Uralic *wete. Cognate with Eastern Mari вӱд (vüd).\n",null,null,null,null,null,null,null,null,null,"From Proto-Finno-Ugric *ńälmä. Cognate to Eastern Mari йылме (jylme). \n",null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finno-Ugric *kerä-. Cognates include Hungarian kér.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Eastern Mari манаш (manaš).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Eastern Mari толаш (tolaš).\n",null,null,null,null,null,null,null,"Cognate with Eastern Mari йӱштӧ (jüštö).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognate with Eastern Mari илаш (ilaš).\n",null,null,null,"Cognate with Eastern Mari ышташ (yštaš).\n",null,null,null,"Related to Eastern Mari ава (ava).\n",null,"From Proto-Uralic *ëla.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *käle. Cognates include Finnish kieli, Estonian keel and Northern Sami giella.\n",null,"From Proto-Uralic *künče.\n",null,null,"Cognate with Lule Sami giedja.",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *muďa. Cognates include Estonian muda, Finnish muta, Moksha мода (moda) (see there for more.)\n",null,null,null,null,null,"Cognate with Finnish uusi Estonian uus, Northern Sami ođas, Komi-Zyrian выль (vylʹ), Erzya од (od), Moksha од (od) and Hungarian új.\n","From Proto-Mordvinic *vaj, from Proto-Finno-Ugric *waje. Cognates include Moksha вай (vaj).\n",null,null,null,null,null,null,null,"From Proto-Uralic *päŋe.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Cognates include Finnish marja (“berry”).",null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Uralic *elä-.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Samoyedic, from Proto-Uralic *käle. Cognate with Estonian keel and Udmurt кыл (kyl).\n",null,null,null,null,null,null,null,"Compare Tundra Nenets сэ̇р\".\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"See азмыть (azməț)","From Proto-Uralic *ańa (“wife of an older male relative; mother”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From afstaan. Equivalent to af +‎ stand.\n",null,null,null,null,null,null,null,null,"From earlier born, from Middle Dutch borne, from Old Dutch brunno, from Proto-Germanic *brunnô. The inherited word underwent metathesis in Middle Dutch, but this was undone through influence from German Brunnen.\n",null,null,null,null,null,null,null,null,null,null,null,"From Middle Dutch clanc. This etymology is incomplete. You can help Wiktionary by elaborating on the origins of this term.",null,null,null,null,null,null,null,"From Middle Dutch līne, from Old Dutch *līna, from Proto-Germanic *līnǭ, ultimately from Proto-Indo-European *līno- (“flax”).\n",null,null,null,null,null,null,"Borrowed from German spitz.\n",null,"From Middle Dutch veranderen. Equivalent to ver- +‎ ander (“other”) +‎ -en.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Akin to Finnish kohta.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finnic *näktäk.\n",null,null,null,null,null,null,null,null,null,null,null,"From Proto-Finnic *päivä, from Proto-Uralic *päjwä.\n",null,null,null,null,"From Proto-Finnic *pää, from Proto-Uralic *päŋe. Cognates include Finnish pää, Estonian pea, Veps pä and Hungarian fej, fő.\n",null,"From Proto-Finnic *puu, from Proto-Uralic *puwe. Cognates include Finnish puu, Estonian puu, and Hungarian fa.\n",null,"From Proto-Finnic *rahvas. Cognates include Finnish rahvas and Estonian rahvas.\n",null,null,null,null,"From Latin rūta, from Ancient Greek ῥυτή (rhutḗ).\n",null,null,null,null,null,null,null,null,"From Proto-Finnic *soo.\n",null,null,"From Proto-Finnic *toinen.\n",null,null,null,null,null,null,null,null,null,null,"Akin to Finnish veräjä.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Iranian *hižwáHkaH, from *hižwáH, from Proto-Indo-Iranian *ȷ́iȷ́ʰwáH, from Proto-Indo-European *dn̥ǵʰwéh₂s.\n",null,null,null,null,null,null,null,"From earlier *дан (*dan) (attested in placenames, and compare Jassic dan) with a → o before a nasal, from Proto-Scythian *dānu, from Proto-Iranian *dānu (compare Avestan 𐬛𐬁𐬥𐬎‎ (dānu, “river”)), from Proto-Indo-Iranian *dáHnu (compare Sanskrit दानु (dānu, “drop, dew”)), from Proto-Indo-European *déh₂nu.\n",null,null,null,null,null,null,"Perhaps, borrowing from Vainakh. See Proto-Nakh *ko (“hand”).\n",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Indo-European *steh₂-.\n",null,null,null,null,null,null,null,null,null,"Cognate with Pashto ووریدل‎ (warēdəl, wōrēdəl, “to rain”); Kurdish and Persian باران‎ (bārān), Sanskrit वार् (vār, “water”), Avestan 𐬬𐬁𐬭𐬀‎ (vāra, “rain”). Other Indo-European cognates include Armenian ջուր (ǰur), Old Norse vari (“liquid, water”), Latin ūrīnor (“to dive”) and Luvian 𒉿𒀀𒅈 (wār, “water”).\n",null,null,"From *wen-, compare Persian بین‎ (bin), Yagnobi венак (venak) and Zazaki vînayîş.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Ultimately from Proto-Iranian *Hárdaxš.\n",null,null,"Inherited from Proto-Iranian *ātr-, *ātar-.\n",null,null,null,null,null,null,null,null,null,"From پخه‎ (paxá)",null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Ultimately from Proto-Indo-European *tep-; see there for more.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Persian خوراک‎ (xorâk).\n",null,null,null,null,null,"From Persian دروازه‎ (darvâze).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Indo-Iranian *kr̥náwti.\n",null,"From Persian گرد‎ (gerd, “round”)",null,null,null,"From Proto-Indo-Iranian *ȷ́ástah, from Proto-Indo-Iranian *ȷ́ʰástas, from Proto-Indo-European *ǵʰóstos.\n",null,null,null,null,"From Proto-Iranian *daiH- (“to look, see”). Compare Persian دیدن‎ (didan).\n",null,null,null,null,null,null,null,"From Proto-Iranian (compare Persian نام‎ (nâm), Northern Kurdish nav, Avestan 𐬥𐬁𐬨𐬀𐬥‎ (nāman-)) from Proto-Indo-Iranian *Hnā́man- (compare Sanskrit नामन् (nā́man), Hindi नाम (nām)), from Proto-Indo-European *h₁nómn̥ (“name”) (compare Greek όνομα (ónoma), Italian nome, Tocharian A ñom, Armenian անուն (anun), and English name).\n",null,null,null,null,null,null,null,"Inherited from Proto-Indo-European *weh₁y-. See the cognates in *wéh₁itis.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Old Czech bot, from Old French bot.\n",null,null,null,null,null,null,null,null,"From ile +‎ -ość.\n",null,null,"From Proto-Slavic *kolysati.\n",null,null,null,null,null,"From moc +‎ -ny.\n",null,"From na +‎ przód.\n",null,"From Proto-Slavic *pàdati, from *pàsti + *-ati. Equivalent to paść +‎ -adać.\n",null,null,null,null,"From Proto-Slavic *plynǫti.\n","pod- +‎ nieść","pół (“half”) +‎ dnie/dzień (“day”)","From przy- +‎ kryć.\n",null,null,null,null,"s- +‎ padać or spaść +‎ -adać",null,null,null,null,null,null,"From Proto-Slavic *tu.\n","From Proto-Slavic *tvьrdъ.\n",null,"From u- +‎ kryć, from Proto-Slavic *kryti, from Proto-Indo-European *kruH- whence English crypt and cryptic.\n",null,"From wy- +‎ brać.\n","From za- +‎ palić.\n",null,null,"From z- +‎ ostać, from o- +‎ stać (1 sg. stanę), from Proto-Slavic *stati (stem *stan-).\n",null,null,null,null,null,null,null,null,"From caminho (“path”) +‎ -ar (forms infinitives); from Old Portuguese caminno (“way”), from Latin cammīnus (“way”), from Gaulish.\n",null,"Back-formation from cascar (“to peel”), from Vulgar Latin *quassicare, from quassāre.\n",null,null,null,null,null,"Borrowed from Spanish empujar (“to push”), from Late Latin impulsāre, frequentative of Latin impellere, present active infinitive of impellō (“I push”). Doublet of impulsar and empuxar.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"Merger of Old Portuguese por, from Vulgar Latin *por, from Latin prō (“for”) (with metathetic shift due to per), and Old Portuguese per, from Latin per (“through, by”).\n",null,"Borrowed from Latin praeparāre, present active infinitive of praeparō (“I prepare”).\n",null,null,null,null,null,null,null,null,null,"Borrowed from Latin terminō, termināre (“to limit; to finish”).\n",null,null,null,null,null,"From Vulgar Latin *virāre, from Latin gȳrāre or vibrāre.\n",null,"From Late Latin, Vulgar Latin *accoperīre, *accooperīre, from Latin ac- + cooperīre, present active infinitive of cooperiō (“cover completely”).\n","From a + facere.\n","Possibly from metathesis of a Vulgar Latin aucupāre, from Latin aucupārī, present active infinitive of aucupor. Other theories suggest Latin occupāre, present active infinitive of occupō, with meaning influenced by or confused with the former. Compare Aromanian apuc, apucari.\n",null,"Either from Latin eruncāre, present active infinitive of eruncō or from a + Latin runcāre, present active infinitive of runcō, ultimately from Proto-Indo-European *h₃rewk-. Another theory proposes a Vulgar Latin *averruncāre (“to distance that which is bad”), which is less likely.  Compare Aromanian aruc, arucari, Megleno-Romanian runc.\n","Past participle of ascuți.\n",null,"From a Vulgar Latin root *astectare, from an alteration of Latin adspectāre, an alternative form of aspectāre, present active infinitive of aspectō. Compare Aromanian ashteptu, ashtiptari, Italian aspettare, Sardinian aisetare, Sicilian astittari.\n","Either from târn (“a large broom made from brier used to sweep streets”), itself of Slavic origin, or from Latin tornāre (“to turn”) with suffix ad-. However, it would be an irregular phonetic evolution in this case (cf. turna, înturna).\n",null,"From French bordure",null,null,null,null,"From a Slavic language. Compare Bulgarian колец (kolec), Serbo-Croatian kòlac.\n","From a Slavic language, ultimately from Proto-Slavic *dolъ. Compare Serbo-Croatian dol.\n","From depărta +‎ -re.\n","Borrowed from French distance, Latin distantia.\n","Borrowed from French figure, Latin figura.\n",null,"Related to gata. Compare also Albanian gatis.\n","From *glara, possibly from German Kralle, following metathesis, or alternatively possibly a substratum word; another theory is that it perhaps derives from a hypothetical intermediate *înghiare, from a Vulgar Latin root *unglaris < *ungularis, from Latin ungula.","Probably a substratum word, akin to Albanian gropë, or possibly derived from it. Compare also Aromanian groapã.\n","From în + Proto-Slavic *vьrtěti (compare Serbo-Croatian вр̀тети (vr̀teti), Bulgarian въртя (vǎrtja)). A relation to Latin invertere or vertere is not probable. Compare Aromanian (a)nvãrtescu.\n",null,"Probably from Vulgar Latin *ligināre, from Latin ligāre (“tie”) or from leagăn.\n","Borrowed from Italian linea (18th c.); French ligne, German Linie (19th/20th c.), from Latin linea. Doublet of ie, which was inherited.\n","From older luva, from Latin levāre (“to lift”), present active infinitive of levō. Compare Aromanian ljeau, loari, Dalmatian levur, Portuguese levar, Neapolitan luvà. The loss of the initial -l- in some forms of the verb also occurs in such words as ierta, iepure, etc. Compare also Vulgar Latin *ablevāre, whence possibly Friulian jevâ, Albanian blej.\n","From the verb a lucra, or from Latin lucrum, itself from Proto-Indo-European *leh₂w- (“profit, gain”) + *-tlom.\n",null,"From a Slavic language, probably Bulgarian пръжина (prǎžina), пържина (pǎržina).\n","Probably from Proto-Slavic *praviti (“to twist, to turn”).\n",null,"Borrowed from French réussir, Italian riuscire.\n",null,null,null,null,"From a Vulgar Latin root *oricāre, derived from Latin orior (“rise, appear”).\n",null,"Borrowed from Slavic *vermę. Compare Bulgarian време (vreme), Serbo-Croatian vreme, Russian время (vremja).\n","From Proto-Slavic *bolěti.\n","From Proto-Slavic *bojàti.\n","From Old East Slavic възстати (vŭzstati), from въз- (vŭz-) + стати (stati). Synchronically, from вз- / вс- (vz- / vs-, “up”) +‎ стать (statʹ). Compare восста́ть (vosstátʹ), with the Church Slavonic version of the prefix.\n","From Proto-Slavic *vę̄zàti.\n","From Proto-Slavic *grę̑zь.\n","From Proto-Slavic *dȍmъ (“house; home”).\n","From Proto-Slavic *dorga.\n","From Proto-Slavic *duxъ.\n","за- (za-) +‎ жечь (žečʹ)","звон (zvon) +‎ -и́ть (-ítʹ)","From Proto-Slavic *koža.\n","Derived from an archaic Russian коли́кий (kolíkij) (whence also Russian ско́лько (skólʹko) or rare ско́лький (skólʹkij)) + -ество (-estvo).\n","From Proto-Slavic *ľubiti, from Proto-Indo-European *lewbʰ- whence English love.\n","Inherited Old East Slavic масло (maslo), from Proto-Slavic *maslo. Related to ма́зать (mázatʹ, “to smear”).\n","From Old East Slavic мѣшькъ (měšĭkŭ), from Proto-Slavic *měšьkъ, diminutive of *měxъ, from Proto-Indo-European *moiso-.\n","From Proto-Slavic *nogъtь, ultimately from Proto-Indo-European *h₃nogʰ-, *h₃nogʷʰ-.\n","From Proto-Slavic *edinъ, ultimately from Proto-Indo-European *óynos (“one, single”).\n","From Old East Slavic пальць (palĭcĭ), from Proto-Slavic *palьcь (“thumb, finger”).\n","From Proto-Slavic *peťi, from Proto-Indo-European *pekʷ-, whence English cook, culinary, cuisine, concoct and peptic.\nCognates include Russian пот (pot, “sweat, perspiration”), Sanskrit पचति (pácati), Albanian pjek, Tocharian B päk-, Ancient Greek πέσσω (péssō), Latin coquō.\n","под- (pod-) +‎ -ня́ть (-njátʹ)","Borrowed from Polish rysować, from Middle High German rīzen, whence also German reißen.\n","с- (s-) +‎ хвати́ть (xvatítʹ)","с- (s-) +‎ -чита́ть (-čitátʹ)","Inherited from Old East Slavic тънъкъ (tŭnŭkŭ), from Proto-Slavic *tьnъkъ.\n","From Proto-Slavic *ǫgъlъ, from Proto-Indo-European *h₂engulos (“joint?”), from *h₂eng- (“corner”).\n","у- (u-) +‎ слы́шать (slýšatʹ)","From Old East Slavic хлѣбъ (xlěbŭ), from Proto-Slavic *xlěbъ, from Proto-Germanic *hlaibaz, of unknown origin.\n","From Old East Slavic ꙗзꙑкъ (jazykŭ), from Proto-Slavic *(j)ęzykъ, from Proto-Balto-Slavic *inźūˀkas, from Proto-Indo-European *dn̥ǵʰwéh₂s, whence English tongue and language.\n",null,null,null,null,null,null,null,null,null,"From Proto-Turkic *adɨ-n (“other”), from *adɨ- (“to separate”). Cognate with Karakhanid [script needed] (aδïn, “other”), Karakhanid [script needed] (aδïrmāq, “to separate”), Turkish ayırmak (“to separate”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *kümüĺ ~ *gümüĺ (“silver”). The raising of *ü to /ø/ is irregular.\n",null,null,null,null,null,null,null,null,"From Proto-Turkic *kȫk (“blue, green”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,"From earlier *oqus < *oquz, from back vowel variant of Proto-Turkic *öküŕ (“ox, bull”). Cognate with Turkish öküz.\n",null,null,null,null,null,null,null,null,null,null,"From earlier *čās < *ǰās < *ǰāz, from Proto-Turkic *jāŕ (“summer, spring”). Cognate with Turkish yaz.\n",null,"Borrowed from Mongolic otherwise it is hard to explain word initial /s/, compare Mongolian санаа (sanaa, “thought”). Ultimately from Proto-Turkic *sāna- (“to think”), from *sān (“number, counting”), from *sā- (“to think, count”). Cognate with Turkish say- (“to count, regard”).\n",null,null,null,"Cognate to Siberian Tatar йем.\n",null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *temür (“iron”).\n",null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *dɨrŋa-k (“fingernail, claw”). Cognate with Old Turkic 𐱃𐰃𐰺𐰭𐰴‎ (tïrŋaq, “fingernail”).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Turkic *agrɨ-g (“pain, ache”). Cognate with Turkish ağrı.\n",null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null, ull,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,"From the noun cabo (“end, edge”), from Latin caput, or through a Vulgar Latin root *accapāre. Compare English achieve.\n",null,"From Old French baston (“stick, truncheon”); related to modern French bâton, Italian bastone. Cognate with English baton.\n","Borrowed from Latin collocare, present active infinitive of collocō (“place, put, assemble”). Compare the inherited doublet colgar.  Cognate with English collocate and couch.\n",null,"Inherited from Late Latin impulsāre, from Latin in + pulsāre, present active infinitive of pulsō, or a frequentative of impellō, impellere. Doublet of impulsar, a later borrowing.\n",null,"From earlier entonce, from Latin in tunc (“in that moment”). Compare Portuguese então and Romanian atunci.\n","From an earlier asconder, from Old Spanish asconder, esconder, from Latin abscondere, present active infinitive of abscondō. Cognate with English abscond. Doublet of absconder.\n","From fin (“end”).\n",null,"Possibly from garfa (“animal's claw”), from Andalusian Arabic جَارْفَا‎ (gárfa, “handful”), from Arabic غُرْفَة‎ (ḡurfa, “cup or dipper”), from غَرَفَ‎ (ḡarafa, “to ladle”), with influence from garfio (“hook”).\nOr, possibly from Gaulish *garrā (“leg”) (compare Breton gar, Old Irish gairri (“calves”)), from Proto-Celtic *garrā; see Cornish garr. Compare to English har / English harr",null,"Probably from Old Occitan guidar, from Frankish *wītan (“to show the way, lead”), from Proto-Germanic *wītaną (“to see, know; go, depart”), possibly through a Medieval Latin intermediate. Compare Portuguese guiar, French guider (Old French guier), Old Occitan guidar, Italian guidare, English guide.\n",null,null,"From limpio, or from a Late Latin limpidāre, from Latin limpidus. Compare Portuguese and Galician limpar, Asturian llimpiar.\n","From Old Spanish cras mañana or mannana (literally “tomorrow morning”), from Vulgar Latin *māneāna, from Latin māne, from Proto-Indo-European *meh₂-. Compare Portuguese manhã.\n",null,"From Latin molestāre, from molestus (“troublesome”).\n","From Old Spanish, from Vulgar Latin *passō (present infinitive Vulgar Latin *passāre), from Latin passum, supine of pando (“I stretch, I spread out”). Compare English pass, Italian passare, French passer, Portuguese passar.\n",null,null,null,null,"From Old Spanish rico, borrowed from Gothic 𐍂𐌴𐌹𐌺𐍃 (reiks, “mighty, powerful”), from Proto-Germanic *rīkijaz, from Proto-Celtic *rīxs, ultimately from Proto-Indo-European *h₃rḗǵs.\n","sucio +‎ -edad; cognate with Galician sucidade, Portuguese sujidade.\n",null,"From tapa (“lid, cover”) +‎ -ar.\n","From Medieval Latin, from Vulgar Latin *tirō, tirāre, of unknown or uncertain etymology. Possibly from Gothic *𐍄𐌹𐍂𐌰𐌽 (*tiran), from Proto-Germanic *teraną or alternatively Late Latin *martyrāre, possibly with influence from Latin trahō. Cognate with English tier. Compare English tear.\n",null,null,null,null,"From bashkë (“together, simultaneously”) +‎ -oj verb suffix.\n","From archaic and dialectal bënj (“to make appear; do, make”), from Proto-Albanian *banja, from Proto-Indo-European *bʰh₂-n-yé-ti, from *bʰeh₂- (“shine”) (compare Greek φαίνομαι (faínomai, “to seem, appear”).","From dialectal bjej, from Proto-Albanian *bera, from Proto-Indo-European *bʰerH- (“to strike”) (compare Old English berian, Latin ferīre).\n",null,null,null,null,null,"Aphetic form of dialectal ndëgjoj, from Old Albanian ëndiglonj (Buzuku), from Proto-Albanian *jāgnja, a derivative of gjoj. Compare Old High German jagon (“to hunt”). More at gjoj.\nFrom earlier ëndiglonj, from Proto-Albanian *intellegɔnjœ, borrowed through Vulgar Latin from Latin intellegо̄ (“I understand”). Compare Romanian înțelege.\n",null,null,null,"From *etës (compare dialectal ecëj), from Proto-Albanian *aitatja, from Proto-Indo-European *h₁éyti, present of *h₁ey-. Compare Serbo-Croatian ìći, Lithuanian eĩti. See heci.\n","Origin disputed. Either from Latin aere (“air”), (already reflected in Albanian ajër) or from Proto-Indo-European *h₁ey- (“to go”), influenced by ajër.\n","From fill +‎ -oj verb suffix.\n",null,"Borrowed from Latin fortis.\n","According to Orel, from Proto-Albanian *sprūgnja, etymologically connected to Lithuanian sprūgstu, sprūgti (“to escape, get out”) and Proto-Slavic *prygati (“to spring, jump”).\nEarlier form might have been *fnyj, from *pnyj,(Can this(+) etymology be sourced?) from Proto-Albanian *pnewa, hence from Proto-Indo-European *pnew-. Compare Ancient Greek πνέω (pnéō, “I blow”). A similar development p- > f- happened to ftoh, from Old Albanian ptoh.\n",null,null,"From dialectal Tosk pshij, pëshinj, from Proto-Albanian *bʰs-in-je/o-, from Proto-Indo-European *bʰes- (“rub”) (compare Old High German besamo (“broom”), Ancient Greek ψάω (psáō, “I rub”), English berry).\n",null,"From Old Albanian gluhë (“language, tongue”), from Proto-Albanian *gluxā, from earlier *gulsā, from pre-Albanian *gl̥so-, zero-grade of Proto-Indo-European *gols-o- (compare Proto-Balto-Slavic *galsas (“voice”), Proto-Germanic *kalzōną (“to call”)).\n","From Serbo-Croatian goditi (“to please”), pogoditi (“I hit”).",null,null,null,"From dialectal and archaic helq, from Proto-Albanian *(w)alkja, from *h₂wolkéye-, causative of Proto-Indo-European *h₂welk- (“to pull”) (compare Lithuanian velkù, Bulgarian влека́ (vleká, “to drag”), Greek αυλάκι (avláki, “furrow”)).\n",null,null,null,null,null,"From Proto-Albanian *kapa, from Proto-Indo-European *keh₂p-. Cognate to (Baltic) Latvian kàmpju, kàmpt; Proto-Celtic *kawnos (Old Irish cúan, Irish cuan, Scottish Gaelic cuan); Proto-Germanic *habnō, Proto-Germanic *habjaną (“to have, lift”); Proto-Hellenic *kapťō (Ancient Greek κάπτω (káptō)), Proto-Hellenic *kṓpā (Ancient Greek κώπη (kṓpē)); Proto-Italic *kapiō (Latin capiō) and (perhaps) also Old Armenian խափ (xapʿ), Old Armenian խափանեմ (xapʿanem) (perhaps) and Latin capsa. Possibly also an ultimate doublet of kopsht.\n",null,"From Proto-Albanian *kakja, from Proto-Indo-European *kaw- (compare Ancient Greek κακός (kakós, “bad”), Lithuanian keñti (“to be evil”).\nFrom Proto-Albanian *kakii̯a / *kakii̯ā, compare Ancient Greek κακός (kakós, “bad”).\n","A derivative of kërcas, originally meaning 'to crack, to snap', thus 'to jump, to dance'. A descriptive term.\n",null,"Prefixed derivative of thyej (“to breach, break”).\n","Deverbative of kthej (“to turn”).\n","From Proto-Albanian *ka-ei, based on a pronominal element *ka and a demonstrative (see ai).",null,null,null,null,"From Proto-Albanian *elaiwanja, based on *elaiwā, borrowed from Ancient Greek ἔλαιον (élaion, “oil”).",null,null,"From mbanj (Arbëreshë), from *ënbanj (compare Old Gheg ënbaj), from Proto-Albanian *en- (an intensive prefix) + *barnja, causative of *bera (modern bie). More at bie.\n","According to Meyer and Tagliavini from mbar (“I bring (back)”) (mbar +‎ -oj). Related to Albanian mbarë (“good, right, complete, wholly, etc.”), further related to mbart (“I bear, carry (back)”), Albanian mbaj (“I hold, carry”) and bie (“I bring”).Orel proposed it as a (prefixal) derivative of parë.A formation with the verbal suffix -o-, from Proto-Albanian *-ē- (from *-eh₁-).(Can this(+) etymology be sourced?)","From older mbëledh, from Old Albanian ënbëljedh, from Proto-Albanian *ambiledza, compound of *ambi (“on, over”) (modern mbi) + *ledza, from Proto-Indo-European *leǵ- (“to gather”) (compare English leech (“doctor”), Latin legere, Ancient Greek λέγω (légō)).\n",null,"Compound of mbi +‎ rojë (“guard”), from ruoj (“to guard, to keep”). Related to mburojë. According to Orel, borrowed from a Romance language (compare Italian imparare).","From mbi (“on, upon”) + ul (“to lower, put down”), from Proto-Albanian *ambi-wēla, from Proto-Indo-European *wel- (“to press together”), probably a secondary formation after mbyll (“close, shut down”). See mbyll and ul.\n",null,null,"From *ndërr, from Proto-Albanian *anteros, from Proto-Indo-European *an-2 (“there, on the other side”). Cognate to Old Prussian antars, anters (“other, second”), Lithuanian añtras and Old High German andar (“other”).\n",null,null,null,null,"Ultimately from Latin pācāre. Source language is uncertain, as is the possibility of a direct borrowing. Possibly from Italian pagare or alternatively a derivative of pagë, also from Italian.\n",null,"From prapë, from Proto-Albanian *per apa, *pra apa, the second element being identical with pa.",null,null,"The current form is a participle of an obsolete form *pojë, which is a zero-grade suffixed derivation of *h₃ep- (“to work”). Relationship with Hittite [script needed] (ḫappinaḫḫ, “to become rich”) is unclear, even though there have been cases in which an older -i- has become a -u- (ahu (“beech”) is also attested as ahi in older dictionaries), making it possible for this word to have been *pina with a different meaning.\nAlternatively a derivative in -në of an unused verb *puaj, continuing Proto-Albanian *pānja. The latter is related to Ancient Greek πένομαι (pénomai, “to strain, work on”) and its deverbative πόνος (pónos), with uncertain further links.",null,null,null,null,"See active voice form rris (“to rear, grow”).\n","Variant of ruoj.\n","From sa.\n",null,"According to Orel, borrowed through Vulgar Latin from the deponent Latin sequor (“to follow”), in particular oculis sequor (\"to follow with eyes\").\nUltimately a doublet of shoh via Proto-Indo-European.\nHowever, Çabej deems it a word which has come fairly recently into usage, unlike the ancient borrowing Orel proposes. It is lacking in the Meshari of Buzuku completely, and also in certain dialects in Southern Albania and in Italy and Greece it's nowhere to be heard. This leads to the assumption that it's not a very old term, thus a potential Latin origin disputable. Possibly an enlargment with the verbal suffix -oj.\n","Syncope of shtekoj (“to set out, take to the road”), Gheg variant of shtegoj, denominative verb from shteg (“path, trail”).","From sh- (mobile suffix) +‎ ngrij.\n","From Proto-Albanian *staiga, from Proto-Indo-European *stóygʰos (“way”), from *steygʰ-. Cognate to Ancient Greek στοῖχος (stoîkhos, “line, row”), Gothic 𐍃𐍄𐌰𐌹𐌲𐌰 (staiga, “way”), Latvian staĩga (“walking”).\nFrom earlier shtek, from Proto-Albanian *śtaigʉh, from Proto-Indo-European *stóygʰos < *steygʰ- (“to climb”).\n","Through Vulgar Latin, from Latin hospitium; compare Ancient Greek ὁσπίτιον (hospítion) (modern Greek σπίτι (spíti)).","From archaic and dialectal shtynj, from Proto-Albanian *stūdnja, from Proto-Indo-European *(s)tewd- (“push, thrust”) (compare German stoßen, Latin studeō).\n","Apocope of *thuan, from Proto-Albanian *(a)tsāna, or *ćāhai, from Proto-Indo-European *h₂eḱ- (“sharp”) (compare Lithuanian ašnìs (“blade edge”), Ancient Greek ἄκανος (ákanos, “pine thistle”), English awn (“bristle of barley”)).\n",null,"Mediopassive of ul (“I lower”); ul (“I lower”) +‎ -em (“myself”) → meaning “I sit down”.\n","A formation in -s of Proto-Albanian *awa-deja, from earlier *dej, continuing Proto-Indo-European *dʰōh₂u-. Compare Old Church Slavonic давити (daviti, “suffocate”), Gothic 𐌰𐌷𐌳𐌰𐌿𐌹𐌸𐍃 (ahdauiþs, “tormented”), Old Irish díth (“end, death”), Avestan 𐬛𐬎𐬎𐬀𐬌𐬛𐬍‎ (duuaidī, “we press”).\n",null,null,"From Proto-Albanian *wesi, from earlier *ōusi, from Proto-Indo-European *h₂ṓws- and dual ending *-ih₁. Cognate with Lithuanian ausìs (“id”), Ancient Greek οὖς (oûs), Latin auris. According to Witczak, it is the source of Doric Greek βαίεσσα (baíessa).\n",null,null,null,null,"Compound of an (“on, at”) +‎ tända (“to ignite, light”). Similar compounds can also be found in other Germanic languages; compare German anzünden, Norwegian antenne.\n",null,null,null,"Apocopic form of bliva, from Old Swedish bliva, from Middle Low German blîven (“to remain”), from Old Saxon bilīvan, from Proto-West Germanic *bilīban, from Proto-Germanic *bilībaną.\n",null,null,null,null,null,null,null,null,null,null,null,"past participle of höja.\n",null,"From earlier lemna, from Old Swedish limna, lifna, from Old Norse lifna, inchoative of Proto-Germanic *lībaną (“to remain, to be left”), from Proto-Indo-European *leyp-.\n",null,null,null,null,null,"From Old Swedish platz, from Old Norse plaz.\n","From Late Old Norse reikna, which is borrowed from Middle Low German rekenen. Cognate with Icelandic reikna, English reckon.\n",null,null,null,null,null,"Old Norse stikka, from Proto-Germanic *stikkô. Compare Icelandic stika, English stick.\n",null,null,null,null,null,null,null,"From அ (a, “there, that”, pronominal base) +‎ பொழுது (poḻutu, “time”). see Proto-Dravidian *a-. (This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.).\n",null,null,null,null,null,null,null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,null,null,"Cognate with Tulu ಕಟ್ಟ್ (kaṭṭ), Telugu కట్టు (kaṭṭu) (This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"Cognate with Kannada ಕತ್ತು (kattu), Malayalam കഴുത്ത് (kaḻuttŭ)(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"Cognate with Telugu కాలు (kālu), Malayalam കാല് (kālŭ), Kannada ಕಾಲು (kālu), Tulu ಕಾರ್ (kār).\n",null,null,"From Sanskrit गुहा (guhā)",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"Cognate with Malayalam കേൾ (kēḷ).\n","Cognate with Malayalam കൊമ്പ് (kompŭ), Telugu కొమ్ము (kommu), Kannada ಕೊಂಬು (kombu)",null,null,"From செய் (cey) +‎ -தி (-ti). Cognate with Telugu చెయిదము (ceyidamu).\n","Cognate with Telugu చేరు (cēru), Kannada ಸೇರು (sēru).\n",null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","Cognate with Telugu తూగు (tūgu), Telugu తూకొను (tūkonu), Malayalam തൂക്കുക (tūkkuka).\n",null,null,"Cognate with Kannada ಹಿಡಿ (hiḍi), Malayalam പിടി (piṭi), Telugu పిడి (piḍi).\n",null,null,null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"From மறைத்தல் (maṟaittal, “to conceal”). \n",null,nul ing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,"పట్టు (paṭṭu) +‎ కొను (konu)",null,null,null,"From Sanskrit प्रकाश (prakāśa)  +‎ -ఇంచు (-iñcu)","From Sanskrit प्रवेश (praveśa, “entering, entrance”)  +‎ -ఇంచు (-iñcu)",null,"From Sanskrit भय (bhaya, “fear”) + Telugu పడు (paḍu)","From మారు (māru)",null,null,null,null,null,"లెక్క (lekka) +‎ పెట్టు (peṭṭu)",null,null,null,null,null,null,null,null,null,"వెలుగు (velugu) +‎ -ఇంచు (-iñcu)",null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)","(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,null,null,"Cognate with Old Turkic [script needed] (aldā-).",null,null,null,null,null,null,"From Old Turkic baġla- , from bağ.\n",null,null,"From Old Turkic bat-, from Proto-Turkic *bat-.\n","From Old Turkic bekle-.\n",null,null,"From Old Turkic büt-, from Proto-Turkic.\n","From Old Turkic boz-, buz-, from Proto-Turkic *buŕ- (“to damage, destroy”), *boŕ- (“to damage, destroy”).\n",null,"From Old Turkic çal-‎ (çal-), from Proto-Turkic.\n",null,null,null,null,"From Old Turkic tal, from Proto-Turkic *tāl, *dal.\n",null,null,null,null,"From Old Turkic, from Proto-Turkic.\n","From Old Turkic tur-, from Proto-Turkic *dur- (“to stand”).\n",null,"From Old Turkic tuy-, from Proto-Turkic *duj- (“to perceive (by ears or nose), notice”).\n",null,null,null,null,null,null,null,"From Proto-Turkic *in (“lair, burrow”). Cognate with Kazakh ін (in).\n","From Ottoman Turkish اینچه‎ (ince/inçe), from Proto-Turkic *yiŋč-ge (“thin”).\n",null,"From Old Turkic it-, from Proto-Turkic *it- (“to push, hit”).\n",null,null,null,null,"From Ottoman Turkish and Old Anatolian Turkish قاپو‎ (qapu). Ultimately a derivation from Proto-Turkic *kap- (“to close, cover”). Cognate with Old Turkic 𐰴𐰯𐰍‎ (kapıg), Azerbaijani qapı, etc.\n",null,"From Old Turkic kogış, from Proto-Turkic *K(i)adɨ-.\n","From Ottoman Turkish قرمق‎, from Proto-Turkic *kïr-.\n","From Old Turkic kıdıg, from Proto-Turkic *Kɨd-.\n",null,"From Ottoman Turkish قونشمق‎.\nSurface etymology kon +‎ -uş + -mak. Literally, \"to settle mutually\".\n",null,"From Proto-Turkic. Cognate with Azerbaijani qorxmaq, Kazakh қорқу (qorqw), Uzbek qoʻrqmoq, Chuvash хӑра (hăra).\n","Cognate with Azerbaijani qorumaq (“to protect”), Old Turkic 𐰸𐰆𐰺‎ (korï-, “to protect”), Uzbek qoʻrimoq (“to protect”).\n","From Old Turkic köti, from Proto-Turkic.\n","From Old Turkic kod-, from Proto-Turkic.\n","From Old Turkic koñ, from Proto-Turkic; cognate with Azerbaijani qoyun, Turkmen goýun, Kazakh қой (qoy), Uzbek qo'y. Related to written Mongolian ᠬᠣᠨᠢᠨ (qonin, “sheep”), Mongolian хонь (honʹ, “sheep”), Buryat хонин (xonin, “sheep”) and Kalmyk хөн (xön, “sheep”), but the nature of relationship is unclear; the Mongolic terms may be borrowed from Turkic. Pedersen derived all of these forms from Old Armenian խոյ (xoy), but in Doerfer's opinion this is phonetically impossible. Ačaṙyan too regards the resemblance to Old Armenian խոյ (xoy) as accidental.\n",null,null,null,"From Ottoman Turkish او‎ (o).  Merger of Old Anatolian Turkish ol‎ and an‎ (“she, he, that, it”), from Old Turkic 𐰆𐰞‎ (ol) and [script needed] (an), respectively; both from Proto-Turkic. Cognate with Karakhanid اُلْ‎ (“he, she, it; that”) and Chinese 兀 (wù, “that”).\n","From Old Turkic [script needed] (öte-), from Proto-Turkic *ȫte-.\n",null,null,null,null,null,null,"From Ottoman Turkish پارلامق‎.\n",null,"pis (“dirty”) +‎ -lik",null,null,null,null,"From Proto-Turkic *saba- (“to beat, hit, fight”). Cognate with Azerbaijani savaş (“war”).\n",null,"From Proto-Turkic *ses. Cognate with Crimean Tatar, Gagauz, Turkmen ses, Azerbaijani səs.\n",null,null,null,null,null,"From Old Turkic sipir-, süpür-, from Proto-Turkic. Cognate with Azerbaijani süpürmək, Chuvash шӑпӑр (šăpăr, “broom”)",null,"Cognate with Old Turkic [script needed] (sürüg).\n","From Old Turkic titre-  (\"to shake due to fear, anger or cold\"), from titiz (\"acrid or angry\").\n",null,null,null,"(This etymology is missing or incomplete. Please add to it, or discuss it at the Etymology scriptorium.)",null,null,"From Old Turkic.\n",null,"From Old Turkic yalıŋuz, from yalŋus, from yalıŋ (\"naked\") (compare yalın), from yalın- (\"to undress oneself\"), from Proto-Turkic *yalïŋ (“lonely”), probably a reflexive of *yal- (\"to take off\") (compare giyin- (“to dress oneself”), reflexive of giy- (“to wear”)).\n",null,"From Ottoman Turkish یاش‎ (yaş, “wet, moist, fresh”), from Proto-Turkic *yāĺ (“young, fresh”).\n",null,null,"Passive form of yıkamak.\n","From Ottoman Turkish یول‎, from Proto-Turkic *yōl (“road”).  Compare Old Turkic [script needed] (yol).\n","yüksek (\"high\") + -lik (\"-ness\") (derivative suffix)\n",null,null,"Borrowed from a Turkic language, compare Kazakh аға (ağa).\n","From Proto-Finno-Permic *ańće- like Komi-Permyak аддзыны (addzyny).\n",null,null,null,"Borrowed from a Turkic language, compare Tatar апа (apa).\n","Borrowed from Chuvash эрне (erne).\n","Of Permic origin, related to Komi-Permyak бан (ban).\n",null,null,null,null,null,null,null,null,"From Proto-Permic [Term?], cognate to Komi-Permyak велавны (velavny).\n",null,null,null,null,null,null,null,"A Permic word (*wäśä-) like Komi-Permyak висьны (visʹny), akin to Finnish väsyä.\n",null,null,null,null,"From Proto-Finnic *waje.\n","From Proto-Permic *wanša, cognate to Komi-Permyak важ (važ). The Permic word is related to Estonian vana and  Finnish vanha.\n",null,"A Permic word (*wäke-) like Komi-Permyak воны (vony).\n",null,"From Proto-Finno-Ugric *wuďe. Cognates include Eastern Mari у (u), Finnish uusi and Hungarian új.\n","Related to Kazakh ору (orw).\n",null,null,"From Proto-Uralic *künče.\n",null,"A Permic word (*gud).\n",null,null,null,null,null,null,null,null,null,null,null,null,null,"From Proto-Permic [Term?]. Cognates include Komi-Zyrian кар (kar).\n","From Proto-Uralic *käćetä, like Komi-Permyak кӧдзыд (ködzyd).\n",null,null,null,null,"From a Permic *kud.\n",null,null,null,null,null,null,null,"From Proto-Uralic *käle. Cognates include Komi-Permyak кыв (kyv), Finnish kieli and Northern Sami giella.\n","From Proto-Uralic *kule-.\n",null,null,null,null,null,null,"From Proto-Uralic *lewle.\n",null,null,null,null,null,null,"From Proto-Uralic *mene-.\n",null,null,"From Proto-Permic *nu-, cognate to Komi-Permyak нуны (nuny).\n","From Proto-Permic [Term?], from Proto-Uralic *nejde.\n",null,null,null,null,null,null,null,"From Proto-Permic *pośe, cognate to Komi-Permyak пӧсь (pösʹ).\n","From Proto-Uralic *puwe.\n",null,null,null,"From Proto-Uralic *päŋe.\n",null,null,null,null,null,"From Proto-Permic [Term?], cognate to Komi-Permyak пырны (pyrny).\n",null,"From Proto-Permic [Term?], cognate to Komi-Permyak сьöкыд (sʹökyd).\n","From Proto-Permic [Term?], cognate to Komi-Permyak сетны (setny).\n",null,null,null,null,null,null,null,null,"From Proto-Uralic *tumte-.\n","Related to Komi-Zyrian тӧлысь (tölysʹ) and Eastern Mari тылзе (tylze).\n","From Proto-Permic *turn, from Proto-Finno-Permic *tarna, borrowed from Indo-European, from Proto-Indo-European *tr̥nós. Cognate with Komi-Permyak турун (turun), Finnish taarna.\n","From Proto-Uralic *tule.\n",null,"A Permic word like Komi-Permyak удж (udž).\n",null,null,"From Proto-Uralic *elä-.\n",null,null,null,null,null,"From Proto-Permic [Term?], cognate to Komi-Permyak чӧскыд (čöskyd).\n",null,null,null,null,null,null,null,"From Proto-Permic [Term?], cognate to Komi-Permyak шуны (šuny).\n",null,null,null,null,"From Proto-Slavic *brudъ.\n",null,null,null,"From Proto-Slavic *grǫdь.\n","From Old Church Slavonic звьнѣти (zvĭněti), from Proto-Slavic *zvьněti. Ultimately from Proto-Indo-European *ǵʰwon-, *ǵʰwen-, *ǵʰaw-.\nCognates with Polish dzwonić.\n","From Proto-Slavic *žiti, from Proto-Indo-European *gʷeih₃w- (“to live”). Cognate to Lithuanian gyventi, Sanskrit जीवति (jīvati), Latin vīvō.\n","From Old East Slavic жена (žena) +‎ -ка (-ka
